(345, 'Vox Teneo', 'Square Vergote 34', '1030', '1030 Bruxelles - Belgique', '+32 (0)2 743 37 60', 'info@voxteneo.com', 50.8469, 4.40444, '2011-11-14 08:47:11', '2011-12-09 21:16:59', 'The Vox Teneo company was created in 2002 by three partners coming from complementary fields (development, analysis, project management, ergonomics and design). It is active in the development of interactive management and communication applications.\r\n\r\nLast June, Vox Teneo integrated the activities of DMoon, a Belgian company created in 2003 which was also active in the sector of communication tools development. This takeover permitted Vox Teneo to grow further, completing its Open Source competences and expanding its range of proposed solutions.\r\n\r\nWe now have a team of over twenty of people and we are present in Belgium, Luxembourg and France (with offices in both Paris and Lille).\r\n\r\nOur customers essentially come from the public sector (European Parliament, around fifteen municipal administrations, FPS Public Health, etc.), transportation, services and the media. We are also present in the industrial sector.\r\n\r\nThe engine driving Vox Teneo is above all desire. A desire which was transformed into reality thanks to three fundamental values: Ingenuity, Rigour, Flexibility. ', 'vox-logo.jpg', 'image/jpeg', 10231, '2011-12-09 16:10:24', 1, 'Interactive communication management'),
