(356, 'webalive', 'Stoopkensstraat 89 Bus 2', '3320', 'Hoegaarden', '3216768222', 'sales@webalive.be', 50.7787, 4.89064, '2011-11-14 08:47:11', '2012-04-18 16:07:18', 'webalive? Een hecht team ervaren vakmensen die samen reeds 640 websites maakten die cht werken. Une quipe soude de professionnels chevronns ayant dj ralis ensemble 640 sites web efficaces.\r\n\r\nMet de studio5 webtoepassingen van webalive beheert u zlf uw website, extranet en nieuwsbrieven als een gewone computer gebruiker. U laat uw website zlf scoren bij de Googles van deze wereld. U analyseert en verbetert zlf het rendement van uw site.\r\n\r\nLes applications web de webalive vous permettent de grer vous-mme votre site web, votre extranet, votre catalogue et vos newsletters comme un simple utilisateur de loutil informatique. Vous vous chargez en outre vous-mme du rfrencement de votre site web sur les moteurs de recherche comme Google. Vous analysez et amliorez personnellement le rendement de votre site.\r\n\r\nwebalive biedt u professioneel maatwerk tegen een vaste, KMO-vriendelijke prijs. Onze vakmensen verdedigen uw bedrijfskleuren met hart en ziel en schrijven uw website op het lijf van uw organisatie. U geniet van scherpe, vaste opstartkosten. U gebruikt kosteloos onze webtoepassingen (cms, nieuwsbrieven, extranet, catalogus). En vanaf het 2e jaar betaalt u alleen maar een (jaarlijks opzegbare) updateovereenkomst tegen een vaste, nooit gendexeerde prijs.\r\n\r\nwebalive vous propose du travail professionnel sur mesure  un prix fixe, abordable pour les PME. Nos professionnels dfendent avec acharnement les couleurs de votre entreprise et laborent un site web personnalis pour votre organisation. Nos frais de dmarrage sont comptitifs et ne varient pas. Vous utilisez sans frais nos applications web (cms, newsletters, extranet, catalogue). De plus,  partir de la 2me anne, vous ne payez plus que pour un contrat de mise  jour (rsiliable annuellement), moyennant un prix fixe, jamais index.', 'Avatar-smiley-100.png', 'image/png', 5284, '2012-04-18 16:02:37', 1, 'websites die werken - des sites web efficaces'),
