(452, 'Foruforever', 'Rue Thophile vander Elst', '1170', 'Bruxelles', '', 'contact@foruforever.net', 50.8064, 4.4056, '2011-12-20 17:10:42', '2011-12-20 17:43:45', 'Upon your death, what will you pass on from your life? Foruforever allows you to make your biography for free by gathering at your own pace your writings, photos, movies, drawings, favorite music, letters, etc. You can thus simply and safely build your Life Album: a unique testimony meant for your relatives or open to all, depending on your choice. We also offer several online and offline services to inform, share and support people who are directly or indirectly affected by death matters. Foruforever is a fondation aiming at restoring death to its rightful place as a natural part of life.', 'Foruforever-LogocompletUK.jpg', 'image/jpeg', 387359, '2011-12-20 17:35:51', 0, 'Death is part of life'),
