(507, 'Pixiwooh !', 'Av. de la Paix, 18', '1330', 'Rixensart', '+32 2 652 09 18', 'hello@pixiwooh.com', 50.7118, 4.53642, '2012-08-02 08:30:59', '2012-08-03 14:48:09', 'Pixiwooh ! est une jeune agence de communication online/offline.\r\n\r\nNos services s''tendent du webdesign/multimdia (sites web, e-commerce, sites mobiles,...)  la production offline (affiches, catalogues, flyers,...) en passant par le branding (cration de logo, dveloppement de l''image de marque, chartes graphiques,...).      Jeune et dynamique, la Pixiwooh ! Team se dfinit par des mots simples : Crativit, Efficacit, Cr-Activit, Personnalit, Moderne,\r\nAttention et Disponibilit.     Le tout excut avec UNE obsession fondamentale :\r\nla QUALIT !', 'avatar_twitter.png', 'image/png', 2144, '2012-08-02 09:08:05', 1, 'Creative Agency'),
(508, 'Pillows Factory', 'Rue Victor Allard 88', '1180', 'Uccle', '+3228808130', 'contact@pillows-factory.com', 50.8016, 4.33266, '2012-08-03 13:28:25', '2012-08-03 14:48:08', 'Pillows Factory is an identity agency dedicated to improving your brand identity & communication in every one of its aspects.', 'favicon.png', 'image/png', 49585, '2012-08-03 13:32:20', 1, 'You Can Rely On Us'),
(509, 'The Bocal', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2012-08-27 15:33:58', '2012-10-01 17:47:54', NULL, NULL, NULL, NULL, NULL, 1, NULL),
(510, 'Mister Jekyll', 'Avenue des volontaires 19', '1160', 'Bruxelles', '+32 488 30 23 52', 'social@misterjekyll.be', 50.8251, 4.40028, '2012-09-28 07:19:16', '2012-10-01 17:48:26', 'An all-Belgian digital agency. \r\n\r\nMister Jekyll and his team help you to create your own custom web identity, your digital projects on a broad range of devices. \r\n\r\nHis team is mainly specialized in responsive web design (RWD) which is a technique that adapts your website to the viewing environment, presented in a user-friendly manner that facilitates reading and navigation of the site. \r\n\r\nAlthough you will never meet Mister Jekyll in person, he provides the best quality and services in web design and development. \r\n\r\nMister Jekyll is a digital gentleman and has all the necessary know-how to provide customized websites and digital projects, tailored to the bespoke needs of institutions, SMEs and large corporations.', 'MJ-symbol-full-big.png', 'image/png', 4618, '2012-09-28 07:23:00', 1, 'Digital Gentleman'),
(511, 'Paperpixel Studio', 'rue strailhe', '4020', 'Lige', '', 'hello@paperpixel.net', 50.638, 5.58183, '2012-09-28 20:30:48', '2012-10-01 17:47:48', 'Un dveloppeur backend, un dveloppeur frontend, Paperpixel est la runion de deux curieux, touche--tout, aimant et pratiquant tant la vido que la musique, la photographie que la gastronomie. Le cocktail idal pour raliser des applications web de qualit au design toujours en phase avec les tendances, esthtiquement et fonctionnellement irrprochables.\r\n\r\nEn plus d''avoir fait de notre passion un mtier, nous apprenons sans cesse de nouvelles techniques, de nouvelles disciplines. Nous dveloppons actuellement une application crative o l''interactivit se mle aux dernires avances en matire d''interfaces homme-machine. O l''esthtisme est dclin en code, o l''utilisateur retrouve sa place de chef d''orchestre dans un mix de virtuel et de rel.', '539209_372998209436687_1972471523_n.jpg', 'image/jpeg', 20326, '2012-09-28 20:40:45', 1, 'Dveloppeurs web, graphistes et artisans numriques'),
(512, 'Sharpness', 'rue des Floralies 81', '1200', 'Brussels', '', 'firstcontact@sharpness.be', 50.8451, 4.43536, '2012-10-09 08:30:01', '2012-10-09 14:29:02', 'Digital Creative Agency. We understand the digital language, let us help you in your next digital journey.\r\nSpecialized in e-marketing and e-Advertising.', 'logo100.png', 'image/png', 3051, '2012-10-09 08:38:00', 1, ''),
(513, 'VOUS', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2012-10-11 14:11:28', '2012-10-11 14:11:28', NULL, NULL, NULL, NULL, NULL, 0, NULL),
(514, 'black belt robots', 'Rotenaard 34', '2650', 'Edegem', '+32 498 142 866', 'hello@blackbeltrobots.com', 51.1498, 4.45968, '2012-10-17 10:21:34', '2012-10-17 10:24:23', '', NULL, NULL, NULL, NULL, 0, 'unlock possibilities'),
(515, 'Snowcap', 'Boulevard Saint-Michel 75', '1040', 'Bruxelles', '+32 2 305 33 54', 'shoot@snowcap.be', 50.8337, 4.40511, '2012-10-29 21:06:03', '2012-10-30 08:53:59', 'Don''t expect us to deliver what you already have - we would rather hear about the rock-solid, extreme performance web platform you''ve always wanted. ', 'white_on_black_big.png', 'image/png', 4388, '2012-10-29 21:20:01', 1, 'Extreme precision developers'),
(516, 'Havas World Wide Brussels', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2012-10-30 08:13:41', '2012-10-30 08:13:41', NULL, NULL, NULL, NULL, NULL, 0, NULL),
(517, 'Lynkky', 'Rue Charles Dieu, 1', '7340', 'Colfontaine', '+32 474 98 10 52', 'gmonseu@gmail.com', 50.4112, 3.85199, '2012-11-22 16:18:02', '2012-11-22 16:24:38', 'Agence Web Lynkky : Cration et rfrencement de sites Internet. SITE INTERNET : Cest la part la plus importante de votre communication en ligne. Que vous soyez un indpendant, une PME ou une association, nos offres sont parfaitement adaptes  vos besoins. GESTION DU CONTENU : La plateforme utilise pour grer votre contenu est WordPress. Similaire  un traitement de texte, vous n''aurez aucun mal  grer votre site Internet. REFERENCEMENT : Pour tre visit, votre site Web doit d''abord tre trouv. Voil tout l''enjeu du  rfrencement . Lynkky en a fait sa spcialit et vous dit tout. FORMATION : Peu avant le lancement de votre site Web, une formation vous est dispense afin de vous rendre le plus indpendant possible. Vous grez ainsi vous-mme votre site Web sans frais supplmentaire. DESIGN : Nous n''avons pas deux fois la chance de faire une bonne premire impression. C''est pourquoi Lynkky vous offre un design soign, clair et intuitif pour vos visiteurs.', 'lynkky-noir-grand-carre.jpg', 'image/jpeg', 35840, '2012-11-22 16:24:37', 0, 'Le lien de votre russite Web !');
