INSERT INTO jobs (id, post_id, company_id, skills, how_to_apply, created_at, updated_at, job_type_id, location) VALUES
(1, 6, 381, '<p>Cras mattis consectetur purus sit amet fermentum. Nullam quis risus eget urna mollis ornare vel eu leo.</p>', '<p>please send email at <a href="mailto:info@webshaker.be">info@webshaker.be</a></p>', '2011-11-16 13:36:47', '2011-11-16 13:36:47', 2, 'Lige'),
(2, 24, 145, '<ul>\r\n<li>Photoshop skills as far as webdesign is concerned</li>\r\n<li>A strong UI/UX knowledge</li>\r\n<li>Must have designed some nice layouts to prove him(her)self</li>\r\n<li>Passion </li>\r\n<li>Seriousness</li>\r\n<li>Rigor</li>\r\n<li>Did I say passion ?</li>\r\n</ul>', '<p>If you have great skills, passion and time to spend with us ! Please don''t hesitate to drop a line on info@epic.net</p>', '2011-12-06 13:58:28', '2011-12-06 13:58:28', 3, 'Epic'),
(3, 51, 345, '<p>- We place great emphasis on motivation and skills.<br />- Knowledge of the second language and/or English is a plus.<br />- We place great emphasis on relationship-building qualities.</p>', '<p>Please submit your motivation letter and your CV to Sophie Doumont</p>\r\n<p>A form is available, following this link :</p>\r\n<p><a href="http://www.voxteneo.com/en/company/jobs" target="_blank">http://www.voxteneo.com/en/company/jobs</a></p>', '2011-12-09 16:05:02', '2011-12-09 16:12:35', 2, 'Bruxelles'),
(4, 59, 285, '<p>PHP</p>', '<p>please send you CV : jobs@sectionmedia.be</p>', '2011-12-12 09:43:53', '2011-12-12 09:43:54', 2, 'Brussels'),
(5, 60, 268, '<p><strong>Votre profil :</strong></p>\r\n<ul>\r\n<li><strong>&nbsp;</strong>Maitrise parfaite du langage C# &amp; ASP.NET</li>\r\n<li>Connaissance des classes du Framework .NET 2.0, 3.5 et 4.0<strong>&nbsp;</strong></li>\r\n<li>Bonne connaissance de XHTML, CSS, Javascript et JQuery<strong></strong></li>\r\n<li>Bonne connaissance du langage SQL<strong></strong></li>\r\n<li>Connaissance de IIS7<strong></strong></li>\r\n<li>Connaissance des composants DevExpress ASP.NET (y compris l&rsquo;ORM de DevExpress XPO)<strong></strong></li>\r\n<li>Vous poss&eacute;dez une exp&eacute;rience de minimum quatre ans dans la&nbsp; r&eacute;alisation d&rsquo;application orient&eacute;es objets en .NET C# (avec minimum trois ans dans la r&eacute;alisation de sites en ASP.NET)<strong></strong></li>\r\n<li>Vous faites preuves d&rsquo;une m&eacute;thode de travail orient&eacute;e r&eacute;sultats et &ecirc;tes capable de tenir les deadlines des projets qui vous sont confi&eacute;s.</li>\r\n</ul>\r\n<p><br /><strong></strong></p>\r\n<p><strong>Si possible&nbsp;:</strong></p>\r\n<ul>\r\n<li>Connaissance de LINQ, .NET Remoting, et WCF</li>\r\n<li>Connaissance d&rsquo;ASP.NET MVC</li>\r\n</ul>\r\n<p><strong>Sont consid&eacute;r&eacute;s comme un plus :</strong></p>\r\n<ul>\r\n<li>Connaissance de SharePoint</li>\r\n<li>Connaissance des Workflows de .NET 4.0</li>\r\n<li>Connaissance de Flash</li>\r\n</ul>', '<p>Vous correspondez &agrave; ce profil? Envoyez votre CV et votre lettre de motivation &agrave; job@produweb.be</p>', '2011-12-12 09:45:46', '2011-12-12 10:01:19', 2, 'Lige'),
(6, 63, 285, '<p><strong>Essential Skills and Experience:</strong></p>\r\n<ul class="job-list">\r\n<li>Bachelors Degree preferred</li>\r\n<li>Fluent in Dutch and English</li>\r\n<li>4+ years experience as a project manager in an interactive agency or similar client services environment</li>\r\n<li>Excellent oral and written communication skills</li>\r\n<li>Ability to work with and manage external partners</li>\r\n<li>Ability to maintain high level of organization and attention to detail</li>\r\n<li>Ability to remain flexible and responsive when faced with multiple urgent requests</li>\r\n<li>Ability to approach and communicate with a wide range of personalities</li>\r\n<li>Ability to manage multiple projects in a fast-paced and challenging environment</li>\r\n<li>Demonstrate versatility, conviction, and a commitment to outstanding client service</li>\r\n<li class="last">You must be able to represent our company at all times with professionalism and integrity whenever you interact with our clients</li>\r\n</ul>', '<p>Please send you cv to jobs@sectionmedia</p>', '2011-12-12 10:43:33', '2011-12-12 10:43:33', 2, 'Brussels'),
(7, 80, 445, '<h3>Skills and knowledge</h3>\r\n<h3><br />General</h3>\r\n<h4><strong>Programming in web frameworks</strong></h4>\r\n<p>Has knowledge and experience in working with MVC architecture.<br />An advantage: has knowledge and experience in working with PHP, Ruby, .NET and or Python languages.&nbsp;</p>\r\n<p><strong>Open Source content management systems</strong></p>\r\n<p>Has knowledge and experience in working with Open&nbsp;&nbsp;Source content management systems (Drupal, Wordpress, Joomla, etc&hellip;)</p>\r\n<p><strong>Database systems</strong></p>\r\n<p>Has knowledge and experience in working with database systems like MySQL, MSSQL, PostgreSQL, MongoDB, etc&hellip;</p>\r\n<p><strong>Graphical software</strong></p>\r\n<p>An advantage: has knowledge and experience in working with graphical software like GIMP, Photoshop, Illustrator, Fireworks, Aftereffects, etc&hellip;</p>\r\n<p><strong>Other</strong></p>\r\n<p>An advantage: Project management skills</p>\r\n<p>&nbsp;</p>\r\n<h3>Language</h3>\r\n<p>French: advanced written and spoken<br />English: advanced written and spoken&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h2><strong>About us</strong></h2>\r\n<p>2houses is a high-potential startup founded in May 2011 by Gill Ruidant.</p>\r\n<p>We&rsquo;re a co-parenting facilitator. We help separated parents to communicate and get organized about their children. Have a look at our website&nbsp;<a href="http://www.2houses.com/" target="_blank">www.2houses.com</a>.</p>', '<p>Above all you are motived to work in a promising startup that gained significant traction already and will get you to work excited every day.<br /><br />Send your CV and a good cover letter to&nbsp;<a href="mailto:jobs@2houses.com">jobs@2houses.com</a></p>', '2011-12-18 10:06:13', '2011-12-18 10:06:13', 2, 'Namur or Charleroi'),
(8, 82, 449, '<ul>\r\n<li>Je hebt een passie voor alles wat online marketing aangaat</li>\r\n<li>Je hebt al een eerste ervaring in het aansturen van projecten en in online marketing</li>\r\n<li>Je bent vloeiend tweetalig NL/FR</li>\r\n<li>Je bent analytisch ingesteld met een goede dosis creativiteit</li>\r\n<li>Je kan op lange termijn denken</li>\r\n<li>Je beschikt over een sterk ontwikkeld leadership (ervaring in leidinggeven is niet vereist)</li>\r\n</ul>', '<p><span>Interesse ?&nbsp;</span></p>\r\n<p>NL : http://www.hr-vision.be/kandidaten/inschrijven/<br />FR : http://www.hr-vision.be/candidats/inscription/&nbsp;</p>', '2011-12-19 15:22:38', '2011-12-19 15:22:38', 2, 'Antwerpen'),
(9, NULL, 268, '<p><strong>Connaissances techniques requises:</strong></p>\r\n<p>&nbsp;-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Excel, PHP, Javascript, Prototype, HTML, XML, CSS, MySQL, Zend Framework, EAV</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Exp&eacute;rience avec les imports de donn&eacute;es dans Magento (produits, commandes et clients) + interfa&ccedil;age avec plateformes ERP.</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Exp&eacute;rience en installation et configuration de la plupart des extensions Magento. Si vous &ecirc;tes en mesure de d&eacute;velopper de nouvelles extensions, c''est un plus.</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tr&egrave;s bonnes connaissances en d&eacute;veloppement, ce qui inclus le d&eacute;veloppement en environnement de tests, v&eacute;rifications et tests sous tous les navigateurs, OS et Ipad.</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Connaissance dans le param&eacute;trage des &eacute;l&eacute;ments suivants : frais de livraison, taux de TVA, m&eacute;thodes de paiement en ligne.</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Connaissance de base sur l''administration Serveur Linux (SSH)</p>\r\n<p>&nbsp;</p>\r\n<p>Sont un plus :</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Capacit&eacute; de d&eacute;velopper de nouvelles extensions Magento</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Exp&eacute;rience sur Magento Enterprise</p>', '<p><strong>Vous correspondez &agrave; ce profil&nbsp;?</strong></p>\r\n<p><strong>Envoyez votre CV et votre lettre de motivation &agrave; <span style="text-decoration: underline;">job</span><a href="mailto:gerard@produweb.be" target="_self">@produweb.be</a></strong></p>', '2011-12-21 08:43:32', '2011-12-21 08:43:32', 2, 'Lige'),
(10, 86, 268, '<p><strong>Connaissances techniques requises:</strong></p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Excel, PHP, Javascript, Prototype, HTML, XML, CSS, MySQL, Zend Framework, EAV<br />-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Exp&eacute;rience avec les imports de donn&eacute;es dans Magento (produits, commandes et clients) + interfa&ccedil;age avec plateformes ERP.<br />-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Exp&eacute;rience en installation et configuration de la plupart des extensions Magento. Si vous &ecirc;tes en mesure de d&eacute;velopper de nouvelles extensions, c''est un plus.<br />-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tr&egrave;s bonnes connaissances en d&eacute;veloppement, ce qui inclus le d&eacute;veloppement en environnement de tests, v&eacute;rifications et tests sous tous les navigateurs, OS et Ipad.<br />-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Connaissance dans le param&eacute;trage des &eacute;l&eacute;ments suivants : frais de livraison, taux de TVA, m&eacute;thodes de paiement en ligne.<br />-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Connaissance de base sur l''administration Serveur Linux (SSH)</p>\r\n<p>Sont un plus :</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Capacit&eacute; de d&eacute;velopper de nouvelles extensions Magento<br />-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Exp&eacute;rience sur Magento Enterprise</p>', '<p><strong>Vous correspondez &agrave; ce profil&nbsp;?</strong></p>\r\n<p><strong>Envoyez votre CV et votre lettre de motivation &agrave; <span style="text-decoration: underline;">job</span><a href="mailto:gerard@produweb.be" target="_self">@produweb.be</a></strong></p>', '2011-12-21 08:44:07', '2011-12-21 09:54:55', 2, 'Lige'),
(11, 87, 268, '<p><strong>Votre profil :</strong></p>\r\n<p>- Vous faites obligatoirement preuve d''une premi&egrave;re exp&eacute;rience probante en tant que commercial(e)<strong></strong><br />- Vous adorez le contact client et avez un sens commercial pouss&eacute;,<br />- Vous vous sentez capable d&rsquo;atteindre des objectifs de vente,<br />- Vous portez un vif int&eacute;r&ecirc;t &agrave; la vente, le marketing et le web vous attirent,<br />- Vous cherchez &agrave; travailler en &eacute;quipe et savez faire preuve d&rsquo;initiatives,&nbsp;&nbsp;&nbsp; <br />- Vous &ecirc;tes r&eacute;sistant(e) au stress et n''avez pas peur des heures suppl&eacute;mentaires.</p>', '<p><strong>Int&eacute;ress&eacute;(e)? &nbsp;Envie d&rsquo;un nouveau d&eacute;fi&nbsp;?</strong></p>\r\n<p><strong>Envoyez votre CV et votre lettre de motivation &agrave;&nbsp;<span><a href="mailto:job@produweb.be">job@produweb.be</a></span>&nbsp;!</strong></p>\r\n<p><strong><br /></strong></p>', '2011-12-21 08:56:47', '2011-12-21 10:47:41', 2, 'Provinces de Namur et du Hainaut'),
(12, 88, 453, '<div><strong>Comp&eacute;tences techniques</strong></div>\r\n<div>\r\n<ul>\r\n<li>Manipulation d&rsquo;un CMS</li>\r\n<li>Logiciels Suite Office, Dreamweaver, Photoshop + &agrave; l&rsquo;aise avec les programmes informatiques en g&eacute;n&eacute;ral</li>\r\n<li>Bonne connaissance du HTML</li>\r\n</ul>\r\n<div><strong><strong>Comp&eacute;tences</strong>&nbsp;&eacute;ditoriales</strong></div>\r\n<ul>\r\n<li>Connaissance &eacute;l&eacute;mentaire du n&eacute;erlandais (&eacute;crit)</li>\r\n<li>Aisance r&eacute;dactionnelle, bonne orthographe</li>\r\n<li>Recherche d&rsquo;informations pour alimenter le contenu du site web ou des newsletters</li>\r\n</ul>\r\n</div>\r\n<div>Travail autonome ou en &eacute;quipe</div>\r\n<div>La sensibilit&eacute; aux questions environnementales est un atout.</div>\r\n<div></div>', '<p>Envoyez votre candidature &agrave;<a href="mailto:recrutement@journalisteweb.be">recrutement@journalisteweb.be</a></p>', '2011-12-21 15:18:26', '2011-12-21 15:18:26', 2, 'Bruxelles'),
(13, 91, 397, '<p><span>- University level (or equivalent) or Bachelor with experience</span><br /><span>- Good knowledge in Java / JEE, experience with Grails and Groovy is a plus</span><br /><span>- Knowledge of Spring and Hibernate</span><br /><span>- Knowledge of relational databases</span><br /><span>- Knowledge of user interface (UI) / user experience (UX) for front-end and back-end&nbsp;</span><span>interfaces</span><br /><span>- Mastering of web technologies (HTML, CSS, Javascript, jQuery)</span><br /><span>- Able to work independently in a complex, dynamic environment</span><br /><span>- Experience with TDD and continuous integration</span><br /><span>- Must love agile development environment (Scrum)</span><br /><span>- Fluent in English and French</span><br /><span>- Start-up minded</span><br /><span>- Willing to work in an innovative, challenging and entrepreneurial atmosphere</span></p>', '<div class="block title">\r\n<div class="inner">\r\n<div class="view clearfix">\r\n<h3>What we offer</h3>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="block text">\r\n<div class="inner">\r\n<div class="view clearfix">\r\n<p>Competitive salary and flexible conditions<br />- Integration in a very dynamic team and company<br />- Opportunity to develop innovative projects using state-of-the-art technologies<br />- Continuous Learning and Trainings<br />- Start-up environment<br />- As one of the first IT profiles, you will be in a leading position as the company&nbsp;grows&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="block title">\r\n<div class="inner">\r\n<div class="view clearfix">\r\n<h3>Interested ? Send your CV to FX at jobs@auctelia.com</h3>\r\n</div>\r\n</div>\r\n</div>', '2011-12-22 12:22:01', '2011-12-22 12:23:57', 2, 'Avenue des Mtallurgistes 22b 1490 Court-Saint-Etienne'),
(14, 92, NULL, '<p class="p1"><span class="s1"><strong>Comp&eacute;tences requises:</strong></span></p>\r\n<ul>\r\n<li class="li1"><span class="s1">Bonne connaissance d&rsquo;au moins un language orient&eacute; objet</span></li>\r\n<li class="li1"><span class="s1">Exp&eacute;rience avec un syst&egrave;me de gestion de base de donn&eacute;es</span></li>\r\n<li class="li1"><span class="s1">Attrait pour les technologies web</span></li>\r\n</ul>\r\n<p class="p1"><span class="s1"><strong>Bonus:</strong></span></p>\r\n<ul>\r\n<li class="li1"><span class="s1">Connaissance de Ruby</span></li>\r\n<li class="li1"><span class="s1">Exp&eacute;rience dans le d&eacute;veloppement d&rsquo;applications web</span></li>\r\n</ul>', '<p>Envoyez votre CV et/ou compte Github &agrave; l''adresse jobs@clickyourcar.be</p>', '2011-12-22 14:30:10', '2011-12-22 14:30:10', 3, 'Bruxelles, ICAB'),
(15, 102, 305, '<p><em>Vous ma&icirc;trisez parfaitement :</em></p>\r\n<ul>\r\n<li>la conception orient&eacute;e objet</li>\r\n<li>les architectures .NET, et notamment le Framework, C# et/ou VB.NET</li>\r\n<li>les bases de donn&eacute;es relationnelles</li>\r\n</ul>\r\n<p><em>Les plus, tr&egrave;s appr&eacute;ci&eacute;s :</em></p>\r\n<ul>\r\n<li>connaissance en SQL Server 2005/2008 et/ou MySQL</li>\r\n<li>connaissance de l&rsquo;outil Visual Studio 2005/2008/2010</li>\r\n<li>connaissance en Web Services</li>\r\n<li>connaissance en Silverlight et/ou WPF</li>\r\n<li>la ma&icirc;trise d''une langue &eacute;trang&egrave;re</li>\r\n<li>une certification Microsoft</li>\r\n</ul>', '<p><a href="http://www.synchrone.be/fr/news/54-synchrone-recrute-analyste-programmeur-aspnet-c.aspx" target="_blank">http://www.synchrone.be</a></p>\r\n<p><span id="ctl00_mainContent_ctl00_ctl00_lblDescription">Adressez vos CV &agrave; : <a href="mailto:job@synchrone.be">job@synchrone.be</a><br /> A l&rsquo;attention de : Jean-Fran&ccedil;ois MEYERS</span></p>', '2011-12-30 08:02:11', '2011-12-30 08:02:11', 2, 'Barchon (Lige)'),
(16, 107, 460, '<p><strong>Profile / qualifications</strong></p>\r\n<ul>\r\n<li>Educational background in programming</li>\r\n<li>Advanced level programming in PHP</li>\r\n<li>Intermediate level programming in C language (ANSI)</li>\r\n<li>PL/SQL knowledge (user level, not sys admin level)</li>\r\n<li>Good knowledge of HTML/CSS/Javascript</li>\r\n<li>Unix shell commands (scripts, crontabs...)</li>\r\n<li>Linux skills as user</li>\r\n</ul>\r\n<p><strong>Also valuable</strong>&nbsp;</p>\r\n<ul>\r\n<li>Bash/Perl/Python scripting</li>\r\n<li>Software debuging and profiling</li>\r\n<li>Subversion or CVS systems</li>\r\n<li>Software and system architecture design</li>\r\n<li>Apache webserver configuring</li>\r\n</ul>', '<p><strong>We Offer:</strong>&nbsp;</p>\r\n<ul>\r\n<li>A stimulating and multinational working environment</li>\r\n<li>A dynamic small and smart team environment</li>\r\n<li>Career development opportunities on both national and international level</li>\r\n</ul>\r\n<p>Please send you resume to fabrice@kapaza.be with reference PHP/C developer.</p>', '2012-01-03 08:37:36', '2012-01-03 08:37:36', 2, 'Diegem'),
(17, 108, 456, '<p>If you really want to know more, what tech we are using, etc., here we go:</p>\r\n<ul>\r\n<li>Advanced jQuery</li>\r\n<li>Advanced XHTML/CSS/AJAX</li>\r\n<li>Notion in PHP object-oriented</li>\r\n<li>Notion in XML technologies (XSLT/xPath/etc.)</li>\r\n</ul>', '<p><a href="http://www.nectil.com/eng/get-in-touch%21/"><strong>Tweet to @abstractmatter, phone, mail, address&hellip; everything is on the website. <br /></strong></a></p>', '2012-01-04 17:40:41', '2012-01-04 17:40:41', 2, 'Brussels'),
(18, 118, 9, '<p>This person should have an excellent knowledge of HTML, CSS, javascript (jquery framework) and Coldfusion 8 and/or 9. Experience with big extranet applications is a nice bonus</p>', '<p>Interested? Learn more about this job opening on our <a href="http://www.9000.be/en/2011/09/19/job-opening-at-9000/"> homepage </a></p>\r\n<p>Does this seem like the right job for you? Don''t hesitate to <a href="http://www.9000.be/nl/contact/" target="_blank">contact us</a>!</p>', '2012-01-11 14:29:17', '2012-01-11 14:29:17', 2, 'Regio Vlaams-Brabant'),
(19, 133, 460, '<ul class="ul1">\r\n<li class="li2">1 - 3 years product management experience in a similar position or e-business for an online player.</li>\r\n<li class="li2">Understanding of onsite consumer behaviour.</li>\r\n<li class="li2">Pro-active, dynamic, efficient, precise, organized, big picture vision.</li>\r\n<li class="li2">Excellent communication skills (written and oral).</li>\r\n<li class="li2">Ability to translate ideas into mock-ups.</li>\r\n<li class="li2">Ideally with an interest in the classifieds world.</li>\r\n<li class="li2">Academic degree or business school.</li>\r\n<li class="li2">Bilingual Flemish / French and fluent English.</li>\r\n</ul>', '<p class="p1">If you&rsquo;re interested, please send your application to Fabrice Douteaud, email:<a href="mailto:fabrice@kapaza.be"><span class="s1">fabrice@kapaza.be</span></a></p>', '2012-01-20 07:58:42', '2012-01-20 07:58:42', 2, 'Diegem'),
(20, 145, 472, '<ul style="list-style-type: circle;">\r\n<li>Working in a team structure </li>\r\n<li>being open to assisting in other  tasks</li>\r\n<li>enjoy terrible work conditions, day and night</li>\r\n</ul>', '<p>Please apply with portfolio to <a href="mailto:georges@bagaar.be">georges@bagaar.be</a> or give us a call at + 32 3 283 88 12.</p>', '2012-01-24 17:59:46', '2012-01-24 17:59:46', 2, 'Antwerp'),
(21, 146, 472, '<p>2+ years experience with HTML, CSS and JS. / Experience with PHP, XML  and databases. / Ability to develop animations and transitions is a  super bonus. / Experience in developing HTML for mobile phones and  tablets is a must. / Experience with frameworks and libraries, 3rd party  API integration and version control systems. / An eye and passion for  detail. / FR - NL -UK</p>', '<p>Please apply with portfolio to <a href="mailto:georges@bagaar.be">georges@bagaar.be</a> or give us a call at + 32 3 283 88 12.</p>', '2012-01-24 18:02:31', '2012-01-24 18:02:31', 2, 'Antwerp'),
(22, 151, 475, '<ul>\r\n<li>Have excellent understanding of, and proven skill with programming for the web; experience with both server side technologies (a.o. PHP, MySQL, memcached) and front-end technologies (HTML5, Javascript) are a plus</li>\r\n<li>Want to be challenged by new technologies (RabbitMQ, ElasticSearch, Redis), learn fast and think creatively about solutions for our high performance demands</li>\r\n<li>Write elegant, readable and well-documented code, using the right OOP and design principles where needed</li>\r\n<li>Have at least basic familiarity with server set-up and maintenance and interest in optimizing all parts of a web app</li>\r\n<li>Have a strong interest in product design and know what makes a web app work, accessible and easy to use</li>\r\n<li>Have an entrepreneurial attitude that gets high-quality projects done quickly</li>\r\n<li>Degree in computer science or equivalent experience preferred.</li>\r\n</ul>', '<p>Send us an e-mail to jobs@engagor.com with your CV and/or LinkedIn profile, and we''ll take it from there :-)</p>', '2012-02-03 09:27:54', '2012-02-03 09:27:54', 2, 'Gent, Belgium'),
(23, 152, 67, '<p>Experience in RoR backend development and scalability is required.</p>\r\n<p>If you want to know more, here is our stack:<br /><a href="http://checkthis.com/stack">http://checkthis.com/stack</a></p>', '<p>Send your CV with links to references to Fr&eacute;d&eacute;ric della Faille (<a href="mailto:f@checkthis.com">f@checkthis.com</a>)</p>\r\n<p>Thank you,<br />F.&nbsp;</p>', '2012-02-03 11:24:53', '2012-02-03 11:24:53', 2, 'Brussels or remoting'),
(24, 154, 9, '<p>Php, HTML5, jquery</p>', '<p>Contact us @&nbsp;<a href="mailto:jobs@9000.be">jobs@9000.be</a>!</p>', '2012-02-07 16:57:51', '2012-02-07 16:57:51', 2, 'Ghent'),
(25, 155, 9, '<p>Jquery, HTML 5, php</p>', '<p><a href="mailto:jobs@9000.be">jobs@9000.be</a></p>', '2012-02-08 08:01:08', '2012-02-08 08:01:08', 2, 'Ghent'),
