(27, 160, 161, '<p><strong>Requirements :</strong><br />-&nbsp;&nbsp;&nbsp; Meticulous with regard to graphic details<br />-&nbsp;&nbsp;&nbsp; Efficient in Dreamweaver, BBedit and your text editor<br />-&nbsp;&nbsp;&nbsp; Have a solid understanding of <strong>XHTML</strong> and <strong>CSS</strong><br />-&nbsp;&nbsp;&nbsp; Have a good knowledge of <strong>Ajax</strong>, <strong>jQuery</strong>, <strong>Javascript</strong><br />-&nbsp;&nbsp;&nbsp; Have a good sense for ergonomics, usability and SEO<br />-&nbsp;&nbsp;&nbsp; Have good knowledge of Photoshop for Integration (slicing)<br />-&nbsp;&nbsp;&nbsp; Work well in a team environment<br />-&nbsp;&nbsp;&nbsp; Be able and willing to learn new technologies<br />-&nbsp;&nbsp;&nbsp; Have a minimum of <strong>2 years experience</strong> (3 years is prefered)<br />-&nbsp;&nbsp;&nbsp; Being able to develop in <strong>PHP</strong> and <strong>Mysql</strong> is advantageous<br />-&nbsp;&nbsp;&nbsp; Having a good knowledge of Flash and AS3 is advantageous</p>', '<p><strong>Interested?</strong><br />Please send a cover letter and resume marked for the attention of Patrick Videira at <a href="mailto:info@glucone.com" target="_blank">info@glucone.com</a> or by using our online form:<br /><a href="http://www.glucone.com/send_cv_integrateur.php" target="_blank">http://www.glucone.com/send_cv_integrateur.php</a></p>', '2012-02-09 11:08:06', '2012-02-09 11:08:06', 2, 'Bruxelles'),
(28, 161, 436, '<ul>\r\n<li>Baccalaur&eacute;at en informatique ou formation en d&eacute;veloppement web</li>\r\n<li>Excellentes connaissances en PHP, MySQL, HTML, CSS et Ajax</li>\r\n<li>Avoir d&eacute;j&agrave; travaill&eacute; avec l&rsquo;API Google AdWords/ Analytics serait un avantage? Une exp&eacute;rience dans la cr&eacute;ation d&rsquo;applications web et/ou de l&rsquo;HTML 5/CSS3 est un&nbsp;plus</li>\r\n<li>La connaissance de framework PHP (Symphony, Cakephp, Zend, &hellip;) est un plus</li>\r\n<li>Des connaissances en web marketing sont un avantage</li>\r\n<li>Connaissance passive de l&rsquo;anglai</li>\r\n</ul>', '<p>Si ce job est fait pour vous, envoyez sans tarder votre CV et vos&nbsp;r&eacute;f&eacute;rences &agrave; mydreamjob@universem.be</p>', '2012-02-09 13:40:23', '2012-02-09 13:40:23', 2, 'Gembloux'),
