(30, 168, NULL, '<p>- HTML/CSS</p>\r\n<p>- Web integration</p>\r\n<p>- Joomla (1.5)</p>', '<p>Contact Antoine : <a href="mailto:antoine@carmeldesign.be">antoine@carmeldesign.be</a></p>', '2012-02-16 11:29:00', '2012-02-16 11:29:00', 1, 'Either'),
(31, 170, 384, '<p>The usual web designer skills panel.</p>\r\n<p>Integration skills is not necessarily required but is an asset.</p>\r\n<p>PHP knowledge is also a plus but is not required.&nbsp;</p>', '<p>To apply or have more information, just send me an email (benoit [at] infine-digital [dot] be)</p>', '2012-02-20 09:20:50', '2012-02-20 09:22:49', 2, 'Liege'),
(32, NULL, 480, '<h3>What you&rsquo;ll do:</h3>\r\n<ul class="spip">\r\n<li>Prototyping and HTML/CSS/JS Development</li>\r\n<li>Integration and Maintenance of Web platforms (websites, responsive &amp; mobile webapps)</li>\r\n<li>CMS Development (Wordpress, EE, SPIP,...)</li>\r\n<li>Code debugging and optimization (SEO, load time, ...)</li>\r\n</ul>\r\n<h3>The kind of profile we&rsquo;re looking for :</h3>\r\n<ul>\r\n<li>Higher Education Degree</li>\r\n<li>mastery of HTML5, CSS3 and Javascript (jQuery required)</li>\r\n<li>Sense of organization and duty</li>\r\n<li>Solid Portfolio and references (professional experience or internships)</li>\r\n<li>Ability to handle constraints while coming up with creative solutions</li>\r\n<li>Ability to communicate clearly</li>\r\n<li>You don&rsquo;t need to be micro-managed</li>\r\n<li>Fluent in French or English and good knowledge of a second language (Dutch, French or English)</li>\r\n</ul>\r\n<h3>It&rsquo;s a plus:</h3>\r\n<ul>\r\n<li>Experience with PHP (CI, Cake, ... ) and/or other Back-end Frameworks</li>\r\n<li>Experience in client-facing roles</li>\r\n<li>Experience with design software</li>\r\n<li>Experience with cutting-edge technologies (responsive, mobile, canvas, html5 apis, ...)</li>\r\n</ul>', '<p><strong>This is a full-time job (6 months trial period) on-site in our Brussels office</strong></p>\r\n<p>Sounds like it could be you? Send you portfolio/samples and resume to&nbsp;<a href="mailto:info@spade.be">info@spade.be</a></p>', '2012-02-20 09:29:43', '2012-02-20 09:29:43', 2, 'Brussels'),
(33, 171, 480, '<h3>What you&rsquo;ll do:</h3>\r\n<ul class="spip">\r\n<li>Prototyping and HTML/CSS/JS Development</li>\r\n<li>Integration and Maintenance of Web platforms (websites, responsive &amp; mobile webapps)</li>\r\n<li>CMS Development (Wordpress, EE, SPIP,...)</li>\r\n<li>Code debugging and optimization (SEO, load time, ...)</li>\r\n</ul>\r\n<h3>The kind of profile we&rsquo;re looking for :</h3>\r\n<ul>\r\n<li>Higher Education Degree</li>\r\n<li>mastery of HTML5, CSS3 and Javascript (jQuery required)</li>\r\n<li>Sense of organization and duty</li>\r\n<li>Solid Portfolio and references (professional experience or internships)</li>\r\n<li>Ability to handle constraints while coming up with creative solutions</li>\r\n<li>Ability to communicate clearly</li>\r\n<li>You don&rsquo;t need to be micro-managed</li>\r\n<li>Fluent in French or English and good knowledge of a second language (Dutch, French or English)</li>\r\n</ul>\r\n<h3>It&rsquo;s a plus:</h3>\r\n<ul>\r\n<li>Experience with PHP (CI, Cake, ... ) and/or other Back-end Frameworks</li>\r\n<li>Experience in client-facing roles</li>\r\n<li>Experience with design software</li>\r\n<li>Experience with cutting-edge technologies (responsive, mobile, canvas, html5 apis, ...)</li>\r\n</ul>', '<p><strong>This is a full-time job (6 months trial period) on-site in our Brussels office</strong></p>\r\n<p>Sounds like it could be you? Send you portfolio/samples and resume to&nbsp;<a href="mailto:info@spade.be">info@spade.be</a></p>', '2012-02-20 09:30:41', '2012-02-20 09:30:41', 2, 'Brussels'),
(34, 173, 383, '<ul>\r\n<li>Drupal</li>\r\n<li>Features</li>\r\n<li>Drush</li>\r\n<li>Git</li>\r\n<li><span>SimpleTest</span></li>\r\n<li>Jenkins</li>\r\n</ul>', '<p><a href="mailto:contact@k-cy.com">contact@k-cy.com</a></p>', '2012-02-21 17:25:02', '2012-02-21 17:25:02', 2, 'Lige / Bruxelles'),
(35, 176, 428, '<p>- Experience in Drupal Development : at least&nbsp;<strong>4-5 years</strong><br />- French or Dutch speaking<br />- Care about details<br />- Like team work</p>', '<p>Send an email to hubert@voice.be&nbsp;</p>', '2012-02-22 19:48:51', '2012-02-22 19:48:51', 1, 'Forest, Brussels'),
(36, 180, 484, '<p>Candidate profile:</p>\r\n<ul>\r\n<li>Good knowledge of the LAMP toolset</li>\r\n<li>PHP, JS, MySQL programming</li>\r\n<li>HTML/CSS slicing from PSD templates and CMS implementation</li>\r\n<li>SEO awareness</li>\r\n</ul>', '<p>If you feel like try the experience and if you are looking forward to get directly involved in the challenges of a fast-evolving communication agency, please send your application and resume to <a href="mailto:jules.henry@cible.be">jules.henry@cible.be</a></p>', '2012-02-23 10:54:06', '2012-02-23 10:54:06', 3, 'Barchon - Lige'),
(37, 183, 354, '<p><strong>Votre profil id&eacute;al :</strong></p>\r\n<ul>\r\n<li>Dipl&ocirc;m&eacute; en informatique de gestion avec une exp&eacute;rience dans le domaine du web</li>\r\n</ul>\r\n<ul>\r\n<li>Passionn&eacute;, autonome, r&eacute;actif et dot&eacute; d&rsquo;un bon esprit d&rsquo;analyse, vous   &ecirc;tes pr&ecirc;t &agrave; vous investir dans un projet en perp&eacute;tuelle &eacute;volution pour   en assurer la r&eacute;ussite</li>\r\n</ul>\r\n<ul>\r\n<li>Sp&eacute;cialis&eacute; dans le d&eacute;veloppement web, vous &ecirc;tes passionn&eacute; par les nouvelles technologies</li>\r\n</ul>\r\n<p><strong>Connaissance :</strong></p>\r\n<ul>\r\n<li>Programmation avanc&eacute;e avec PHP5 (Orient&eacute; Objets)</li>\r\n</ul>\r\n<ul>\r\n<li>Connaissance de MySQL en tant qu&rsquo;utilisateur</li>\r\n</ul>\r\n<ul>\r\n<li>Maitrise des standards du web, sensible aux probl&eacute;matiques d&rsquo;accessibilit&eacute; (user experience)</li>\r\n</ul>\r\n<ul>\r\n<li>Exp&eacute;rience en XML, (x)HTML, CSS2/3, Ajax, Javascript (JQuery)</li>\r\n</ul>\r\n<ul>\r\n<li>Exp&eacute;rience dans l&rsquo;utilisation et la conception de CMS</li>\r\n</ul>\r\n<p>Les notions suivantes sont un plus :</p>\r\n<ul>\r\n<li>Conception et impl&eacute;mentation de webservices bas&eacute;s sur SOAP et JSON</li>\r\n</ul>\r\n<ul>\r\n<li>Exp&eacute;rience en programmation ActionScript 2/3 et utilisation de Adobe flash</li>\r\n</ul>\r\n<ul>\r\n<li>Exp&eacute;rience r&eacute;ussie en r&eacute;f&eacute;rencement de sites</li>\r\n</ul>\r\n<ul>\r\n<li>Connaissances de base en administration de serveurs LAMP</li>\r\n</ul>\r\n<ul>\r\n<li>Connaissance de la suite Adobe Creative Suite</li>\r\n</ul>\r\n<ul>\r\n<li>Int&eacute;gration et utilisation de r&eacute;seaux sociaux</li>\r\n</ul>\r\n<ul>\r\n<li>D&eacute;veloppement d&rsquo;applications pour smartphones</li>\r\n</ul>\r\n<ul>\r\n<li>Connaissances en gestion de noms de domaine</li>\r\n</ul>\r\n<ul>\r\n<li>Connaissances en gestion de r&eacute;seaux</li>\r\n</ul>\r\n<ul>\r\n<li>Maitrise des OS Windows, MacOSX et Linux (Debian)</li>\r\n</ul>\r\n<ul>\r\n<li>Maitrise avanc&eacute;e de serveurs Linux : routage, parefeu IPTABLES, Samba, Netatalk, Bind9, &hellip;</li>\r\n</ul>', '<p><strong>Envie de relever ce nouveau d&eacute;fi?</strong><br />Envoyez votre CV &agrave; l&rsquo;attention de Coralie Alonso : <a href="mailto:info@web-made.be">info@web-made.be</a></p>', '2012-02-27 09:20:09', '2012-02-27 09:20:09', 2, 'Agence Webmade Marche en Famene'),
(38, 186, NULL, '<p><strong>Mandatory Skills</strong></p>\r\n<p><em>Develoment skills</em></p>\r\n<ul>\r\n<li>XHTML / HTML5</li>\r\n<li>CSS2.1 / CSS3</li>\r\n<li>jQuery</li>\r\n<li>CSS Pre-Processors (LESS / Sass)</li>\r\n<li>CSS Frameworks / Resets</li>\r\n<li>Debugging Tools (Firebug, etc)</li>\r\n<li>Version Control (Git / GitHub / CVS / Subversion)</li>\r\n<li>Website Speed / Performance</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><em>Design Skills</em></p>\r\n<ul>\r\n<li>Detail-oriented</li>\r\n<li>Photoshop, Illustrator</li>\r\n<li>HTML and CSS Specifications (W3C / WHATWG)</li>\r\n<li>Progressive Enhancement / Graceful Degradation</li>\r\n<li>Responsive Web Design</li>\r\n<li>Experience with Grids Design</li>\r\n<li>UX / Usability</li>\r\n<li>Content Strategy</li>\r\n<li>Cross-Browser Bugs and Inconsistencies (primarily IE6-8)</li>\r\n<li>Knowledge of pre-press &amp; image optimization for the screen and print.</li>\r\n<li>Strong layout and design ability, use of space and color.</li>\r\n<li>Excellent use of typography</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Additional Skills</strong></p>\r\n<ul>\r\n<li>Ruby / Ruby on Rails / Php</li>\r\n<li>Mysql</li>\r\n<li>Haml</li>\r\n<li>Ajax</li>\r\n<li>HTML5 Boilerplate</li>\r\n<li>Modernizr</li>\r\n<li>SEO Basics</li>\r\n<li>Microformats</li>\r\n<li>Fireworks, InDesign</li>\r\n<li>Cross-Platform Development</li>\r\n<li>Experience with E-Commerce</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Personal Skills</strong></p>\r\n<ul>\r\n<li>The ability to meet tight deadlines and work under pressure.</li>\r\n<li>Beautiful portfolio or collection of previous works.</li>\r\n<li>Open minded, Curious &amp; Self motivated</li>\r\n<li>You must be able to speak English.</li>\r\n</ul>', '<p><strong>Interested?</strong></p>\r\n<p>Please contact us! Just send us an email with your a CV or a code sample or GitHub account to&nbsp;<a rel="nofollow" href="mailto:bruno@bigbentobox.com">bruno@bigbentobox.com</a></p>\r\n<p>&nbsp;</p>\r\n<p><strong>BigBentoBox</strong></p>\r\n<p>IT Consulting &amp; Development</p>\r\n<p>Waterloosesteenweg 200</p>\r\n<p>B-1640 Sint-Genesius-Rode</p>\r\n<p>Belgium</p>\r\n<p>Tel: 02 305 59 75</p>\r\n<p>&nbsp;</p>\r\n<p><a rel="nofollow" href="http://www.bigbentobox.com/">www.bigbentobox.com</a>&nbsp;</p>', '2012-02-29 13:48:07', '2012-02-29 13:48:07', 2, 'Rhode-saint-gense'),
(39, 187, 446, '<p class="p1">Your profile:</p>\r\n<p class="p1">- You''ve got experience in graphic (web)design. Experience in design for mobile apps is a plus.</p>\r\n<p class="p1">- You want to and can design websites &agrave;nd mobile apps.</p>\r\n<p class="p1">- You want to learn. You want to be proud of your work, and you aim for the best user experience. When users are not happy with the result, you feel disappointed.</p>\r\n<p class="p1">- You love working with developers. You know that UX design for mobile apps is a team effort.</p>\r\n<p class="p2">&nbsp;</p>\r\n<p class="p1">We offer you:</p>\r\n<p class="p1">- a competitive salary</p>\r\n<p class="p1">- an office that''s easy to reach</p>\r\n<p class="p1">- a team of passionate developers who love working with you: our devs believe good user experience is equally important than functionality</p>\r\n<p class="p1">- the experience of other designers we work with</p>', '<p class="p1">Do you recognize yourself in this? Are you ready to build the best mobile apps with us? Send us an e-mail with your resume at <a href="mailto:jobs@10to1.be">jobs@10to1.be</a>.</p>', '2012-03-02 09:34:28', '2012-03-02 09:34:28', 2, 'Kontich'),
(40, 197, 120, '<ul>\r\n<li>Vous avez une bonne exp&eacute;rience en agence web au poste de chef de projet : vos qualit&eacute;s de gestionnaire d&rsquo;&eacute;quipe alli&eacute;es &agrave; votre aisance relationnelle et votre sens de l''&eacute;coute du client font de vous un project manager taill&eacute; pour notre soci&eacute;t&eacute;.</li>\r\n</ul>\r\n<ul>\r\n<li>Vous connaissez plusieurs raccourcis clavier n&eacute;cessitant au moins trois doigts.</li>\r\n</ul>\r\n<ul>\r\n<li>Vous avez une excellente connaissance des nouvelles technologies et &ecirc;tes toujours le premier au courant des derni&egrave;res tendances digitales.</li>\r\n</ul>\r\n<ul>\r\n<li>Vous maitrisez parfaitement le fran&ccedil;ais et avez de bonnes capacit&eacute;s r&eacute;dactionnelles but you can switch to english whenever it&rsquo;s needed (spoken and written) maar ook u mag spreken nederlands.</li>\r\n</ul>\r\n<ul>\r\n<li>On dit de vous que vous &ecirc;tes &agrave; l''&eacute;coute des autres et tout particuli&egrave;rement de vos clients.</li>\r\n</ul>\r\n<ul>\r\n<li>Vous avez une tr&egrave;s bonne expertise web, e-commerce, e-Marketing et Marketing. La conception online n&rsquo;a plus de secrets pour vous.</li>\r\n</ul>\r\n<ul>\r\n<li>Vous &ecirc;tes sensible &agrave; la question d&rsquo;ergonomie et faites de la cr&eacute;ativit&eacute; un &eacute;l&eacute;ment incontournable de votre r&eacute;flexion lors de la gestion d&rsquo;un projet.</li>\r\n</ul>\r\n<ul>\r\n<li>Vous &ecirc;tes un perfectionniste, mais pour de vrai, pas parce que c''est la chose facile &agrave; dire dans une entrevue d''emploi.</li>\r\n</ul>\r\n<ul>\r\n<li>Vous avez un bon esprit de synth&egrave;se et d&rsquo;analyse. N''est-ce pas ?&nbsp;</li>\r\n</ul>\r\n<ul>\r\n<li>Vous &ecirc;tes multit&acirc;ches : vous pouvez jongler d&rsquo;un projet &agrave; l&rsquo;autre dans la m&ecirc;me journ&eacute;e et faites preuve d&rsquo;une grande flexibilit&eacute; et d&rsquo;une bonne capacit&eacute; d&rsquo;adaptation.</li>\r\n<li>Vous &ecirc;tes une web machine.</li>\r\n<li>et patati et patata...&nbsp;</li>\r\n</ul>', '<p>Si vous avez envie de faire partie notre niche en plein essor et que ce job semble parfaitement correspondre &agrave; votre profil, envoyez votre C.V. et surtout pas de lettre de motivation &agrave; bichon@dogstudio.be</p>\r\n<p>Merci !</p>', '2012-03-20 14:25:17', '2012-03-20 14:25:17', 2, 'Namur, Belgium'),
(41, 199, NULL, '<p class="p1">Needed :</p>\r\n<p class="p1">- 2 months +&nbsp;</p>\r\n<p class="p1">- You have at least one school year experience in graphic &amp; web design&nbsp;</p>\r\n<p class="p1">- The Adobe Creative Suite has (almost) no secrets for you.</p>\r\n<p class="p2">&nbsp;</p>\r\n<p class="p1">Plus :</p>\r\n<p class="p1">- You have a good sense of humour (we don''t need a Zombie.)</p>\r\n<p class="p1">- You have too much creativity to stay in your room</p>\r\n<p class="p1">- You played Unreal Tournament.</p>\r\n<p class="p1">- You have an SWTOR account (to interact with the IT team)</p>', '<p class="p1">- Send us your CV &gt;&nbsp;<a href="mailto:jerome@radionomy.com"><span class="s1">jerome@radionomy.com</span></a>&nbsp;or DM on twitter (@monsieur_m)</p>\r\n<p class="p1">&nbsp;and show me your talent (don''t be shy ;)) with an awesome online portfolio.</p>', '2012-03-26 20:48:24', '2012-03-26 20:48:24', 3, 'Brussels'),
(42, 201, 160, '', '<p>jean-marc@globulebleu.com</p>', '2012-04-02 14:40:53', '2012-04-02 14:40:53', 1, 'Liege '),
(43, 203, 436, '<p><strong>Your tasks:</strong></p>\r\n<ul>\r\n<li>Manage consulting projects in web marketing and propose solutions to optimise ROI and customers needs.</li>\r\n<li>Manage advertising campaigns on&nbsp;Google AdWords, Facebook, LinkedIn, &hellip;</li>\r\n<li>Set up Search Engine Optimization actions plans</li>\r\n<li>Set up web analytics solutions</li>\r\n<li>Constantly manage the projects within your responsibilities</li>\r\n</ul>\r\n<p><strong>We are looking for:</strong></p>\r\n<ul>\r\n<li>Bachelor/Master in management, economy, marketing or equivalent</li>\r\n<li>0 to 2 working years experience</li>\r\n<li>Strong interest in Web Marketing (SEO, online advertising, Web Analytics,&nbsp;social media, mobile marketing &hellip;) and new technologies</li>\r\n<li>Knowledge in HTML &amp; CSS , PHP/MySQL is a plus</li>\r\n<li>Excellent analytical capabilities</li>\r\n<li>Willingness to learn fast</li>\r\n<li>Good written and oral communication skills</li>\r\n<li>Capacity to produce results under pressure</li>\r\n<li>Able to work in French and English. Dutch and other languages are welcome!</li>\r\n<li>Driving licence</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>We offer:</strong></p>\r\n<ul>\r\n<li>An open-ended contract</li>\r\n<li>An internal training to acquire unique skills</li>\r\n<li>A creative and innovative working environment where you have a strong impact on their web marketing strategy</li>\r\n<li>A job in a young and fast growing company in the Crealys office park between Namur and Gembloux</li>\r\n<li>An attractive salary in function of your experience</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '<p><span>Please visit our website to apply :&nbsp;</span><a href="http://www.universem.be/a-propos/job/">http://www.universem.be</a></p>', '2012-04-04 15:54:19', '2012-04-04 15:54:19', 2, 'Gembloux'),
(44, 208, 145, '<p>Native Android developement and if you''re good at IOS developement too, it''s a plus&nbsp;</p>', '<p>Just submit your portfolio, examples, samples, CV or anything which could help us getting an idea of your skills at info@epic.net</p>', '2012-04-12 15:34:44', '2012-04-12 15:34:44', 1, 'Liege ( Or anywhere else in fact)'),
(45, 209, 475, '<h2>What are we looking for?</h2>\r\n<ul>\r\n<li>Have excellent understanding of, and proven skill with programming for the web; experience with both server side technologies (a.o. PHP, MySQL, memcached) and front-end technologies (HTML5, Javascript) are a plus.</li>\r\n<li>Want to be challenged by new technologies (RabbitMQ, ElasticSearch, Redis), learn fast and think creatively about solutions for our high performance demands.</li>\r\n<li>Write elegant, readable and well-documented code, using the right OOP and design principles where needed.</li>\r\n<li>Basic familiarity with server set-up and maintenance and interest in optimizing all parts of a web app is a plus.</li>\r\n<li>Have a strong interest in product design and know what makes a web app work, accessible and easy to use.</li>\r\n<li>Have an entrepreneurial attitude that gets high-quality projects done quickly.</li>\r\n<li>Degree in computer science or equivalent experience preferred.</li>\r\n</ul>', '<p>Drop us an e-mail with your resume and motivation at&nbsp;<a href="mailto:jobs@engagor.com">jobs@engagor.com</a>.</p>', '2012-04-16 10:06:01', '2012-04-16 10:06:01', 2, 'Ghent, Belgium'),
(46, 212, 305, '<p>Dipl&ocirc;m&eacute; en informatique vous poss&eacute;dez id&eacute;alement de l''exp&eacute;rience dans le d&eacute;veloppement d''applications Web avec l&rsquo;environnement .NET (de pr&eacute;f&eacute;rence C#).<br />Vous avez une bonne communication orale et &eacute;crite en Fran&ccedil;ais. Le N&eacute;erlandais, l''Anglais et l&rsquo;Allemand sont un plus. Vous &ecirc;tes autonome, structur&eacute; et proactif. Vous pouvez communiquer et travailler en &eacute;quipe dans un environnement dynamique. Vous voyez les d&eacute;fis de mani&egrave;re positive.<br /><br />Connaissances requises :<br /><br />Vous ma&icirc;trisez parfaitement :<br />&nbsp;- la conception orient&eacute;e objet<br />&nbsp;-les architectures .NET, et notamment le Framework, C# et/ou VB.NET<br />&nbsp;-les bases de donn&eacute;es relationnelles<br /><br />Les plus, tr&egrave;s appr&eacute;ci&eacute;s :<br />&nbsp;-connaissance en SQL Server 2005/2008 et/ou MySQL<br />&nbsp;-connaissance de l&rsquo;outil Visual Studio 2005/2008/2010<br />&nbsp;-connaissances en Web Services<br />&nbsp;-la ma&icirc;trise d''une langue &eacute;trang&egrave;re<br />&nbsp;-une certification Microsoft</p>', '<p><a href="http://www.synchrone.be">http://www.synchrone.be</a><br /><br />Adressez vos CV &agrave; : job@synchrone.be<br />A l&rsquo;attention de : Jean-Fran&ccedil;ois MEYERS</p>', '2012-04-18 08:59:49', '2012-04-18 08:59:49', 2, 'Barchon (Lige)'),
(47, 213, 472, '<p>You''re the best.<br />You are talented and experienced.<br />CS has no secrets for you.<br />You got a solid understanding of designing intuitive site functionality, interaction, site architecture, user interfaces, and navigation<br />You''re driven to define the look and feel of complete projects.</p>', '<p><span><span id="fullbody">Job descriptions depend on the maturity and the experience of the candidate and is discussed case per case. If you are interested in joining our team, please send me your cv and motivation: georges@bagaar.be.</span>&nbsp;</span></p>\r\n<div><span><br /></span></div>', '2012-04-19 08:22:38', '2012-04-19 08:22:39', 2, 'Antwerp'),
(48, 215, 120, '<p>Orientation&nbsp; de type Communication, Management culturel, associatif.</p>\r\n<p>Sensibilit&eacute; aux m&eacute;tiers de la cr&eacute;ation et au monde digital&nbsp;</p>\r\n<p>Excellente connaissance de l''anglais</p>\r\n<p>Passeport APE&nbsp;</p>\r\n<p><br /> <strong>Capacit&eacute;s sp&eacute;cifiques </strong><br /> <br />Excellente organisation</p>\r\n<p>Grande capacit&eacute; de travailler de mani&egrave;re autonome</p>\r\n<p>Capacit&eacute; d&rsquo;&eacute;coute et d&rsquo;initiative</p>\r\n<p>Facilit&eacute; r&eacute;dactionnelle (lettres, rapports,&hellip;)</p>\r\n<p>&nbsp;</p>', '<p><strong>Nous vous offrons :&nbsp;</strong></p>\r\n<p><br />Un contrat &agrave; dur&eacute;e ind&eacute;termin&eacute;e&nbsp;</p>\r\n<p>Possibilit&eacute; d&rsquo;un emploi &agrave; temps partiel (4/5)&nbsp;</p>\r\n<p>Une formation permanente</p>\r\n<p>Un environnement international riche en rencontres et en cr&eacute;ativit&eacute;<br /><br /></p>\r\n<p><strong>Proc&eacute;dure pour poser une candidature</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Envoyer votre candidature par e-mail &agrave; info@kikk.be &agrave; l''attention de Gilles Bazelaire</p>\r\n<p>&nbsp;</p>', '2012-04-26 08:52:53', '2012-04-26 08:52:53', 2, 'Namur, Belgium'),
(49, NULL, 145, '<p><span>You have at least 2 years of experience slicing/building websites;</span><br /><span>Fluent in french and/or english (spoken/written);</span><br /><span>An advanced knowledge of PHP5 , HTML5, CSS2/3;</span><br /><span>A proficiency in JavaScript/JQuery, CoffeeScript and/or other dialects;</span><br /><span>APKs, Activities, NDK, cute robots means something to you;</span><br /><span>Knowledge of Ruby and Ruby on Rails or willing to learn (fast!);</span><br /><span>A really good eye for details, and pixel-perfect design;</span><br /><span>A real team player, you want be able to be part of something bigger (slightly);</span><br /><span>You are really really&hellip;I mean REALLY passionate by your job and you&rsquo;re always a step ahead;</span><br /><span>An expert experienced in accessibility, cross browser requirements, and graceful degradation.</span></p>', '<p>e-mail us your CV, cover letter, references, portfolio or anything which could provide us enough information to choose you over anyone else&nbsp;</p>\r\n<p>info@epic.net</p>', '2012-05-02 20:23:47', '2012-05-02 20:23:47', 2, 'Epic Agency'),
(50, 218, 145, '<p><span>You have at least 2 years of experience slicing/building websites;</span><br /><span>Fluent in french and/or english (spoken/written);</span><br /><span>An advanced knowledge of PHP5 , HTML5, CSS2/3;</span><br /><span>A proficiency in JavaScript/JQuery, CoffeeScript and/or other dialects;</span><br /><span>APKs, Activities, NDK, cute robots means something to you;</span><br /><span>Knowledge of Ruby and Ruby on Rails or willing to learn (fast!);</span><br /><span>A really good eye for details, and pixel-perfect design;</span><br /><span>A real team player, you want be able to be part of something bigger (slightly);</span><br /><span>You are really really&hellip;I mean REALLY passionate by your job and you&rsquo;re always a step ahead;</span><br /><span>An expert experienced in accessibility, cross browser requirements, and graceful degradation.</span></p>', '<p>e-mail us your CV, cover letter, references, portfolio or anything which could provide us enough information to choose you over anyone else&nbsp;</p>\r\n<p>info@epic.net</p>', '2012-05-02 20:24:12', '2012-05-02 20:24:12', 2, 'Epic Agency'),
(51, 219, 120, '<ul>\r\n<li></li>\r\n</ul>', '<p><strong>Nous offrons&nbsp;:</strong></p>\r\n<ul>\r\n<li>Un contrat en vue d&rsquo;un engagement &agrave; temps&nbsp;plein&nbsp;au sein d''une niche jeune et dynamique ainsi que les avantages associ&eacute;s au poste.</li>\r\n<li>La possibilit&eacute; de participer au d&eacute;veloppement d''un framework home made et open source.</li>\r\n<li>Le challenge de d&eacute;velopper un projet international et de le porter au plus haut de sa gloire (pas moins&nbsp;!)</li>\r\n</ul>\r\n<p>Si vous avez envie de faire partie notre niche, que ces t&acirc;ches ne vous font pas peur et que ce job semble parfaitement correspondre &agrave; votre profil, envoyez votre C.V. et surtout pas de lettre de motivation &agrave; caniche@dogstudio.be</p>', '2012-05-03 06:01:23', '2012-05-03 09:42:18', 2, 'Namur, Belgium'),
(52, 228, 487, '<p>Meer info over je profiel vind je op&nbsp;<a rel="nofollow nofollow" href="http://jobs.designskills.be/" target="_blank">http://jobs.designskills.be/</a></p>', '<p>Ge&iuml;nteresseerd?&nbsp;<br /><br />Stuur je portfolio, cv en ander overtuigend bewijsmateriaal naar: vacature@designskills.be</p>', '2012-05-15 15:39:07', '2012-05-15 15:39:07', 2, 'Zichem, Belgium');
INSERT INTO jobs (id, post_id, company_id, skills, how_to_apply, created_at, updated_at, job_type_id, location) VALUES
(53, 229, 269, '<ul>\r\n<li>You fully master xHTML(5)/CSS, jQuery, AJAX, Javascript,&hellip;</li>\r\n<li>You have good knowledge of at least Microsoft.NET/SQL Server or PHP/MySQL (using MVC).</li>\r\n<li>You know how to setup, configure and theme for Drupal.</li>\r\n<li>You have at least 3 year of work experience.</li>\r\n<li>You have an education or background in web development.</li>\r\n<li>You are passionate about online &amp; digital media.</li>\r\n<li>You like to experiment with new technologies.</li>\r\n<li>You have good communication skills and you enjoy working in a team.</li>\r\n</ul>', '<p>Our door is always open and we would love to talk with you :)</p>\r\n<p>Mail Paul Joly on&nbsp;<a title="Mail Paul!" href="mailto:jobs@prophets.be?SUBJECT=Make%20me%20a%20Prophet!">jobs@prophets.be</a>&nbsp;or call him on&nbsp;<span class="no_wrap">03 216 16 65.&nbsp;</span></p>', '2012-05-21 08:33:34', '2012-05-21 08:33:34', 2, 'Antwerp'),
(54, 231, 382, '<p><strong>Profil :</strong></p>\r\n<ul>\r\n<li>Bac+2 minimum, vous &ecirc;tes dipl&ocirc;m&eacute;(e) en informatique ou d&eacute;veloppement multim&eacute;dia.&nbsp; </li>\r\n<li>Vous poss&eacute;dez OBLIGATOIREMENT une exp&eacute;rience d''au moins 2 ans sur un poste similaire.&nbsp; </li>\r\n<li>Passionn&eacute; avant tout, vous faites aussi preuve d''un bon esprit d''&eacute;quipe pour partagez ainsi vos connaissances tout en d&eacute;couvrant celles de vos collaborateurs.&nbsp; </li>\r\n</ul>\r\n<p>Vous maitrisez au minimum les points suivants&nbsp;:</p>\r\n<ul>\r\n<li>Utilisation de CMS</li>\r\n<li>Graphisme (au sens large) </li>\r\n<li>Anglais (indispensable)</li>\r\n</ul>', '<p>Merci de bien vouloir envoyer votre candidature (CV + lettre de motivation + pr&eacute;tentions salariales) &agrave; <a href="mailto:marc@lwm-agence.com">marc@lwm-agence.com</a></p>', '2012-05-22 09:52:17', '2012-05-22 09:52:17', 2, 'Paris puis Bruxelles'),
(55, 237, 472, '<p>- develop in Drupal like a boss (setup, maintain, customize, theming, &hellip;)<br /> - experience with relational database design and development<br /> - be able to create a Drupal driven website with a frontend in html(5), js (JQuery, MooTools, &hellip;) and CSS(3)<br /> - profound knowledge of (Object Oriented) php to program custom plugins, modules and webservices<br /> - be able to set up an architecture for complex applications, including database design and (web)services<br /> - understanding of browser specific compatibility issues<br /> - be able to create and maintain mailings and news letter systems<br /> - have a good knowledge of hosting and server settings<br /> - knowledge of tools used in graphic design (Photoshop, Illustrator, &hellip;)<br /> - work hard, deal with work overload, heavy deadlines and stress, be flexible and never complain</p>', '<p><a href="mailto:georges@bagaar.be">mail us</a> for a date</p>', '2012-06-06 13:16:07', '2012-06-06 13:16:07', 2, 'Antwerp'),
(56, 246, 145, '<ul>\r\n<li>You are fluent in Dutch and French (best if your mother tongue is dutch). Knowledge of Spanish, Italian, English, German is an asset.</li>\r\n<li>You are passionate about Internet: e-commerce, twitter and social media.</li>\r\n<li>You have a very good knowledge of HTML / CSS.</li>\r\n<li>You are autonomous, rigorous, creative and you always follow inovations in "online marketing" and "e-commerce".</li>\r\n<li>You are dedicated to your job and and a good sense of responsibility.</li>\r\n<li>You have a very good knowledge of office tools</li>\r\n</ul>', '<p><strong>Etilux offers:</strong></p>\r\n<ul>\r\n<li>Flexibility in a familial company allying dynamism and stability</li>\r\n<li>Competitive salary with a permanent contract</li>\r\n<li>Targeted training</li>\r\n</ul>\r\n<p><strong>Contacts:</strong></p>\r\n<p>Arnaud Jamar, Ressources Humaines,  aja@etilux.be</p>\r\n<p>Thierry Adam, Web Manager, tad@etilux.be</p>\r\n<p>Adress:  ETILUX s.a.   Rue de l&rsquo;Esp&eacute;rance, 42 4000 Li&egrave;ge</p>\r\n<p>URL&nbsp;:      www.etilux.com</p>', '2012-07-01 14:34:55', '2012-07-01 14:34:55', 2, 'Lige'),
(57, 248, 436, '<p><strong>Your tasks</strong></p>\r\n<ul>\r\n<li>Analysis and development of our in-house web application&nbsp;</li>\r\n<li>Exchange of data with Googls APIs (AdWords &amp; Analytics)</li>\r\n<li>Advanced consulting in Web Analytics&nbsp;</li>\r\n</ul>\r\n<p><strong>We are looking for&nbsp;</strong></p>\r\n<ul>\r\n<li>Master/engineer in IT</li>\r\n<li>Outstanding analytical and synthesis skills</li>\r\n<li>Knowledge in PHP, MySQL, HTML, CSS and Ajax</li>\r\n<li>Having worked with the API of Google AdWords/ Analytics is a plus</li>\r\n<li>A first experience in web application or HTML 5/CSS3 development is an asset</li>\r\n<li>Interest and experience in web marketing is an advantage? Bilingual French/English</li>\r\n<li>Willing to learn the objectives of companies online and their strategy&nbsp;</li>\r\n</ul>\r\n<p><strong>We offer</strong></p>\r\n<ul>\r\n<li>A very creative and innovative work</li>\r\n<li>An exciting job in a young and fast growing company operating in the Crealys office park between Namur and Gembloux</li>\r\n<li>An attractive salary package according to your experience</li>\r\n</ul>\r\n<p>&nbsp;</p>', '<p>If this job is done for you, please send as soon as possible your CV and references to mydreamjob@universem.be</p>', '2012-07-05 08:40:14', '2012-07-05 08:40:14', 2, 'Gembloux'),
(58, 253, 75, '<p>You might be who we are looking for if&hellip;</p>\r\n<ul>\r\n<li>You pay high attention to detail, maintaining the design integrity during the build process;</li>\r\n<li>You develop Javascripts like you play(ed) with Lego or Meccano;</li>\r\n<li>You master LESS/SASS to produce responsive and retina optimised CSS;</li>\r\n<li>You write HTML5 code optimised for search engine, programming and templating;</li>\r\n<li>You implement proven best practices and love to experiment latest innovations;</li>\r\n<li>You speak french and can read and write english (technical at least);</li>\r\n<li>Are a music and/or food fan, and love to discover new things.</li>\r\n</ul>\r\n<p><em>Note: This is just an ideal and, hopefully, nobody is perfect. If you find yourself in this opportunity and you are talented, don''t hesitate to apply.</em></p>', '<p><strong>To apply, please submit:</strong></p>\r\n<ul>\r\n<li>A link to your github profile or other code/work samples;</li>\r\n<li>Your resume or Linkedin profile;</li>\r\n<li>A quick note on why you&rsquo;re excited to join our team.</li>\r\n</ul>\r\n<p>Indicate your earliest availability and contact us:&nbsp;<a rel="nofollow" href="mailto:jobs@centraldesign.be">jobs@centraldesign.be</a>&nbsp;</p>', '2012-08-23 15:22:19', '2012-08-23 15:22:19', 2, 'Brussels'),
(59, 258, 305, '<p>Vous avez de l&rsquo;exp&eacute;rience en tant que vendeur, de pr&eacute;f&eacute;rence dans le secteur du Web et TIC.<br />Vous &ecirc;tes passionn&eacute; par le web et les TIC.<br />Vous avez des notions sur les m&eacute;tiers du web, du marketing.<br />Vous avez un esprit d&rsquo;&eacute;quipe.</p>\r\n<ul>\r\n</ul>', '<p>Retrouver notre offre d''emploi sur notre site Internet : <a href="http://www.synchrone.be/fr/news/152_synchrone-recrute-technico-commercial-web-tic">http://www.synchrone.be/fr/news/152_synchrone-recrute-technico-commercial-web-tic</a></p>\r\n<p>Vous pouvez envoyer votre candidature &agrave; l''adresse email :</p>\r\n<p>job <em>[at]</em> synchrone.be</p>', '2012-09-21 15:10:16', '2012-09-21 15:10:16', 2, 'Barchon (Lige)'),
(60, 264, NULL, '<p>Haute capacit&eacute; &agrave; traduire un brief en concept et r&eacute;daction de message publicitaire.</p>\r\n<p>Capacit&eacute; de le d&eacute;cliner selon les supports n&eacute;cessaires.</p>\r\n<p>Exp&eacute;rience exig&eacute;e.</p>\r\n<p>Tr&egrave;s bon style et orthographe parfaire.</p>', '<p>Contactez-moi directement par mail : antonio@genius-studio.be</p>\r\n<p>Avec un lien sur vos pr&eacute;c&eacute;dentes r&eacute;alisations.</p>', '2012-10-10 06:18:50', '2012-10-10 06:18:50', 1, 'Freelance'),
(61, 265, 513, '<p class="p1">R&eacute;f&eacute;rencement naturel / R&eacute;daction web / Performance web / Ergonomie web / Design web / r&eacute;seaux sociaux</p>\r\n<p class="p2">HTML5 / CSS3 / JavaScript / PHP/ MYSQL</p>\r\n<p class="p2">Ma&icirc;trise ou connaissance d''une plateforme de d&eacute;veloppement dans un cms (Wordpress, Drupal, &hellip;)</p>\r\n<p class="p2">Ma&icirc;trise ou connaissance d''un framework JS (JQuery, Mootools, etc)</p>\r\n<p class="p2">Ma&icirc;trise ou connaissance de l''actionscript.</p>\r\n<p class="p2">Une exp&eacute;rience dans le d&eacute;veloppement de produits mobiles (applications) sur les plateformes leader</p>\r\n<p class="p2">du moment iPhone, iPad et android constitueront un avantage certain.</p>\r\n<p class="p2">Int&eacute;r&ecirc;t pour les&nbsp; r&eacute;seaux sociaux (Facebook, Twitter, &hellip;)</p>\r\n<p class="p1">Bac + 5 / 4 &agrave; 5 ans d&rsquo;exp&eacute;rience minimum / langue&nbsp;: FR /EN</p>', '<p>www.vous.lu/jobs</p>', '2012-10-11 14:16:02', '2012-10-11 14:16:02', 2, 'Luxembourg'),
(62, 269, 345, '', '<p>Send a mail to sbo [-at-] voxteneo (dot) com&nbsp;</p>', '2012-10-23 12:52:52', '2012-10-23 12:52:52', 2, 'Brussels'),
(63, 270, NULL, '<p><span>Strong visual communication skills with a dedication to detail and consistency;</span><br /><br /><span>Profound knowledge of GUI design principles both in Web and mobile interfaces;</span><br /><br /><span>Interest in Web design trends and news</span><br /><br /><span>Excellent knowledge of HTML, JavaScript (besides CSS);</span><br /><br /><span>Experience in online web &amp; mobile application solutions;</span><br /><br /><span>Understand design methodologies, including participatory design and rapid iterative prototyping;</span><br /><br /><span>Knowledge of practical benefits and limitations of relevant technologies;&nbsp;</span><br /><br /><span>Able to think outside the box to find compromises between technical restrictions and development of creative ideas;</span><br /><br /><span>Likes to work in a dynamic environment;</span><br /><br /><span>Knowledge of French and Dutch;</span></p>', '<p><span>If you want to be part of a company in full expansion in Brussels (Forest), please send your application letter and cv to ProduPress, attn Cindy Reyniers, Generaal Dumonceaulaan 56/2, 1190 Brussels, or by email to job@produpress.be.</span></p>', '2012-10-25 08:23:35', '2012-10-25 08:23:36', 2, 'Brussels'),
(64, 271, 384, '<p>- HTML (5)</p>\r\n<p>- CSS (3) and all its sourrinding derivates and usages</p>\r\n<p>- JS : Jquery / Sencha touch</p>\r\n<p>A good knowledge of the slicing methods and pitfall. Backwards compatility methods, Media-Queries, Animations, CSS transitions, ...</p>\r\n<p>Having a proven experience on the following CMS is an asset :</p>\r\n<p>- Wordpress</p>\r\n<p>- Drupal</p>\r\n<p>- Magento</p>\r\n<p>Knowledge of Dutch is considered as a strong asset.</p>', '<p>Simply drop a line to benoit@infine-digital.be</p>', '2012-10-25 08:56:13', '2012-10-25 08:56:13', 2, 'Liege'),
(65, 274, 384, '<p>IOS</p>\r\n<p>Android</p>', '<p>Drop me a line at benoit@infine-digital.be</p>', '2012-11-25 17:28:23', '2012-11-25 17:28:23', 2, 'Liege');
