INSERT INTO posts (id, title, content, post_type_id, created_at, updated_at, user_id, validated, accepted_at, refused_at, online) VALUES
(1, 'Welcome on Beta !', '<p><span>Hi everyone !<br />It took a long time, but here we are !&nbsp; <strong>Webshaker beta is out</strong> !&nbsp;</span>&nbsp;</p>\r\n<p><span>We have spend months on designing, coding, testing... We had to leave aside or postpose some features and we are aware that everything is not perfect. But we are proud and very happy to be able to propose you this beta release and we hope that Webshaker will answer at least a part of your expectations.&nbsp;</span>&nbsp;</p>\r\n<p><span>What you&rsquo;ll find here :&nbsp;</span></p>\r\n<ul>\r\n<li><span><strong>The Shaker</strong> allows you to be held informed about the last news, projects, jobs offers or events of Belgian Web.</span></li>\r\n<li><span><strong>The Directory</strong>, as for it, allows you to look for the various profiles of agencies, workers or students.</span></li>\r\n</ul>\r\n<p><span>Feel free to <strong>comment</strong>, <strong>bookmark</strong> or simply <strong>like</strong>&nbsp;a post to show us your interest.&nbsp;</span></p>\r\n<p><span>Because we want to develop Webshaker, don&rsquo;t hesitate to give us remarks/bugs/suggestions/opinions via the &laquo;Feedback&raquo; tab, on the middle left of your screen.&nbsp; Don&rsquo;t forget some questions have been already answered on <a title="Go to the FAQ/About page" href="../../faq">the FAQ page</a>.</span>&nbsp;</p>\r\n<p><span>If you are not registered yet, do it right now by going on <a title="Go to the sign up page" href="http://webshaker.be/users/sign_up">the sign up page</a> and simply create your profile !</span></p>\r\n<p><span>Thanks a lot and enjoy Webshaker,<br /><em>The Webshaker Team.</em></span></p>', 1, '2011-11-14 14:55:47', '2011-11-17 12:39:03', 3, 1, '2011-11-14 14:55:47', NULL, 1),
(3, 'Terre Neuve', '<p>New one page website for Terre Nerre store at Bastogne</p>', 2, '2011-11-16 08:18:47', '2011-11-16 08:22:24', 2, 1, '2011-11-16 08:19:40', NULL, 1),
(8, 'Kikk Festival 2011 ', '<p>Festival digital international r&eacute;current, KIKK explore les implications &eacute;conomiques et artistiques des nouvelles technologies, consid&eacute;rant que s&rsquo;approprier ou anticiper le changement permet de le transformer en opportunit&eacute;.</p>\r\n<p>KIKK sonde le sujet en int&eacute;gralit&eacute;&nbsp;: au travers des espaces Konference, WorKshop et eKsperience, il d&eacute;sire offrir l&rsquo;acc&egrave;s &agrave; l&rsquo;information et &agrave; l&rsquo;exp&eacute;rimentation de ces nouvelles possibilit&eacute;s au public.</p>\r\n<p>Avec KIKK KocKtail, le festival met aussi &agrave; l&rsquo;honneur le networking et l&rsquo;&eacute;change entre professionnels.</p>', 3, '2011-11-17 07:57:49', '2011-11-17 08:41:20', 11, 1, '2011-11-17 08:41:20', NULL, 1),
(9, 'Emuzikos - The first easy way to find local musicians', '<p>Did you ever wonder why musicians can&rsquo;t find each other on the web? Well, it&rsquo;s probably because they hate spending time on their computer instead of their instrument.</p>\r\n<p>Musicians web platform have been a pain to use until now for several reasons:</p>\r\n<ul>\r\n<li>It&rsquo;s a forum based service where you can never find something easily. You have to browse these thousands of posts before you get to the right information. Pretty boring experiences.</li>\r\n<li>It&rsquo;s a web service based on a profitable business model and they&rsquo;re seriously too expensive for most of the poor musicians.</li>\r\n<li>The registration process is too long.</li>\r\n</ul>\r\n<p>So here is a nice solution. Its free, easy &amp; fast.</p>\r\n<p>Emuzikos is a search engine for local musicians, bands or agents. As mentioned before,<strong> it&rsquo;s completely free</strong>. It claims to be the missing tool of the musicians world.</p>\r\n<p>The interface is pretty neat and easy to use.</p>\r\n<p>You can search for musicians, bands or agents. Sort them by instruments, musical genres, country, zip code,&hellip; and promote your profile on multiple social networks.</p>\r\n<p>You also got a personal inbox and a contact list where you can save members.</p>\r\n<p><a title="Emuzikos, find local musicians" href="http://emuzikos.com/">Visit Emuzikos now</a></p>', 2, '2011-11-17 13:36:43', '2011-11-18 11:23:54', 21, 1, '2011-11-17 13:38:19', NULL, 1),
(10, 'BetaGroup #30 - Massive Gathering of Belgian Tech Entrepreneurs', '<p>The BetaGroup is a community of 4.200 Belgian entrepreneurs passionate about Internet, Software and Online Media.<br />Meetings are free and open to all the community: Entrepreneurs, Innovators,&nbsp; Coders, Designers, Business Angels, Bloggers, Journalists&nbsp; and Policy Makers.</p>\r\n<p><strong style="font-style: normal; font-weight: bold;">WHY</strong>: <br /> -to celebrate the 30th gathering of the BetaGroup <br /> -to celebrate the 1st birthday of the <a style="color: #597bb7; text-decoration: underline;" href="http://go.madmimi.com/redirects/bc1bfbb4178737bdf256afeee3db4026?pa=6274640946" target="_blank">coWorking Space</a> and the <a style="color: #597bb7; text-decoration: underline;" href="http://go.madmimi.com/redirects/9857ca89860e4b535dc19ed8d92671b9?pa=6274640946" target="_blank">120 coworkers</a> <br /> -to celebrate the vibrant Belgian Tech Community <br /> -to show to your partners that geeks can also party hard</p>', 3, '2011-11-17 14:27:45', '2011-11-17 14:39:31', 3, 1, '2011-11-17 14:27:45', NULL, 1),
(13, 'MobileResto', '<p>Discover our brand new service!</p>\r\n<p>MobileResto allows restaurants to easily create their own iPhone/iPad application.</p>', 2, '2011-11-18 10:42:38', '2011-11-18 10:44:51', 1, 1, '2011-11-18 10:44:51', NULL, 1),
(14, 'Taskii', '<p>Taskii is a project management tool that we launched in 2008 to meet some of our own needs. It may meet your needs too.</p>', 2, '2011-11-18 11:19:25', '2011-11-18 11:22:06', 45, 1, '2011-11-18 11:22:06', NULL, 1),
(16, 'ICE-Game', '<p>ICE-Watch Facebook page is a real success with more than 260.000 fans . To reward them of their engagement and attract new fans, they wanted a game that would would create some interaction and some fun that could be shared among the community and their friends.</p>\r\n<p>We developed a simple and fun game based on the Tetris concept using the ICE-Watch box to create a set of colors and create a challenging experience. The game was a real success with more than 190.000 gameplay!</p>', 2, '2011-11-19 20:15:13', '2011-11-19 20:38:38', 14, 1, '2011-11-19 20:38:38', NULL, 1),
(17, 'Kickoff', '<p>Collaboration software for small teams.</p>', 2, '2011-11-22 15:13:46', '2011-11-22 15:14:56', 60, 1, '2011-11-22 15:14:56', NULL, 1),
(18, 'Dinosaurus-lu.be', '<p>Creation of the corporate website of the dinosaurus brand (Kraft group).</p>\r\n<p>The customer wanted a young and stylish look and feel. That''s why we decided to make full illustration website.</p>', 2, '2011-11-25 10:23:20', '2011-11-25 10:26:40', 12, 1, '2011-11-25 10:26:40', NULL, 1),
(19, 'Checkthis', '<p>The web, simplified.</p>\r\n<p>No registration. No set-up. No save button. Just put up content, change how it looks, share your link, get instant feedback. In seconds.&nbsp;<br /><br /><a href="http://checkthis.com/about">http://checkthis.com/about</a></p>\r\n<p>The way we see it, the web was meant to be about sharing things instantly and intuitively. Freeing us to behave the way we want.</p>\r\n<p>But somewhere along the line, it became about grabbing your personal data and directing your behaviour. Like this. Share that. Try this. Click here.</p>\r\n<p>We want to bring things back to the way they should be.&nbsp;Fast. Intuitive. Individual. Open to all.</p>', 2, '2011-11-28 10:11:34', '2011-11-28 10:12:47', 71, 1, '2011-11-28 10:12:47', NULL, 1),
(20, 'X-AS ', '<p>X-AS &reg; est une nouvelle marque de pr&ecirc;t &agrave; porter cr&eacute;&eacute;e en Belgique par l''Atelier de Haute Couture "DigameSi".&nbsp;</p>\r\n<p>Site web r&eacute;alis&eacute; via le CMS Wordpress.</p>', 2, '2011-11-28 10:34:51', '2011-11-28 14:38:43', 72, 1, '2011-11-28 14:38:43', NULL, 1),
(22, 'Caf Numrique Lige S02 #5: Le web dans les nuages', '<p>Vous l&rsquo;avez compris, pour ce&nbsp;<strong>Caf&eacute; Num&eacute;rique Li&egrave;ge S02 #5</strong>&nbsp;nous allons aborder le&nbsp;<strong><em>cloud</em></strong>&nbsp;et la&nbsp;<em><strong>fin de l&rsquo;h&eacute;g&eacute;monie du PC desktop.</strong></em></p>\r\n<p>Nous quittons actuellement une &eacute;poque de domination. Fini la toute puissance des constructeurs et &eacute;diteurs de logiciels tels que&nbsp;Microsoft, HP, Dell, IBM, etc. Quelques indices:</p>\r\n<ul>\r\n<li>Les ventes des smartphones et tablettes ont d&eacute;pass&eacute; celles des ordinateurs en 2010 ;</li>\r\n<li>Windows vient de passer sous la barre des 50% des parts de march&eacute; des&nbsp;terminaux&nbsp;connect&eacute;s ;</li>\r\n<li>Les smartphones et tablettes repr&eacute;sentent d&eacute;j&agrave; 5% de trafic en Europe&hellip;</li>\r\n</ul>\r\n<p>En effet, l&rsquo;utilisateur poss&egrave;de maintenant le multi-acc&egrave;s et son comportement montre qu&rsquo;il s&rsquo;int&eacute;resse de plus en plus au contenu et aux services.&nbsp;<a title="Fred Cavazza" href="http://www.fredcavazza.net/2011/11/09/quel-va-etre-impact-de-la-fin-de-lordinateur-individuel/" target="_blank">Fred Cavazza&nbsp;</a>dans un r&eacute;cent&nbsp;<a title="Fred Cavazza" href="http://www.fredcavazza.net/2011/11/09/quel-va-etre-impact-de-la-fin-de-lordinateur-individuel/" target="_blank">article</a>&nbsp;pr&eacute;cise:</p>\r\n<p>&laquo;&nbsp;&laquo;&nbsp;<em>Profitez</em>&laquo;&nbsp;, je pense que c&rsquo;est bien l&agrave; le maitre-mot : apr&egrave;s des&nbsp;d&eacute;cennies&nbsp;d&rsquo;humiliation, la patiente des utilisateurs est &agrave; bout, ils ne veulent plus s&rsquo;emb&ecirc;ter &agrave; installer les bons drivers, mettre &agrave; jour et param&eacute;trer les logiciels, s&rsquo;assurer que les protections anti-virus &nbsp;sont op&eacute;rationnelles&hellip;&nbsp;<strong>Les utilisateurs veulent devenir de simples consommateurs de contenus et services, et pour cela, ils sont pr&ecirc;ts &agrave; faire des concessions</strong>&nbsp;: troquer de l&rsquo;&eacute;volutivit&eacute; et de la souplesse contre de la simplicit&eacute; et de la tranquillit&eacute;, m&ecirc;me si cela implique de se rendre d&eacute;pend de Apple ou Google. Qu&rsquo;importe, apr&egrave;s tout ce sont des marques cool, non ?</p>\r\n<p>Pour r&eacute;sumer une longue explication, j&rsquo;&eacute;crirais ceci :&nbsp;<strong>nous quittons l&rsquo;&egrave;re o&ugrave; nous capitalisions sur l&rsquo;outil informatique</strong>&nbsp;(avoir une machine robuste et &eacute;volutive pour qu&rsquo;elle puisse durer plus longtemps)&nbsp;<strong>pour rentrer dans celui des contenus et services pervasifs&nbsp;</strong>(qu&rsquo;importe le terminal d&rsquo;acc&egrave;s, l&rsquo;important est que je puisse acc&eacute;der &agrave; mes fonctions sociales, ma musique, mes jeux&hellip; et ceux depuis n&rsquo;importe o&ugrave;).&nbsp;&raquo;</p>\r\n<p>Pour aborder ce th&egrave;me aussi riche que vaste, nos intervenants confirm&eacute;s:</p>\r\n<p><strong><a title="Laurent Eschenauer" href="http://www.linkedin.com/profile/view?id=4663330&amp;locale=en_US&amp;trk=tyah" target="_blank"><img class="alignleft" title="Laurent" src="http://m1.licdn.com/mpr/mpr/shrink_100_100/p/2/000/005/217/3d00844.jpg" alt="" width="100" height="100" />Laurent Eschenauer,</a></strong>&nbsp;<em>Co-founder &amp; Head of Software Development</em>&nbsp;chez&nbsp;<a title="ComodIt" href="http://www.comodit.com/" target="_blank">ComodIT</a>.</p>\r\n<p><strong>Le &laquo;&nbsp;cloud&nbsp;&raquo; c&rsquo;est quoi et comment peut-il aider mon entreprise ?&nbsp;</strong><span>Laurent nous en expliquera les diff&eacute;rentes facettes, et nous montrera comment les entreprises peuvent en b&eacute;n&eacute;ficier. Il nous pr&eacute;sentera &eacute;galement l&rsquo;outil ComodIT: une plateforme d&eacute;velopp&eacute;e par une jeune startup&nbsp;li&eacute;geoise, qui&nbsp;r&eacute;volutionne&nbsp;la mani&egrave;re de g&eacute;rer son informatique dans les nuages.</span></p>\r\n<p><strong><a title="Anthony Heukmes" href="http://www.linkedin.com/profile/view?id=14145956&amp;locale=en_US&amp;trk=tyah" target="_blank"><img class="alignleft" title="Anthony" src="http://m1.licdn.com/mpr/mpr/shrink_100_100/p/2/000/0fc/11a/134215f.jpg" alt="" width="100" height="100" />Anthony Heukmes</a></strong>,&nbsp;<a title="IntoTheWeb" href="http://intotheweb.be/" target="_blank">IntoTheWeb</a>&nbsp;<em>Owner</em>.</p>\r\n<p>De fa&ccedil;on plus tactile Anthony nous pr&eacute;sentera&nbsp;notamment&nbsp;une de ses derni&egrave;res r&eacute;alisations &agrave; savoir&nbsp;<a href="http://mobileresto.com/">mobileresto.com</a>&nbsp;un outil qui permet aux restaurants de poss&eacute;der leur propre application sur Iphone/Ipad mais aussi une application web mobile accessible et optimis&eacute;e pour tous les autres smartphones / tablettes.</p>\r\n<p>L&rsquo;&eacute;v&eacute;nement est&nbsp;<strong>gratuit et ouvert &agrave; tous</strong>. Les inscriptions ne sont pas obligatoires mais nous vous invitons &agrave;&nbsp;vous&nbsp;<a title="Event Facebook" href="https://www.facebook.com/events/266300696751568/?context=create" target="_blank">inscrire &agrave; notre &eacute;v&eacute;nement Facebook</a>&nbsp;pour pr&eacute;voir nos quantit&eacute;s pour le catering. Des boissons et sandwiches seront disponibles toute la soir&eacute;e.</p>\r\n<p><strong>Date: Mercredi 14 d&eacute;cembre &agrave; partir de 19h</strong></p>\r\n<p><strong>Lieux:&nbsp;<a title="WSL" href="http://www.wsl.be/" target="_blank">WSL</a>&nbsp;<a title="WSL" href="http://maps.google.be/maps?q=Rue+des+Chasseurs+Ardennais,+3+4031+Angleur-Li%C3%A8ge&amp;ie=UTF8&amp;hnear=Rue+des+Chasseurs+Ardennais+3,+4031+Li%C3%A8ge,+R%C3%A9gion+Wallonne&amp;gl=be&amp;t=m&amp;z=16&amp;vpsrc=0" target="_blank">Rue des Chasseurs Ardennais, 3 4031 Angleur-Li&egrave;ge</a></strong></p>', 3, '2011-12-01 15:38:52', '2011-12-01 15:41:47', 76, 1, '2011-12-01 15:41:47', NULL, 1),
(23, 'Maison du Tourisme du Pays de Saint-Hubert', '<p>Un portail touristique qui se veut attractif et dynamique au travers d''un graphisme soign&eacute;e et d''une navigation ais&eacute;e.<br /><br />Le portail tourne sous le cms DRUPAL et permet donc au client de g&eacute;rer les informations de son site web de fa&ccedil;on autonome.</p>\r\n<p>Le contenu des informations pr&eacute;sentes sur le site est principalement     aliment&eacute; par la base de donn&eacute;es HADES, mise en place par la     F&eacute;d&eacute;ration Touristique du Luxembourg Belge.&nbsp;Il s''agit du premier site web &eacute;tant connect&eacute; de fa&ccedil;on aussi     importante &agrave; HADES.</p>\r\n<p>Les principales fonctionnalit&eacute;s du portail :<br /> - Pr&eacute;sentation de la r&eacute;gion en jouant sur l''attrait visuel via la     pr&eacute;sence de nombreuses photographies du territoire.<br /> - Possibilit&eacute; pour le visiteur de pr&eacute;parer son s&eacute;jour de fa&ccedil;on     ludique via un g&eacute;n&eacute;rateur de brochure personnalis&eacute;e (Rubriques "Mes     id&eacute;es s&eacute;jour").<br /> - Possibilit&eacute; de g&eacute;n&eacute;rer son itin&eacute;raire depuis son domicile via     n''importe quel centre d''int&eacute;r&ecirc;t sur chaque page du site.<br /> - Possibilit&eacute; de partager chaque centre d''int&eacute;r&ecirc;t sur son mur     Facebook.&nbsp;</p>', 2, '2011-12-06 09:44:49', '2011-12-06 11:27:41', 72, 1, '2011-12-06 11:27:41', NULL, 1),
(24, 'Graphic Designer', '<p>We''re looking for a talented intern to join our team in the early 2012.</p>\r\n<p>We''re currently seeking a passionate graphic designer with great webdesign and communication skills. Print designers won''t be considered because our activity is mainly webdesign and web development</p>\r\n<p>He would be able to work with us on our projects and he (or she) will demonstrate the best willing to help in our daily design tasks.</p>\r\n<p>It''s important to notice that we''ll probably refuse applications for internships lasting less than a month and we strongly encourage those looking for a several months internship because it''s the necessary amount of time to get&nbsp; to know us, our way to work and to work on your very own projects.</p>', 4, '2011-12-06 13:58:28', '2011-12-06 13:59:17', 50, 1, '2011-12-06 13:59:17', NULL, 1),
(25, 'My Winebox', '<p>My winebox propose sous forme d&rsquo;abonnement des vins au tr&egrave;s bon rapport  qualit&eacute;/prix &agrave; des clients&nbsp;qui appr&eacute;cient partager une bonne bouteille  sans devoir&nbsp;consacrer trop de temps &agrave; la d&eacute;nicher!</p>', 2, '2011-12-07 12:40:35', '2011-12-07 12:46:56', 50, 1, '2011-12-07 12:46:56', NULL, 1),
(26, 'Webshaker final release is on-line !', '<p>Thanks to everyone for your feedback which helped to correct the last few bugs.<br />What''s new :</p>\r\n<ul>\r\n<li>All the profiles can now post news or an event.</li>\r\n<li>Freelances can post job offers like agencies do.</li>\r\n<li>Students have the possibility of creating their own <strong>portfolio</strong>.</li>\r\n<li>The profiles called "Others" now appear in the directory.</li>\r\n<li>Agency administrators can send invitations to their colleagues.</li>\r\n<li>The posts in the shaker can be ?ltered according to the profiles you have or have not bookmarked.</li>\r\n<li>A map is available to see all the agencies and the freelances.</li>\r\n<li>Posts can be shared through Facebook, Twitter, Google+ and Linked In.</li>\r\n<li>The directory search has been improved.</li>\r\n<li>Agency administrators can now inform a baseline.</li>\r\n<li>The "<strong>top posts</strong>" which list the information which attracted your attention the most.</li>\r\n</ul>\r\n<p><br />We hope that these new features will meet your expectations.<br />Please don?t hesitate to give us your impressions in the comments box below.<br /><br /><em>The Webshaker Team</em></p>', 1, '2011-12-08 13:05:56', '2011-12-08 13:40:38', 3, 1, '2011-12-08 13:05:56', NULL, 1),
(27, 'Bureau347 on stage !', '<p><span lang="en"><span>To inaugurate</span> <span>the interviews</span><span>, here is</span> <span>the agency</span> <a href="../../companies/67-bureau347">bureau<span>347</span></a><span>.</span><br /> <span>Please share</span> <span>the video</span> <span>up</span> <span>around you ;).</span></span></p>', 5, '2011-12-08 15:01:39', '2011-12-08 21:52:36', 3, 1, '2011-12-08 15:01:39', NULL, 1),
(28, 'FLU - multi user wirelessly interactive installation', '<p><strong>FLU</strong>&nbsp;is an multi-user interactive installation, where the spectators''&nbsp;<strong>mobile devices</strong>&nbsp;are used as tactile controllers to interact in realtime with the visualization.<br /><br />It relies on&nbsp;<strong>open web technologies</strong>, namely HTML5, Javascript,&nbsp;<a href="http://nodejs.org/">Node.js</a>,&nbsp;<a href="http://socket.io/">Socket.IO</a>,<a href="http://www.khronos.org/webgl/">WebGL</a>&nbsp;and does not need to be connected to the internet.</p>\r\n<p>More info : <a href="http://flu.minimal.be">flu.minimal.be</a></p>\r\n<p>Interface design made by <a href="http://www.paperduck.be">paperduck</a></p>', 2, '2011-12-08 15:46:03', '2011-12-08 16:45:40', 120, 1, '2011-12-08 15:57:41', NULL, 1),
(29, 'Twusic', '<p>Twusic is the simplest way to stream your Twitter music feed to your social network just by tweeting the song and artist&rsquo;s name together with the #nowplaying hashtag ! Explore and retweet your friends''s radio stations and playlists, share your favorite tracks and check out what the world is listening to...</p>', 2, '2011-12-08 16:33:51', '2011-12-08 16:34:49', 126, 1, '2011-12-08 16:34:49', NULL, 1),
(31, 'La Carotte', '<p>Un shop plein de vitamines pour nos cerveaux cr&eacute;atifs.<br />A visitez au moins 5x par jour !&nbsp;</p>', 2, '2011-12-08 17:53:27', '2011-12-08 18:18:51', 132, 1, '2011-12-08 18:18:51', NULL, 1),
(32, 'e-commerce: online payment solutions for e-shoppers', '<p>l''AWT et le service INFO-PME de l''IDEA proposent de faire le point  sur les diff&eacute;rents moyens de paiement en ligne &agrave; disposition d''un  cyber-commer&ccedil;ant: avantages et inconv&eacute;nients de chacun d''entre eux,  comment choisir, etc.</p>', 3, '2011-12-08 21:05:53', '2011-12-08 21:18:46', 143, 1, '2011-12-08 21:18:46', NULL, 1),
(33, 'Rekorder.be', '<p>This is the portfolio of the movie machine Seb Rekorder. The project was fully designed and developed during my internship at&nbsp;<strong>Bureau 347</strong>.&nbsp; The site is feeded by the Vimeo user account of the client and use the Vimeo API.&nbsp;I am self-trained in the use of this API for the needs of the briefing: create a quick and easy mini-CMS with a small budget.</p>', 2, '2011-12-08 22:03:52', '2011-12-09 13:41:08', 22, 1, '2011-12-09 08:27:52', NULL, 1),
(34, 'wrrrk.', '<p>This is the landing page of an upcoming work-related service on the rails. HTML5, CSS3 and a few nice pixels.</p>', 2, '2011-12-09 07:44:14', '2011-12-09 10:06:40', 136, 1, '2011-12-09 10:06:40', NULL, 1),
(35, 'Current portfolio', '<p>Here''s my current portfolio. I am doing an internship for now but I hope having time as soon as possible to show another kind of me by making a new portfolio.</p>', 2, '2011-12-09 08:20:27', '2011-12-09 08:20:27', 151, 1, NULL, NULL, 1),
(37, 'Brussels Accessible Art Fair Virtual Tour', '<p>R&eacute;alisation de&nbsp;la visite virtuelle compl&egrave;te de la Brussels Accessible Art Fair &agrave; l&rsquo;h&ocirc;tel Conrad (Bruxelles) du 28 au 30 octobre dernier.</p>\r\n<p>Gr&acirc;ce &agrave; la visite virtuelle, nous donnons la possibilit&eacute; de  d&eacute;couvrir ou red&eacute;couvrir cet &eacute;v&eacute;nement unique de mani&egrave;re compl&egrave;tement  interactive et immersive.</p>\r\n<p>Bougez votre souris pour int&eacute;ragir &agrave; 360&deg;, cliquez sur les hotspots pour afficher les  fiches descriptives de chaque artiste ou pour naviguer dans la visite.</p>\r\n<p>Le projet a n&eacute;cessit&eacute; la prise de vue de +500 photos, int&eacute;gration Flash &amp; XML et une version HTML5 a &eacute;t&eacute; sp&eacute;cifiquement d&eacute;velopp&eacute;e pour iPad/iPhone.</p>\r\n<p>Temps de r&eacute;alisation: 1 mois</p>', 2, '2011-12-09 09:59:28', '2011-12-09 10:01:39', 149, 1, '2011-12-09 10:01:39', NULL, 1),
(39, 'Formation "Mon entreprise sur les rseaux sociaux"', '<p><strong>Une journ&eacute;e pour apprendre &agrave; communiquer sur les r&eacute;seaux</strong></p>\r\n<p>Au-del&agrave; des effets de mode, quel outil est le plus utile &agrave; votre organisation ? Quelles sont les r&egrave;gles de communication pour chaque r&eacute;seau ? Comment gagner en visibilit&eacute; et tirer de r&eacute;els b&eacute;n&eacute;fices de votre pr&eacute;sence sur les r&eacute;seaux sociaux ?</p>\r\n<p>Au programme :</p>\r\n<ul>\r\n<li class="text">D&eacute;couvrir et choisir les r&eacute;seaux sociaux adapt&eacute;s &agrave; la strat&eacute;gie de votre organisation</li>\r\n<li class="text">Am&eacute;liorer l''efficacit&eacute; de votre communication sur les r&eacute;seaux sociaux</li>\r\n<li class="text">Trouver des id&eacute;es concr&egrave;tes pour animer votre page Facebook, votre compte Twitter, votre pr&eacute;sence sur LinkedIn</li>\r\n</ul>\r\n<p>PAF : 225 EUR</p>\r\n<p>Organisation : Hub Brussels</p>', 3, '2011-12-09 10:28:55', '2011-12-09 11:20:46', 160, 1, '2011-12-09 10:31:40', NULL, 1),
(40, 'Cook a la casa Coming soon ', '<p><span id="internal-source-marker_0.21531371725723147">Cook a la casa is an online platform where passionate cooks (professional or not) can welcome some guests for a dinner at home </span></p>', 2, '2011-12-09 10:32:32', '2011-12-09 11:19:33', 145, 1, '2011-12-09 11:16:17', NULL, 1),
(41, 'The crazy world of Sony-Ericsson ', '<p>A Social Gaming project designed and developped by reed.be.&nbsp;</p>', 2, '2011-12-09 11:52:27', '2011-12-09 12:25:37', 165, 1, '2011-12-09 12:25:37', NULL, 1),
(45, 'La Fd', '<p>"La F&eacute;d&eacute; - F&eacute;d&eacute;ration des &eacute;tudiants de l''ULg" is the organization that help, defend and represent the student at the Univeristy of Li&egrave;ge.</p>\r\n<p>The website tries to give the best and easiest access to important news : "MyF&eacute;d&eacute;" create a personalized page for each student, with post that really matter for them.</p>\r\n<p>The home page give a quick access to the headlines of "Le P''tit Tor&ecirc;", the student''s magazine.</p>', 2, '2011-12-09 14:29:09', '2011-12-09 14:29:09', 189, 1, NULL, NULL, 1),
(46, 'Le P''tit Tor', '<p>"Le P''tit Tor&ecirc;" is the magazine made by and for the student at the University of Liege.</p>\r\n<p>The website tries to be as close as possible to the layout of the print edition : columns, same font.</p>\r\n<p>AJAX is also used to give the website flexibility and speed : author box in a sexy overlay, 404 message on top of home,...</p>', 2, '2011-12-09 14:34:01', '2011-12-09 14:34:01', 189, 1, NULL, NULL, 1),
(47, 'My Portfolio', '<p>This is my portfolio.</p>', 2, '2011-12-09 14:47:56', '2011-12-09 14:47:56', 205, 1, NULL, NULL, 1),
(48, 'Timetrack', '<p><strong>Timesheets and online invoicing</strong></p>\r\n<p class="justify">Timetrack is a tool aimed at simplifying the&nbsp;<strong>management of your timesheets</strong>&nbsp;and allowing you to&nbsp;<strong>create your invoices</strong>&nbsp;in only a few clicks.&nbsp;</p>\r\n<ul>\r\n<li>Ultra fast timesheet data entry</li>\r\n<li>Create and send invoices</li>\r\n<li>Advanced reporting</li>\r\n<li>iCal synchronisation</li>\r\n<li>Modelize your activity</li>\r\n<li>Excel import/export</li>\r\n<li>Multi-users</li>\r\n<li>Role based access control</li>\r\n</ul>', 2, '2011-12-09 15:11:23', '2011-12-09 15:22:44', 187, 1, '2011-12-09 15:21:52', NULL, 1),
(51, 'NET developers, Drupal integrators, HTML-CSS-Javascript Guru''s, Python and more', '<h4>NET developers,&nbsp;Drupal integrators, HTML-CSS-Javascript Guru''s, Python and more</h4>\r\n<p>You will join our team to take charge of analysis and development of ambitious projects.<br />You will be working as part of a skilled team, in a very "human" environment.<br /><br />We  will offer you an indefinite contract and maintain a policy of  continuous training to guarantee your professional development.</p>\r\n<p>Knowledge of the second language and/or English is a plus.<br />We will  offer you an indefinite contract and maintain a policy of continuous  training to guarantee your professional development.</p>', 4, '2011-12-09 16:05:02', '2011-12-09 16:05:59', 202, 1, '2011-12-09 16:05:59', NULL, 1),
(52, 'Reportage photo "Women Only Night"', '<p>Des images dynamiques, color&eacute;es, nettes, et originales pour alimenter les r&eacute;seaux sociaux de mani&egrave;re r&eacute;guli&egrave;re ainsi que le site web principal. La soir&eacute;e s''est d&eacute;roul&eacute;e durant le mois de novembre 2011, d&eacute;fil&eacute; de mode, champagne, DJ''tte, et invit&eacute;s de marque.</p>', 2, '2011-12-09 17:23:27', '2011-12-09 18:11:12', 239, 0, '2011-12-09 18:11:12', NULL, 1),
(53, 'Nice People', '<p>iPhone App we''ve designed for Nice People.&nbsp;</p>\r\n<p>The app allows users to search and meet people in Belgium.</p>', 2, '2011-12-09 19:35:10', '2011-12-12 15:48:49', 4, 0, '2011-12-12 15:48:49', NULL, 1),
(54, 'Sinneo', '<p>- Vous h&eacute;sitez &agrave; acheter un article de seconde main ?<br />- Vous &ecirc;tes sensible &agrave; la protection de vos biens&nbsp;?<br />- Victime d&rsquo;un vol, d&rsquo;un incendie, d&rsquo;un d&eacute;g&acirc;t des eaux,&nbsp;<br />vous aimeriez avoir &agrave; disposition un outil aidant au&nbsp;<br />processus de remboursement ?<br /><br /><br />Aujourd&rsquo;hui, Sinneo, label de qualit&eacute;, vous permet&nbsp;<br />d''acc&eacute;der &agrave; ces services en quelques clics...<br /><br />&bull; R&eacute;pertoriez tout appareil muni d''un num&eacute;ro de s&eacute;rie<br />&bull; Vendez et achetez en toute confiance<br />&bull; Sauvegardez la documentation de l''&eacute;quipement<br />&bull; Facilitez le suivi du dossier aupr&egrave;s des autorit&eacute;s<br />&bull; Prouvez l&rsquo;acquisition d&rsquo;un bien...</p>', 2, '2011-12-09 21:02:51', '2011-12-10 00:56:06', 126, 0, '2011-12-10 00:56:06', NULL, 1),
(55, 'Esperanzah!', '<p>Esperanzah! est un festival de world musique qui allie une programmation  musicale et une th&eacute;matique. Il se d&eacute;roule &agrave; l''abbaye de Floreffe, entre  Charleroi  et Namur  en Belgique.</p>', 2, '2011-12-09 21:55:58', '2011-12-10 00:56:25', 250, 1, '2011-12-10 00:56:25', NULL, 1),
(57, 'VuerichB recycled skateboards sunglasses', '<p>The belgians Vuerich brothers are making wooden sunglasses with recycled skateboard. They make them in their own small factory in Barcelona.</p>\r\n<p>The layers composing a skateboard creates endless variation of colors, giving each pair a unique character.&nbsp;So we needed to create a website showing every pair in details. We used a customed Prestashop and Wordpress for the blog.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 2, '2011-12-10 22:25:17', '2011-12-11 09:48:35', 165, 1, '2011-12-11 09:48:35', NULL, 1),
(59, 'Sr Web Developer', '<div id="dev" class="job-desc">\r\n<h3>Web Developer</h3>\r\n<p>We are looking for a Web Developer.<br /> He/she should be a senior profile with the following skills and knowledges:</p>\r\n<ul class="job-list" style="list-style-type: circle;">\r\n<li><strong>PHP</strong> : to navigate to any PHP code quickly, cleanly and efficiently encode (with the performance and safety at all time)</li>\r\n<li><strong>MySQL</strong> =&gt; able to create complex databases, with indexes and efficient structures, associated SQL queries.</li>\r\n<li><strong>HTML / CSS</strong> =&gt; very strong knowledge in advanced HTML and CSS, and have a great interest on the final design</li>\r\n<li><strong>JS / jQuery</strong> =&gt; able to juggle with the Jquery javascript in general</li>\r\n<li><strong>Able to juggle</strong>: XML, UTF-8, logs, FTP, RSS, backups, web services, API ...</li>\r\n<li class="last"><strong>Administration of a Linux server with Apache</strong> (minimum basic knowledge)</li>\r\n<li><strong>Frameworks</strong>: CodeIgniter, Zend ...</li>\r\n<li><strong>CMS</strong>: Wordpress, Drupal, ExpressionEngine, ... to create well-integrated modules</li>\r\n<li><strong>E-Commerce</strong>: Magento, Ogone, SSL ...</li>\r\n<li><strong>Mobile</strong>: notions on mobile sites and mobile applications</li>\r\n<li class="last"><strong>Social Networks</strong>: Using API''s</li>\r\n<li>Can estimate his work and analyze the best choice to take on a project basis.</li>\r\n<li class="last">Always listening on the rapid changes in the web.</li>\r\n</ul>\r\n<ul class="job-list">\r\n</ul>\r\n</div>', 4, '2011-12-12 09:43:54', '2011-12-12 09:57:38', 274, 1, '2011-12-12 09:57:38', NULL, 1),
(60, 'ProduWeb recherche des dev .NET !', '<p>N&eacute;e de l&rsquo;association de ProduWeb SA, 1<sup>&egrave;re</sup>&nbsp;agence web de Wallonie, et du 1<sup>er</sup>&nbsp;groupe de jeux de hasard belge, ProduWeb Gaming est une soci&eacute;t&eacute; ultra dynamique qui propose un logiciel de jeux de casino en ligne in&eacute;dit suite &agrave; la nouvelle r&egrave;glementation belge dans le secteur.</p>\r\n<p><strong>Pour d&eacute;velopper cette activit&eacute; de jeux en ligne, ProduWeb Gaming recherche un d&eacute;veloppeur .NET</strong></p>\r\n<p><strong>Vos responsabilit&eacute;s&nbsp;:</strong></p>\r\n<ul>\r\n<li><strong>&nbsp;</strong>Vous participez &agrave; la gestion et au d&eacute;veloppement de casinos en ligne en ASP.NET bas&eacute;s sur le Framework 4.0.</li>\r\n<li>Vous participez &agrave; l&rsquo;&eacute;laboration de jeux en ligne.</li>\r\n</ul>\r\n<p><strong><br /></strong></p>\r\n<p><strong>&nbsp;</strong><strong>Nous vous proposons&nbsp;:</strong></p>\r\n<ul>\r\n<li>D&rsquo;int&eacute;grer une soci&eacute;t&eacute; prometteuse dans le secteur des jeux et casinos en ligne.</li>\r\n<li>De mettre votre talent et votre cr&eacute;ativit&eacute; au service d&rsquo;une plateforme de jeux &agrave; la pointe de la technologie.</li>\r\n<li>De vivre une exp&eacute;rience enrichissante et valorisante.</li>\r\n<li>Un package &eacute;volutif adapt&eacute; &agrave; votre talent</li>\r\n</ul>', 4, '2011-12-12 09:45:46', '2011-12-12 10:01:19', 272, 1, '2011-12-12 09:59:02', NULL, 1),
(61, 'Bureau347 on stage', '<p>Thanks to the WebShaker for featuring us <a href="posts/27-bureau347-on-stage-">on stage</a>.</p>', 1, '2011-12-12 09:51:33', '2011-12-12 09:56:46', 71, 0, '2011-12-12 09:56:46', NULL, 1),
(62, 'Duvel Studio design contest.', '<p><img src="http://www.walkingmen.com/documents/duvel-studio.jpg" alt="" width="100%" /></p>\r\n<p>Only a few more days to create and register your own Duvel glass design, showcase it in 3D, grab as many votes and maybe get your work added to the very cool Duvel Collection!</p>\r\n<p>Hundreds of designers from 4 European countries&nbsp;submitted&nbsp;their glass proposal, which got processed in 3D and added to the contest in real time - add word of mouth and shameful self-promotion on Facebook by the aspiring designers, and you get a great creative campaign to create awareness for the Duvel Collection and its gallery.</p>\r\n<p>Design, concept &amp; dev work by Walking Men, for Duvel Moortgat.</p>\r\n<p><a href="http://studio.duvelcollection.com/">http://studio.duvelcollection.com/</a></p>', 1, '2011-12-12 10:07:46', '2011-12-12 10:24:19', 276, 0, '2011-12-12 10:24:19', NULL, 1),
(63, 'Agency Senior Project Manager NL-EN', '<div id="pm" class="job-desc">\r\n<h3>Agency Senior Project Manager NL-EN</h3>\r\n<p><strong>REQUIRED</strong> - Please only apply if you have 4+ years  experience as a project manager in an interactive agency or similar  client services environment.</p>\r\n<p>Senior Project Manager</p>\r\n<p>Our leading boutique agency provides digital strategy and  execution to respected companies and fast-growth organizations, is  looking to grow its elite team. Sectionmedia has deep expertise in  creating websites, ecommerce and community-driven experiences and is  known for its innovative primary research activities designed to provide  deep insights into the hearts and minds of the target end-user.</p>\r\n<p>In its just 3 years of operating history, the company has already  launched numerous large-scale online initiatives and is currently in the  process of creating ambitious new digital offerings for major  world-class brands. We are looking for exceptional talent to help us in  our quest to be the highest quality interactive agency in the country.</p>\r\n<p>We are currently seeking Sr. Project Managers to join our Brussels  office, team of professionals. This individual serves as an expert in  all phases of an interactive project lifecycle, is our clients'' primary  point of contact and is responsible for managing internal team workflow  and task assignments.</p>\r\n<p><strong>Position Responsibilities:</strong></p>\r\n<ul class="job-list">\r\n<li>Demonstrate expertise in all phases of an interactive project lifecycle</li>\r\n<li>Able to quickly gain an understanding of our clients</li>\r\n<li>Industries, business and project objectives</li>\r\n<li>Interface daily with clients as the primary point of contact</li>\r\n<li>Analyze and prioritize project activities and client needs, while establishing realistic deadlines</li>\r\n<li>Achieve consensus among diverse and dissenting viewpoints, while  effectively translating ideas into prioritized and actionable steps</li>\r\n<li>Create, maintain and present project plans and other relevant project documentation</li>\r\n<li>Create project status reports, client friendly schedule, milestone and deliverable progress materials for our clients</li>\r\n<li>Manage internal team workflow and task assignments</li>\r\n<li>Able to collaborate with and lead teams of information  architects, graphic designers, copy writers, HTML developers, Flash  developers, and programmers to problem solve and execute project  challenges while delivering high quality on time and on budget</li>\r\n<li>Have a "can-do" attitude that fosters a positive productive working environment, especially in stressful or pressured situations</li>\r\n<li>Be flexible, organized, open to feedback with excellent follow-through skills</li>\r\n<li>Thrive in an entrepreneurial environment and provide hands-on troubleshooting and best available solutions</li>\r\n<li>Balance a sense of urgency with calm and confident demeanor</li>\r\n<li>Work effectively as part of a team and independently to meet agreed-upon deadlines</li>\r\n<li class="last">Travel to client locations for meetings as needed</li>\r\n</ul>\r\n<p>The position offers excellent rewards related to performance.</p>\r\n</div>', 4, '2011-12-12 10:43:33', '2011-12-12 10:54:02', 274, 1, '2011-12-12 10:54:02', NULL, 1),
