(75, 'Lisa Mille Webshop', '<p>A webshop with a nice and clean design; a handy search engine that helps you find the perfect gift; a reminder tool that helps you remember your friends and family''s birthdays; and a nifty little way to invite friends to buy a gift for a common friend.</p>', 2, '2011-12-14 16:26:20', '2011-12-14 16:29:15', 323, 1, '2011-12-14 16:29:15', NULL, 1),
(78, 'Belighted bought Pepper & Koffee', '<p><span id="result_box" lang="en"><span class="hps">From </span><span class="hps">January,1</span> <span class="hps">the team</span> <span class="hps">will be 13</span> <span class="hps">people, based in Louvain-La-Neuve.<br /></span></span><span id="result_box" lang="en"> <span class="hps">the name</span> <strong><span class="hps">Pepper &amp;</span> <span class="hps">Koffee</span></strong> <span class="hps">will continue</span> <span class="hps">with a&nbsp;</span><span class="hps">extra touch</span><span>:</span> <span class="hps">Pepper &amp;</span> <span class="hps">Koffee</span> <em><span class="hps">by</span> <span class="hps">Belighted</span></em><span>.<br />More informations <a href="http://emails.pepperkoffee.com/t/ViewEmail/y/B669F92C2159DB91/69C0EFB8EDBD23326B5BE456C00C2519">here</a></span></span></p>\r\n<p><span id="result_box" class="short_text" lang="en"><span class="hps">Feel free to</span> <span class="hps">send news about your company in the shaker !</span><span class="hps">&nbsp;</span><span class="hps">&nbsp;</span></span></p>', 1, '2011-12-15 15:23:57', '2011-12-15 15:44:23', 3, 1, '2011-12-15 15:23:57', NULL, 1),
(79, 'Mobilroom.be', '<p>A brand new website in the Azimut Event''s websites collection is born.<br />Mobilroom is a VIP service of airstream renting. You can now rent an authentic old airstream for your events and make sensations.<br /><br />On the technical side : a simple single paged website providing everything you need to know about the service.<br /><br />Strength &amp; Honour</p>', 2, '2011-12-16 09:49:08', '2011-12-16 09:52:02', 50, 1, '2011-12-16 09:52:02', NULL, 1),
(80, 'Web developer', '<p>We are looking for a passionate web developer, someone dynamic and weblover, always learning and always connected.</p>\r\n<h3><br />General role description</h3>\r\n<p>Creates web solutions and websites to specifications. Is responsible for analysis, development and quality assurance.</p>\r\n<h3><br />Tasks:</h3>\r\n<ul>\r\n<li>Design, build, or maintain web sites, using authoring or scripting languages, content creation tools, management tools, and digital media.</li>\r\n<li>Perform or direct web site updates.</li>\r\n<li>Write, design, or edit web page content, or direct others producing content.</li>\r\n<li>Confer with management or development teams to prioritize needs, resolve conflicts, develop content criteria, or choose solutions.</li>\r\n<li>Back up files from web sites to local directories for instant recovery in case of problems.</li>\r\n<li>Identify problems uncovered by testing or customer feedback, and correct problems or refer problems to appropriate personnel for correction.</li>\r\n<li>Evaluate code to ensure that it is valid, is properly structured, meets industry standards and is compatible with browsers, devices, or operating systems.</li>\r\n<li>Maintain understanding of current web technologies or programming practices through continuing education, reading, or participation in professional conferences, workshops, or groups.</li>\r\n<li>Analyze user needs to determine technical requirements.</li>\r\n<li>Develop or validate test routines and schedules to ensure that test cases mimic external interfaces and address all browser and device types.<strong>&nbsp;</strong></li>\r\n</ul>\r\n<h3><br />Skills and knowledge</h3>\r\n<h3>General</h3>\r\n<h4><strong>Programming in web frameworks</strong></h4>\r\n<p>Has knowledge and experience in working with MVC architecture.<br />An advantage: has knowledge and experience in working with PHP, Ruby, .NET and or Python languages.&nbsp;</p>\r\n<p><strong>Open Source content management systems</strong></p>\r\n<p>Has knowledge and experience in working with Open&nbsp;&nbsp;Source content management systems (Drupal, Wordpress, Joomla, etc&hellip;)</p>\r\n<p><strong>Database systems</strong></p>\r\n<p>Has knowledge and experience in working with database systems like MySQL, MSSQL, PostgreSQL, MongoDB, etc&hellip;</p>\r\n<p><strong>Graphical software</strong></p>\r\n<p>An advantage: has knowledge and experience in working with graphical software like GIMP, Photoshop, Illustrator, Fireworks, Aftereffects, etc&hellip;</p>\r\n<p><strong>Other</strong></p>\r\n<p>An advantage: Project management skills</p>\r\n<h3><br />Language</h3>\r\n<p>French: advanced written and spoken<br />English: advanced written and spoken&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3><strong><br />About us</strong></h3>\r\n<p>2houses is a high-potential startup founded in May 2011 by Gill Ruidant.</p>\r\n<p>We&rsquo;re a co-parenting facilitator. We help separated parents to communicate and get organized about their children. Have a look at our website&nbsp;<a href="http://www.2houses.com/" target="_blank">www.2houses.com</a>.</p>', 4, '2011-12-18 10:06:13', '2011-12-19 08:51:51', 348, 1, '2011-12-19 08:16:37', NULL, 1),
(82, 'Webshop Manager (E-commerce sector)', '<div>\r\n<div class="job_description">\r\n<div class="content">Onze klant is een zeer belangrijke e-commerce speler die nog in volle expansie is. Ze zijn gelegen in de driehoek Antwerpen, Brussel, Gent en gemakkelijk bereikbaar vanuit deze 3 steden. Om hun ambities waar te maken, namelijk 50% van het zakencijfer via Internet te realiseren, zijn ze op zoek naar een Webshop manager</div>\r\n</div>\r\n</div>\r\n<ul>\r\n<li>De internet activiteit ontwikkelen: managen van de website als verkoopskanaal, kwalitatieve traffic naar de site verzorgen, online verkoop vereenvoudigen.</li>\r\n<li>Meehelpen in de opbouw van het multi-channel campagneplan in samenwerking met de communicatie afdeling en het CRM team.</li>\r\n<li>Optimaliseren van het publiciteitsbudget online: acties, promoties, wedstrijden evenals het meten van de ROI.</li>\r\n<li>Aansturen van het e-commerce team bestaande uit een webmaster, traffic manager en een e-marketeer.</li>\r\n<li>Het managen en delegeren van projecten, de goede verloop en uitwerking ervan controleren</li>\r\n</ul>', 4, '2011-12-19 15:22:38', '2011-12-19 15:24:24', 354, 1, '2011-12-19 15:24:24', NULL, 1),
(84, 'Darcis E-boutique', '<p>Thanks to Epic, the famous chocolate maker Darcis has his very own E-shop : eboutique.darcis.com ( by the way : we love gifts )</p>', 2, '2011-12-20 16:25:58', '2011-12-20 17:11:18', 50, 1, '2011-12-20 16:34:21', NULL, 1),
(86, 'Dveloppeur Magento Senior', '<p><strong>Vos responsabilit&eacute;s :</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Vous &ecirc;tre responsable, avec un Project Manager, de la mise-en-&oelig;uvre de projets e-commerce simples et complexes.<br />-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Vous saisissez les attentes du client et les r&eacute;aliser techniquement.</p>\r\n<p><strong>Votre profil: </strong></p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Vous &ecirc;tes capable de g&eacute;rer votre temps et de respecter des deadlines<br />-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Vous avez une bonne communication g&eacute;n&eacute;rale et &ecirc;tes orient&eacute; clients<br />-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Vous &ecirc;tre rigoureux, organis&eacute; et autonome<br />-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Vous faites preuve d''un fort esprit d''&eacute;quipe et d''une excellente capacit&eacute; d''analyse</p>\r\n<p><strong>&nbsp;Nous vous offrons:</strong></p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Un cadre de travail dynamique,<br />-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; La possibilit&eacute; de travailler en &eacute;quipe et de vous challenger sur des projets passionnants pour des clients nationaux et internationaux<br />-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Un package salarial &agrave; la hauteur de vos comp&eacute;tences.</p>', 4, '2011-12-21 08:44:08', '2011-12-21 09:54:55', 272, 1, '2011-12-21 09:50:51', NULL, 1);
