(87, 'Account Manager', '<p><strong>Vos responsabilit&eacute;s :</strong></p>\r\n<p><strong>-&nbsp;</strong>Vous vous occupez de la prospection et de la vente de nos services dans la Province de Namur et du Hainaut et assurez le reporting aupr&egrave;s du bureau li&eacute;geois.<br />- Vous cr&eacute;ez votre portefeuille clients et atteignez des targets financiers mensuels,<br />- Vous vous chargez de l''analyse des besoins de vos clients, de la r&eacute;daction des offres qui en d&eacute;coulent et&nbsp;de la phase de n&eacute;gociation,<br />- Apr&egrave;s une formation interne, vous conseillez vos clients quant&nbsp;&agrave; leurs&nbsp;choix strat&eacute;giques et marketing,<br />- Vous assurez le bon d&eacute;roulement de projets nationaux et internationaux en travaillant c&ocirc;te &agrave; c&ocirc;te avec&nbsp;l''&eacute;quipe technique.</p>\r\n<p><strong>Nous vous proposons :</strong></p>\r\n<p>- De rejoindre une &eacute;quipe jeune et dynamique dans une entreprise en pleine croissance,<br />- De vous former dans nos domaines de pr&eacute;dilection, &agrave; savoir l''e-business et l''e-marketing,<br />- De travailler en collaboration avec notre &eacute;quipe et nos partenaires (agences de publicit&eacute;, soci&eacute;t&eacute;s&nbsp;informatiques, etc.) sur des projets tant nationaux qu&rsquo;internationaux toujours diff&eacute;rents, pour pr&egrave;s de 1000 clients.</p>', 4, '2011-12-21 08:56:47', '2011-12-21 10:47:41', 272, 1, '2011-12-21 10:46:30', NULL, 1),
(89, 'Refonte du site de l''Athne royal de Rochefort - Jemelle', '<p>Principal outil de communication de l''&eacute;cole, le site Internet devait &ecirc;tre beaucoup plus simple &agrave; g&eacute;rer, notamment au niveau de l''agenda et des galeries de photos. Un travail a &eacute;galement &eacute;t&eacute; fait pour redessiner le logo, professionaliser l''h&eacute;bergement et am&eacute;liorer le r&eacute;f&eacute;rencement naturel.</p>', 2, '2011-12-22 08:45:00', '2011-12-22 09:08:47', 160, 1, '2011-12-22 09:08:47', NULL, 1),
(91, 'Auctelia is hiring 2 Developers', '<p>Auctelia is a Belgian Start-Up located in Court-Saint-Etienne aiming to help&nbsp;companies better manage their industrial machineries &amp; equipment. The first tool&nbsp;developed is an online B2B auction platform. The current team is composed of 6&nbsp;people and is backed by high-grade Belgian investors.&nbsp;Currently in a fast growing phase, the company needs to scale up its team to face with&nbsp;increasingly innovative works notably the development of innovative tools in the B2B&nbsp;asset management and sale process. Therefore, the company is looking to hire 2 web&nbsp;developers to work in close relationship with the CTO.</p>\r\n<p>&nbsp;</p>\r\n<p><span>The objective is to implement a web application to provide users detailed business&nbsp;</span><span>information about second hand machines &amp; equipment using latest web technologies.</span><br /><span>&nbsp;</span></p>\r\n<p><span>Roles and Responsibilities:</span><br /><span>- Understand business requirements</span><br /><span>- Develop new innovative platform</span><br /><span>- Develop qualitative web-solutions</span><br /><span>- Develop according to TDD</span><br /><span>- Document the delivered code/solution</span><br /><span>- Perform development testing</span><br /><span>- Implement and maintain high performance web applications</span></p>', 4, '2011-12-22 12:22:01', '2011-12-22 12:23:11', 76, 1, '2011-12-22 12:23:11', NULL, 1),
(92, 'Stage pour un dveloppeur chez ClickYourCar', '<p class="p1"><span class="s1">ClickYourCar est une start-up web situ&eacute;e &agrave; Bruxelles. Elle propose aux particuliers de trouver pour eux la voiture neuve qu&rsquo;ils d&eacute;sirent au meilleur prix. Le particulier se rend sur clickyourcar.be, configure la voiture qu&rsquo;il d&eacute;sire acheter et ClickYourCar recherche la concession qui lui proposera le meilleur prix.</span>&nbsp;</p>\r\n<div>\r\n<p>Le stagiaire participera au d&eacute;veloppement technique de la plate-forme ClickYourCar.be. Sur base d&rsquo;une analyse fonctionnelle d&eacute;taill&eacute;e, il impl&eacute;mentera les nouvelles fonctionnalit&eacute;s en suivant la m&eacute;thode SCRUM. Le projet est r&eacute;alis&eacute; en Ruby avec le framework Rails.</p>\r\n<p>Le stagiaire sera &eacute;paul&eacute; par un d&eacute;veloppeur senior qui le guidera au travers de la base de code existante et lui enseignera les technologies et m&eacute;thodologies utilis&eacute;es.</p>\r\n</div>', 4, '2011-12-22 14:30:10', '2011-12-22 14:33:28', 28, 1, '2011-12-22 14:33:28', NULL, 1),
(93, 'Newsletters DH', '<p>Rebuild of newsletter DH.be&nbsp;</p>', 2, '2011-12-23 11:08:55', '2011-12-28 14:30:19', 409, 1, '2011-12-23 11:10:11', NULL, 1),
(94, 'La Pomme de Loveley', '<p>Interactive website to promote La Pomme''s summer collection.</p>', 2, '2011-12-23 11:27:05', '2011-12-23 11:41:43', 105, 1, '2011-12-23 11:41:43', NULL, 1),
(95, 'Happy2012', '<p>We wish you all the best !</p>', 2, '2011-12-23 14:37:01', '2011-12-23 14:43:03', 132, 1, '2011-12-23 14:43:03', NULL, 1),
(96, 'Voeux SWDE', '<p>"Vos f&ecirc;tes seraient-elles aussi r&eacute;ussies sans eau ? "</p>\r\n<p>Cette carte vous propose tout simplement de le d&eacute;couvrir &agrave; travers quelques Illustrations (&agrave; l''aide de votre doigt/souris &eacute;videment ).</p>\r\n<p>d&eacute;veloppement Multimedia: boblemarin</p>\r\n<p>&nbsp;</p>', 2, '2011-12-23 17:24:24', '2011-12-23 18:16:10', 414, 1, '2011-12-23 18:16:10', NULL, 1),
(98, 'Basile Boutique', '<p>A brand new website for Basile Boutique in Marche-en-Famenne.</p>\r\n<p>Wordpress, jQuery, Supersized, Isotope.</p>', 2, '2011-12-25 23:43:51', '2011-12-26 22:36:02', 36, 1, '2011-12-26 08:15:50', NULL, 1),
(99, 'CMS and design upgrade for Pilates by Ge', '<p><span class="quot-big-texte">Le site, cr&eacute;&eacute; par Amaranthe en 2009, apporte &agrave; au studio Pilates by Ge pr&egrave;s de 40 % de sa client&egrave;le, principalement gr&acirc;ce au r&eacute;f&eacute;rencement.</span></p>\r\n<p>La refonte et la mise en CMS permettent d&eacute;sormais au client de g&eacute;rer ses contenus, sans p&eacute;naliser le r&eacute;f&eacute;rencement des pages existantes.</p>', 2, '2011-12-26 18:08:52', '2011-12-26 20:59:59', 160, 1, '2011-12-26 20:20:22', NULL, 1),
(100, 'Formation au rfrencement naturel', '<p>D&eacute;couvrez la m&eacute;thode de r&eacute;f&eacute;rencement unique d''Amaranthe, effectuez un audit de votre site, listez les actions concr&egrave;tes et mettez-les en place d&egrave;s le lendemain.</p>\r\n<p><span>Au-del&agrave; d''aspects techniques (algorithme des moteurs, optimisation du site,...), cette journ&eacute;e propose un nouveau regard sur votre strat&eacute;gie, votre cible, la fa&ccedil;on de pr&eacute;senter vos activit&eacute;s, la fa&ccedil;on de communiquer sur votre le site et au dehors.&nbsp;</span></p>\r\n<ul>\r\n<li>Formation en petit groupe (8 personnes max.)</li>\r\n<li>PAF : 200 EUR + TVA</li>\r\n<li>Horaire : 9h30 &agrave; 17h30</li>\r\n</ul>\r\n<p>En bref,&nbsp;une journ&eacute;e pour d&eacute;neiger votre r&eacute;f&eacute;rencement !</p>', 3, '2011-12-26 18:22:11', '2011-12-26 20:20:23', 160, 1, '2011-12-26 20:20:23', NULL, 1),
(102, 'Analyste-programmeur ASP.net c#', '<p><span id="ctl00_mainContent_ctl00_ctl00_lblDescription">Synchrone vous  propose d&rsquo;int&eacute;grer son &eacute;quipe pour participer &agrave; son d&eacute;veloppement, en  qualit&eacute; d&rsquo;Analyste-programmeur autour des technologies .NET. <br /> <br /> Structure &agrave; taille humaine sp&eacute;cialis&eacute;e dans la mise en &oelig;uvre de projets  web innovants, nous offrons de v&eacute;ritables perspectives d''&eacute;volution &agrave;  tous les profils motiv&eacute;s, impliqu&eacute;s et conscients des objectifs fix&eacute;s. <br /> <br /> Vous intervenez dans le cadre de projets pour nos clients. Vous  collaborez &agrave; la mise en &oelig;uvre de solutions techniques, et r&eacute;digez la  documentation correspondante.<br /> </span></p>', 4, '2011-12-30 08:02:11', '2012-04-18 09:32:29', 429, 1, '2011-12-30 10:12:54', NULL, 0),
(103, 'Cration du site Internet du Crowne Plaza', '<div class="entry-content">Dominant  la place Saint-Lambert, le c&oelig;ur historique de Li&egrave;ge et les anciens bras  de Meuse transform&eacute;s en boulevards, face aux coteaux de la citadelle et  au pied du mont Saint-Martin, pr&eacute;serv&eacute;, la colline du Publ&eacute;mont, la  &ldquo;montagne publique&rdquo; qui tire son nom d&rsquo;une abbaye b&eacute;n&eacute;dictine construite  l&agrave;-bas au XIe si&egrave;cle afin de permettre &agrave; la population d&rsquo;&eacute;chapper aux  crues de la Meuse. <br /><span id="ctl00_mainContent_ctl00_ctl00_lblDescription">\r\n<p>Situ&eacute;e &agrave; l&rsquo;ouest de la ville, cette colline pr&eacute;sente encore aujourd&rsquo;hui  de tr&egrave;s beaux ensembles architecturaux, dont les deux plus remarquables  sont incontestablement situ&eacute;s au d&eacute;but du Publ&eacute;mont : les h&ocirc;tels  particuliers, concomitants, de S&eacute;lys Longchamps et des Comtes de M&eacute;an. <br /> <br /> Trop longtemps laiss&eacute;s &agrave; l&rsquo;&eacute;tat d&rsquo;abandon, ils se sont aujourd&rsquo;hui mu&eacute;s  en un complexe h&ocirc;telier unique dans toute la r&eacute;gion : le Crowne Plaza  Li&egrave;ge &ldquo;Les Comtes de M&eacute;an&rdquo; *****. Une r&eacute;ussite architecturale et  &eacute;conomique totale, fruit de plus de cinq ans de montage de projet et de  chantiers concrets d&rsquo;une r&eacute;novation unanimement salu&eacute;e, tant en mati&egrave;re  de pr&eacute;servation du patrimoine que de qualit&eacute; des travaux entrepris en  vue de sa r&eacute;habilitation.</p>\r\n</span></div>', 2, '2011-12-30 08:06:55', '2011-12-30 10:14:29', 429, 1, '2011-12-30 10:14:29', NULL, 1),
(104, 'Villa Kakelbont Webshop', '<p>A webshop for ecological and&nbsp;ethically sound products for babies and kids. The website is easy to navigate, easy to use, and for all products it is clearly mentioned what materials are used.&nbsp;All design, illustration and development done in-house by Marlon.</p>', 2, '2011-12-30 08:08:13', '2011-12-30 10:17:32', 323, 1, '2011-12-30 10:17:32', NULL, 1),
(105, 'Cration du site Internet pour La centrale Amricaine', '<p>La Centrale Am&eacute;ricaine est actif dans la vente de pneus, de kits pneus et jantes, de kits de suspension pour concessionnaires, garages et particuliers et plus sp&eacute;cifiquement les jantes en alliage l&eacute;ger.<br />La Centrale Am&eacute;ricaine est une des plus grandes stations de Bruxelles et une des trois plus grandes de Belgique. Ils sont &eacute;galement fabricant et distributeur des jantes WMS et RSK.<br /><br />Cette version du site n''est qu''une premi&egrave;re phase avant l''arriv&eacute;e du site e-commerce et du configurateur de jantes.<br /><br /></p>', 2, '2011-12-30 08:31:06', '2011-12-30 14:31:14', 429, 1, '2011-12-30 14:31:14', NULL, 1),
(106, 'Cration du site Internet de The Juicy Group', '<p>Cr&eacute;ation du site Internet de la soci&eacute;t&eacute; The Juicy Group.</p>\r\n<p>The Juicy Group est le leader belge dans la production de jus de fruits, smoothies et salades de fruits, ultra-frais.</p>', 2, '2011-12-30 14:27:09', '2011-12-30 15:21:03', 429, 1, '2011-12-30 15:21:03', NULL, 1),
(107, 'Kapaza is looking for a great PHP/C Developer', '<p>Kapaza! is the largest classified ads site in Belgium where about 25,000 new daily ads are placed mainly by individuals, but recently also increasingly by businesses.&nbsp;</p>\r\n<p>The offer on <a href="http://www.kapaza.be/">www.kapaza.be</a> &nbsp;is very broad, with some major categories such as cars, other vehicles, animals and accessories, estate, garden equipment, clothing, baby equipment and toys, computers and electronics... Besides ads, Kapaza! is increasingly emerging as online advertising for professional advertisers, where display and other forms of advertising are hosted.</p>\r\n<p>The Kapza! &nbsp;platform undergoes continuous change partly because of the increased functionality of the site, by applying new techniques and code to improve performance and the continued growth in visitors and traffic.</p>\r\n<p>Therefore, we are looking for an enthusiastic developer with experience in PHP, C and all Web technologies.</p>\r\n<p><strong>Key responsibilities</strong></p>\r\n<ul>\r\n<li>Implementing front end modules integrated on existing backend systems</li>\r\n<li>Designing, coding and testing backend modules that meet design specifications</li>\r\n<li>Creating, executing and documenting the tests necessary to ensure that an application meets performance requirements (technical, functional and user interface)</li>\r\n<li>Participating in identifying configuration changes to applications so that they meet business process requirements</li>\r\n<li>Co-ordination &amp; training together with co-workers from all over Europe</li>\r\n</ul>\r\n<p><strong>Personality</strong></p>\r\n<ul>\r\n<li>Successful candidates should be dynamic, hard working, ambitious and good team players.</li>\r\n<li>Good communication skills in English are essential, Dutch and/or French highly desirable.</li>\r\n<li>Flexibility in working with virtual teams is important.</li>\r\n<li>Willing to travel abroad for work</li>\r\n</ul>\r\n<ul>\r\n</ul>', 4, '2012-01-03 08:37:36', '2012-01-03 09:09:57', 431, 1, '2012-01-03 08:40:07', NULL, 1),
(108, 'jQuery lover for Web Apps', '<ul>\r\n<li>Do you like baking web applications?</li>\r\n<li>Do you know what UX means? (tip: &uuml;ber-xylophone is not an answer)</li>\r\n<li>Do you love (I mean it) jQuery and the cloud?</li>\r\n</ul>\r\n<p>So ... <a href="http://www.nectil.com/eng/get-in-touch%21/"><strong>contact us!</strong></a> We are looking for <strong>Web Application Developers</strong>&hellip; and maybe more.</p>\r\n<p>Nectil is a restartup based in Brussels. Our core-business is to build custom business applications... for more info, check <a href="http://www.nectil.com/">http://www.nectil.com/</a><br /><br />We are also the Proud Editors of <strong>Officity, a web application platform</strong>... for more info, check <a href="http://www.officity.com/">http://www.officity.com</a> or <strong>download Kaiten</strong> <a href="http://www.officity.com/kaiten">http://www.officity.com/kaiten</a> or try our demo on <a href="http://kaitenbrowser.com/">http://kaitenbrowser.com</a>. <strong>Go ahead, it''s free!</strong></p>', 4, '2012-01-04 17:40:41', '2012-01-04 19:43:27', 413, 1, '2012-01-04 19:43:27', NULL, 1),
(109, 'Comingsoon online shop', '<p><span id="ctl00_mainContent_ctl00_ctl00_customersNews_listNews_ctl00_lblSummary" class="description">Ce magasin d''un tout nouveau genre &agrave; ouvert &agrave; li&eacute;ge il y a 2 ans, il propose aux adeptes de la street culture et &eacute;galement aux autres, d''entrer dans le monde de l''art, du design, du style urbain, mais aussi du street wear.</span><br /><br /><a href="http://www.synchrone.be" target="_blank">Cr&eacute;ation du site e-commerce par Synchrone</a></p>', 2, '2012-01-04 21:16:58', '2012-01-05 07:59:09', 430, 1, '2012-01-05 07:59:09', NULL, 1),
(111, 'Cration du site e-commerce Cafs Delahaut', '<p><span>L''entreprise familiale Caf&eacute;s Delahaut est sp&eacute;cialis&eacute;e dans la torr&eacute;faction de caf&eacute;, l&rsquo;importation de th&eacute;s artisanaux et les produits d&rsquo;&eacute;picerie fine.</span></p>', 2, '2012-01-06 10:00:13', '2012-01-06 10:03:07', 430, 1, '2012-01-06 10:03:07', NULL, 1),
(112, '"The Drumlet"', '<p>The Drumlet is the lastest experiment from Epic.net mixing Javascript,  Canvas, Web Audio and Social sharing to bring you the very first Drum  Machine using these technologies.</p>', 2, '2012-01-09 08:11:25', '2012-01-09 08:24:29', 50, 1, '2012-01-09 08:24:29', NULL, 1),
(113, 'The dogs wish you a happy new year!', '<p>See all the Dogstudio''s team wishes for 2012!</p>', 2, '2012-01-09 10:42:40', '2012-01-09 10:53:47', 97, 1, '2012-01-09 10:53:47', NULL, 1),
(114, 'Campagne Iles de Paix', '<p>Globule Bleu has created the new campaign of the Non-Profit Organisation ''Iles de Paix''.<br /><br />This new tone of voice highlights the famous "module" and is focussed on the sales price, the dates of sale, and a sympathetic human touch. <br /><br />The project is live during one week (10-14th january 2012) on the main french speaking tv&nbsp; channels, radios, newspapers and news websites.&nbsp; <br /><br />After the recent "Value Your Friends" Projects, this advertising is the second realisation made by Globule Bleu&nbsp; for "Iles de Paix". <br /><br />If you read this post at time, don''t forget to buy some modules ;)</p>', 2, '2012-01-11 11:53:21', '2012-01-11 11:53:21', 251, 1, '2012-01-11 11:53:21', NULL, 1),
(115, 'Stratecare Partners', '<p><span id="result_box" lang="en"><span class="hps">Web site created</span> <span class="hps">with</span> the CMS <span class="hps">Joomla</span> <span class="hps">for a</span> <span class="hps">company</span> <span class="hps">who is active in executive</span> head hunting <span class="hps">in</span> <span class="hps">the pharmaceutical industry</span><span>.</span></span></p>', 2, '2012-01-11 13:07:57', '2012-01-11 13:14:59', 316, 1, '2012-01-11 13:07:57', '2012-01-11 12:28:54', 1),
(118, 'Advanced Coldfusion Developer', '<p>Looking for a new challenge as developer? 9000 studios has got the interesting, challenging job that you''ve been waiting for!</p>\r\n<p>We are looking for an experienced coldfusion developer for a company in the Brussels area.&nbsp;We offer a nice, challenging and dynamic job in the exciting gold sector. In this sector, the market is subject to constant change, and you can be sure that no two days will be the same. It won''t take long before you get sucked into the pleasant flow this company thrives in.</p>\r\n<p>As coldfusion developer, you will be responsible for the further programming of the company extranet, so if you already have experience working with somebody else''s code, this is definitely a plus. You''ll be dropped into a tight team with fun co-workers, and as the programming responsible, you''ll not limit yourself to the sheer technical work. It will be your job to to work along with your colleagues, train them and familiarize them with your work.</p>\r\n<p>Learn more about this job opening on our&nbsp;<a href="http://www.9000.be/en/2011/09/19/job-opening-at-9000/">homepage</a></p>', 4, '2012-01-11 14:36:16', '2012-01-11 15:54:55', 451, 1, '2012-01-11 14:36:16', NULL, 1),
(120, 'Danone Activia', '<p>After a pitch last year Danone granted Prophets the budget for Activia 2012.</p>\r\n<div>\r\n<p>The first project concerned the launch of the new website of Activia.be at the start of January.&nbsp;</p>\r\n<p>To show off the larger, lifestyle oriented product segment, a magazine-approach was opted for to focus on the relevant content in 4 segments: nutrition, excersise, wellbeing and beauty.&nbsp;</p>\r\n<p>Prophets was also responsible for the launchcampaign. This time they chose targetted emails, a dynamic banneringcampaign with focus on the online magazine and the 15-day program.</p>\r\n<p>On top of that Prophets will provide monthly newsletters for Activia.</p>\r\n<p>&nbsp;</p>\r\n<p><a title="Prophets website" href="http://www.prophets.be" target="_blank">www.prophets.be</a></p>\r\n<p><a title="Prophets on facebook" href="https://www.facebook.com/WeAreProphets">https://www.facebook.com/WeAreProphets</a></p>\r\n<p>&nbsp;</p>\r\n</div>', 2, '2012-01-12 10:32:34', '2012-01-12 10:32:40', 391, 1, '2012-01-12 10:32:34', NULL, 1),
(121, 'CES Live', '<p>The Samsung CES-live team (Tatiana Silva, Carl Vanormelingen,&nbsp;Beno&icirc;t Dupont and&nbsp;Xavier Vanbuggenhout) blogs between January 7th and 13th and let you discover - live - all new technologies, products and gadgets presented at the annual Last Vegas Consumer Electronic Show.</p>', 2, '2012-01-12 10:58:51', '2012-01-12 10:58:51', 448, 1, '2012-01-12 10:58:51', '2012-01-12 10:53:24', 1),
(122, 'Prophets floors the new BerryAlloc website  ', '<div id="intro">\r\n<p class="intro">Prophets designed the website for BerryAlloc, manufacturer of high-quality flooring and walldecoration</p>\r\n</div>\r\n<div id="bodytext">\r\n<p>BerryAlloc is a fusion of the BerryFloor brand and the Norwegian Alloc, both functioning inside the Beaulieu group.</p>\r\n<p>Prophets developed a competitors analysis and online marketing strategy for BerryAlloc. In cooperation with Delaware Consultingcreated a a brand new pan-european website for BerryAlloc. These are aimed at home, busines and professional clients.</p>\r\n<p>Prophets conducted the digital strategy to and interactive concept and shaped the ''interaction design''. &nbsp;</p>\r\n<p>BerryAlloc was also kickstarted on social media.</p>\r\n</div>', 2, '2012-01-13 19:42:44', '2012-01-13 19:42:44', 391, 1, '2012-01-13 19:42:44', NULL, 1),
(123, 'Finance for Startups Brussels', '<p>The purpose of this interactive kick-off is to provide you an overview of these different financial topics, so that you gain some global financial knowledge, and how it relates to your own startup situation.</p>\r\n<p>The following meetings will be on specific topics as selected by the members.</p>\r\n<p>&nbsp;</p>\r\n<p>Thanks to&nbsp;<strong>BetaGroup Coworking Brussels</strong>&nbsp;&amp;&nbsp;<strong>ICAB</strong>&nbsp;for the venue sponsoring of this event.</p>', 3, '2012-01-16 13:43:02', '2012-01-16 13:43:02', 462, 1, '2012-01-16 13:43:02', NULL, 1),
(124, 'Internet Startups & Professionals Coworking Jelly & BetaBar', '<p>Next week is the Worldwide&nbsp;<a href="http://jellyweek.tumblr.com/">Jelly Coworking Week</a>, an event to promote coworking and educate about it. We are participating&nbsp;<a title="free coworking jelly week brussels 2012" href="http://www.youtube.com/watch?v=jdBQndYXP0s">opening up our doors</a>&nbsp;next Friday (January 20th) to all of you that would liket to&nbsp;<strong>discover what coworking is all about and meet the people that are coworking</strong>. Coming to a coworking space will help you see if it is the right thing for you and what the fine difference with a business center is (<em>spoiler: the community</em>), you just need to&nbsp;<a href="http://gigaom.com/collaboration/dip-a-toe-into-coworking-with-worldwide-jellyweek/">dip a toe</a>.</p>\r\n<p>So what&rsquo;s a Jelly? It is a casual coworking event that can happen anywhere, even in a cowoking space.</p>\r\n<p>All you have to do is bring with you is your computer and charger: you will spend the day working on your stuff &nbsp;and in your breaks you can talk with the members, who are very open. Just introduce yourself and be polite (but not formal.) To make it even easier for you to meet our members, we will be running an&nbsp;<strong>open bar</strong>&nbsp;at the end of the day (at around 17h30.)</p>', 3, '2012-01-16 14:17:17', '2012-01-16 14:17:17', 462, 1, '2012-01-16 14:17:17', NULL, 1),
(126, 'Lean Startup Circle Brussels', '<p>It''s time for our next meetup.&nbsp;</p>\r\n<p>Based on&nbsp;<a href="http://www.meetup.com/lean-brussels/messages/boards/thread/19062992">the discussion</a>&nbsp;we had, the topic will &nbsp;focus on customer interviews.&nbsp;Who to contact? How to contact? What to ask (interview script)? Different rounds? How to process results? When to stop? Interviews vs. surveys.&nbsp;</p>\r\n<p>Suggested format (see&nbsp;<a href="http://www.meetup.com/lean-brussels/messages/boards/thread/19063032">this discussion</a>):</p>\r\n<p>1. 45m Plenary&nbsp;</p>\r\n<p>* 20m Curated overview of the topic&nbsp;<br />* 20-30m 2 startups share their story/difficulties in front of the whole group (5m talk + 15m discussion)<br /><br />2. 45m Working groups&nbsp;<br />* We split into tables and discuss.</p>\r\n<p><em>(Each startup speaker takes one table, speaker takes another, and other volunteers and I take other tables)&nbsp;</em><br /><br />3. 15m Short wrap-up</p>\r\n<p>Retrospect on the event and the lessons learned (e.g. each table gets 2-3 minutes)</p>', 3, '2012-01-16 15:29:47', '2012-01-16 15:29:47', 462, 1, '2012-01-16 15:29:47', NULL, 1),
(127, 'Clickyourcar.be contest: win 2 x 1 year of free gas !', '<div>\r\n<p><br />We just finished the&nbsp;<a href="http://www.clickyourcar.be/fr">clickyourcar.be</a>&nbsp;contest where you can win 2 x 1 year of free gas for you and one of your friends.</p>\r\n<p>We also created a beautiful <a href="http://checkthis.com/6i7m/">landing page on checkthis</a>. Check it out.</p>\r\n<p>Good Luck.</p>\r\n<p>&nbsp;</p>\r\n</div>', 2, '2012-01-17 14:19:00', '2012-01-17 14:39:12', 51, 1, '2012-01-17 14:19:00', NULL, 1),
(128, 'Zet je lover op de cover', '<h3 style="font-size: 26.325px; line-height: 33.75px;">P-magazine</h3>\r\n<h3 style="font-size: 26.325px; line-height: 33.75px;">Put your lover on the cover</h3>\r\n<p class="hoofdtitel" style="font-size: 22.5px; line-height: 31.5px;">Create your own P-cover for just &euro;9,90</p>\r\n<p style="font-size: 22.5px; line-height: 31.5px;">From now until Valentine''s Day, you don''t have to be a model to shine on the frontpage of P-magazine. Place a beautiful, romantic, funny or sexy picture of yourself, your loved one or the&nbsp;two of you on the cover, and give Veronique De Cock, Ga&euml;lle Garcia Diaz and Astrid Bryan a run for their money!</p>\r\n<p class="subtitel" style="font-size: 22.5px; line-height: 31.5px;">How does it work?</p>\r\n<p style="font-size: 22.5px; line-height: 31.5px;">Surf to&nbsp;<a style="font-size: 22.5px; line-height: 31.5px;" href="http://www.zetjeloveropdecover.be/" target="_blank">zetjeloveropdecover</a>,&nbsp;upload a photo and select an appropriate title and quote for the cover story. Once you have selected your payment and the payment has arrived, your order will be automatically sent to the printer. Then, a P-magazine is printed with your cover. This is then sent by mail, and will appear in your letter bow just a few days after your order has reached us! This will be the latest official edition of P-magazine, but with your own exclusive front page.</p>\r\n<p class="redtitle" style="font-size: 22.5px; line-height: 31.5px;">Put your lover on the cover by 9000 studios&nbsp;</p>\r\n<p style="font-size: 22.5px; line-height: 31.5px;">9000 studios is again responsible for this promotion in cooperation with P-magazine.</p>\r\n<p style="font-size: 22.5px; line-height: 31.5px;">First of all, we created the design of a logo with a matching stylistic identity.</p>\r\n<p style="font-size: 22.5px; line-height: 31.5px;">This design was then converted into a user friendly website where visitors can create their own P-magazine cover through a series of easy steps. And since these things are not always even straightforward for everybody, a useful help file with step by step explanation was added. This way, nobody should have problems creating a personal cover.</p>\r\n<p style="font-size: 22.5px; line-height: 31.5px;">This action invariably receives thousands of entries, and therefore also requires the use of our servers to uphold the domain, hosting and processing of the entries. Thus, we ensure that your entry is in a correct way in your mailbox appears.</p>\r\n<p style="font-size: 22.5px; line-height: 31.5px;">As a&nbsp;<a style="font-size: 22.5px; line-height: 31.5px;" href="http://www.9000.be/nl/2010/11/28/ogone/">certified solution provider for Ogone</a>&nbsp;we made use of their services for this payment application. Ogone is one of the largest and most reliable services in Europe. So we guarantee a safe and user-friendly payment experience.</p>\r\n<p style="font-size: 22.5px; line-height: 31.5px;">Since we are responsible or this campaign, you can always&nbsp;<a style="font-size: 22.5px; line-height: 31.5px;" href="http://www.9000.be/nl/contact/">contact us for support or follow-up</a>.&nbsp;</p>\r\n<p class="redtitle" style="font-size: 22.5px; line-height: 31.5px;">I like!</p>\r\n<p style="font-size: 22.5px; line-height: 31.5px;">We''re also organizing a large part of the online advertising campaign. And that means you can''t get around the<a style="font-size: 22.5px; line-height: 31.5px;" href="http://www.9000.be/en/services/social-media/">&nbsp;social media.</a></p>\r\n<p style="font-size: 22.5px; line-height: 31.5px;">For ''zet je lover op de cover'', we developed a promotional Facebook page. Here, you can find info about this campaign, upload your own personal cover or check out those of others.&nbsp;</p>\r\n<p style="font-size: 22.5px; line-height: 31.5px;">After you''ve ordered your own cover, you need to hurry to&nbsp;<a style="font-size: 22.5px; line-height: 31.5px;" href="http://www.facebook.com/zetjeloveropdecover" target="_blank">www.facebook.com/zetjeloveropdecover</a>&nbsp;and hit the like-button.</p>\r\n<p style="font-size: 22.5px; line-height: 31.5px;">Every member of our team has had his own bikinishoot by now, and all of the pictures are being uploaded as we speak. The exclusive 9000-covers are sure to be beauties!</p>', 2, '2012-01-18 10:55:20', '2012-01-18 11:00:06', 451, 1, '2012-01-18 10:55:20', NULL, 1),
