(133, 'Kapaza is looking for a junior Product Manager', '<p class="p1">Would you like the opportunity to join the product team of an exciting venture that offers a high degree of autonomy and responsibility, combined with the support, knowledge and resources of a market-leading international media group? To further develop our established Belgium operations, <a href="http://Kapaza.be/"><span class="s1">Kapaza.be</span></a>, and to help to build a market leadership position, we are now seeking a top-qualified and devoted individual for the position of&nbsp;</p>\r\n<p class="p1"><strong>Product Manager (junior)</strong></p>\r\n<p class="p1">The objective of the product team is to increase the engagement of our users together with the online presence of <a href="http://Kapaza.be/"><span class="s1">Kapaza.be</span></a> in Flanders and Wallonia. You will assist 2 product managers in their role to drive the product development and manage smooth roll-out of any product evolution.</p>\r\n<p class="p2">&nbsp;</p>\r\n<p class="p1"><strong>Key responsibilities</strong></p>\r\n<ul class="ul1">\r\n<li class="li2">Define product development and manage projects from end-to-end. (new services, new functionalities, UEX)</li>\r\n<li class="li2">Deliver product requirements to technical team in user tests and acceptance tests.</li>\r\n<li class="li2">Manage test-flow of any product evolution before going live to site.</li>\r\n<li class="li2">Closely follow KPI&rsquo;s and user engagement indicators.</li>\r\n<li class="li2">Analyze user feedback and measure specific conversions.</li>\r\n<li class="li2">Create, drive and follow user acquisition campaigns and user retention campaigns. (online mkt, email communication)</li>\r\n<li class="li2">Perform market analysis and benchmark competitors.</li>\r\n</ul>\r\n<ul class="ul1">\r\n</ul>\r\n<p class="p1"><strong>Personality</strong></p>\r\n<p class="p1">As a person you are a self-starter and a doer, driven by a will to succeed and make an impact. You are hands-on and enjoy being part of the operational side of the business. You are data-driven and have an analytical mindset. While enjoying a fast paced, entrepreneurial work setting, you are also well-organized, deadline-driven. You find it second nature to navigate in the chaos that is a fast growing, constantly changing technology-based company.</p>\r\n<p class="p1"><strong>&nbsp;</strong></p>', 4, '2012-01-20 08:00:00', '2012-01-20 08:00:00', 431, 1, '2012-01-20 08:00:00', NULL, 1),
