(142, 'Workshop "Turn your visitors into customers"', '<p>A one-day workshop, in French, with Amaranthe, specialist in "straight-to-the-point" websites.</p>\r\n<p>Programme:</p>\r\n<ul>\r\n<li>test and improve your site''s ergonomics</li>\r\n<li>understand the rules of efficient webdesign</li>\r\n<li>improve your site structure ans page lay-out</li>\r\n<li>add efficien call-to-action buttons</li>\r\n<li>write for the web.</li>\r\n</ul>\r\n<p>Who should attend?&nbsp;YOU ! Especially if...</p>\r\n<ul>\r\n<li>You create websites : graphical designer,&nbsp;webmaster, web agency, IT specialist, communication manager,...</li>\r\n<li>Your company wishes to revamp / improve its existing website.</li>\r\n</ul>\r\n<p>Cost : 200 EUR VAT&nbsp;excl.</p>', 3, '2012-01-21 11:06:38', '2012-01-21 11:06:38', 160, 1, '2012-01-21 11:06:38', '2012-01-21 08:40:43', 1),
(143, 'I''m here', '<p>Hello all,</p>\r\n<p>Pimento Studio is in WebShaker today!</p>\r\n<p>Please, visit my profile and "like" it.... if you like it ;-)</p>', 1, '2012-01-23 15:31:02', '2012-01-23 15:32:34', 481, 0, NULL, '2012-01-23 15:32:34', 1),
(144, 'Objectif Com - Le salon de la communication pour les PME', '<p><strong>&nbsp;</strong>Pour la troisi&egrave;me ann&eacute;e cons&eacute;cutive, Objectif Com, le salon de la communication pour les PME, ouvre ses portes le 7 f&eacute;vrier prochain. L&rsquo;an pass&eacute;, pas moins de 1000 visiteurs s&rsquo;&eacute;taient press&eacute;s au rendez-vous des PME qui d&eacute;sirent communiquer. La preuve que le sujet est bien au coeur des pr&eacute;occupations de nos entreprises.</p>\r\n<p><br />Les PME et les TPE repr&eacute;sentent la quasi-totalit&eacute; des entreprises wallonnes (99,5% des 70.134 soci&eacute;t&eacute;s install&eacute;es sur le territoire). Elles ont cr&eacute;&eacute; 55% des 634.883 emplois wallons (source : UWE 2009). Elles sont le moteur de la croissance wallonne. Et c&rsquo;est ne rien dire des 230.000 ind&eacute;pendants wallons&hellip; D&rsquo;o&ugrave; l&rsquo;importance d&rsquo;une bonne communication et l&rsquo;int&eacute;r&ecirc;t de cette cible souvent d&eacute;laiss&eacute;e au profit de grands groupes.<br /><br /><br /><span style="text-decoration: underline;"><strong>L&rsquo;objectif d&rsquo;un tel salon ?</strong></span><br /><br />En organisant Objectif Com, l&rsquo;UCM et InnovaTech asbl veulent permettre aux entreprises de taille moyenne, quel que soit le budget consacr&eacute;, de professionnaliser et de doper leur communication.<br />Pour y arriver, cette ann&eacute;e encore, de tr&egrave;s nombreux professionnels seront pr&eacute;sents &agrave; Genval pour permettre aux entrepreneurs d&rsquo;apprendre &agrave; maitriser les outils de communication qui sont &agrave; leur disposition, pour les aider &agrave; construire une strat&eacute;gie de communication coh&eacute;rente, pour r&eacute;pondre &agrave; leurs questions de mani&egrave;re personnalis&eacute;e.<br />Les visiteurs auront le choix parmi :</p>\r\n<ul>\r\n<li>40 exposants (de l&rsquo;agence g&eacute;n&eacute;raliste de communication au sp&eacute;cialiste presse/ vid&eacute;o, etc&hellip;)</li>\r\n<li>18 conf&eacute;rences d&rsquo;1h d&rsquo;experts en communication dans 3 salles diff&eacute;rentes</li>\r\n<li>des speed-coachings personnalis&eacute;s sur les stands des exposants</li>\r\n<li>Les patrons d&rsquo;entreprise rencontreront &agrave; Genval des profils aussi diff&eacute;rents que pointus, aussi inspirants que concrets, des professionnels de la communication qui se sont r&eacute;unis pour que, cette ann&eacute;e encore, les entrepreneurs pr&eacute;sents ressortent du salon avec les cl&eacute;s d&rsquo;un nouveau d&eacute;part.</li>\r\n</ul>\r\n<p>&nbsp;</p>', 3, '2012-01-23 19:20:51', '2012-01-23 19:20:51', 202, 1, '2012-01-23 19:20:51', NULL, 1),
(145, 'Mobile Application Developer', '<ul style="list-style-type: circle;">\r\n<li>2+ years of experience in mobile application development&nbsp;</li>\r\n<li>Knowledge of best practices, object oriented programming and MVC-way  of working </li>\r\n<li>Create native iOS applications with Objective-C</li>\r\n<li>DB and  server understanding </li>\r\n<li>knowlegde of XML, JSON, AJAX, HTML5, CSS3, SQL,  PHP</li>\r\n</ul>', 4, '2012-01-25 08:03:21', '2012-01-25 08:03:21', 483, 1, '2012-01-25 08:03:21', NULL, 1),
