(147, 'J&joy Summer 2012', '<p>New Website for J&amp;Joy''s summer collection powered by Prestashop !</p>\r\n<p>J&amp;JOY is a &laquo;&nbsp;Casual &amp; Luxury&nbsp;&raquo; clothing line, with our range  suitable for those as young as 2 years old and those that seek a size as  grand as XXXL. To create this unique product-line , J&amp;JOY gives  applies its unique perspective to the selection of fabric and colour,  because individuals, at any age, appreciate the combination of beauty,  style and comfort.</p>', 2, '2012-01-26 08:31:39', '2012-01-26 08:32:59', 2, 1, '2012-01-26 08:31:39', NULL, 1),
(148, 'E-commerce moving up', '<h3>Belgian web shops note 24% more revenue in 2011</h3>\r\n<p><img class="bottommargin" src="http://www.9000.be/content/images/1427.jpg" alt="" /></p>\r\n<p>In 2011 Belgian e-commerce websites posted a revenue of 1.118 billion euros, representing an increase of 23.8% compared to last year. These figures were recently published by&nbsp;<a href="http://www.9000.be/nl/2010/11/28/ogone/">our preferred online payment service Ogone</a>.</p>\r\n<p>According Ogone Belgium country manager Michael Van Gijseghem, the number of online payment went from 10.7 million in 2010 to 13.2 million in 2011. The average amount per online purchase increased slightly from 84 euros in 2009 and 2010 to 85 euros in 2011.</p>\r\n<p>This evolution does not come as a surprise to people from the industry. For it was already clear that consumers are increasingly comfortable with online shopping. The confidence in its safety has grown. And rightly so, because online shopping is now as safe and reliable as the real-life version.</p>\r\n<p>Travel, concert tickets, clothing, books, CDs and DVDs remain the most popular products for online shoppers, but also other sectors are gaining ground.</p>\r\n<p class="subtitel"><strong>New trends</strong></p>\r\n<p>Ogone forsees a steady growth in two areas. First of all there''s the&nbsp;<a href="http://www.9000.be/en/services/social-media/">social media</a>, which tend to offer more and more online marketing and e-commerce possibilities. On the other hand there is also a great potential in supermarkets. The online collection of these stores still has a lot of room for expansion in the coming years.</p>\r\n<p>There is also the domain of ''mobile commerce'', shopping with your smartphone or tablet. "Many online shops are realizing the potential of the growing popularity of smartphones and tablet PCs, and develop a mobile version of their website or&nbsp;<a href="http://www.9000.be/en/services/mobile-applications/">a specific mobile application</a>", Van Gijseghem tells us. (source: destandaard.be).</p>', 1, '2012-01-30 07:22:30', '2012-01-30 07:22:30', 451, 1, '2012-01-30 07:22:30', NULL, 1),
(149, 'Yoolancer  Belgium first Marketplace to Connects Workers and Businesses', '<p>Small- and medium-sized businesses can feel the pocketbook pinch when  hiring for specialty services: site design, illustration, development,  and more. You probably don''t have the resources? o take on these tasks  in-house, but Yoolancer&nbsp; can help you connect to production experts. Or  if your small business specializes in one of these areas, you could find  new contract work by pitching yourself online. <br /> Yoolancer&nbsp; connects online workers with companies in any of those  creative areas and beyond. You could find copywriters or translators,  administrative support, marketing experts, and even legal pros. There  are so many specific areas of experience that Yoolancer is especially  suited to these often-temporary, specialized positions. <br /> Companies with job needs post a description to Yoolancer, stating their  requirements and rough budget. A clock ticks down until their proposal  deadline, similar to an eBay auction. But unlike a live-auction site,  where people compete just on cost, bids can be sealed. In those cases,  rates are shown only to they hiring company, keeping the site from  diving towards cheap, low-quality labor. Businesses can also skip the  bid process, searching for and hiring workers directly.&nbsp; <br /> Yoolancerrs maintain profiles that explain their expertise. Plus, hiring  companies provide feedback and ratings after they complete jobs,  helping inform the next company that''s considering a contract. Since  workers can compete worldwide, you might end up paying less than rates  in your local market. <br /> Yoolancer usually holds payments in escrow, letting companies assign and  release funds based on milestone achievements. Yoolancer keeps between  6.75% and 8.75% of the total fee.<br />While a free membership plan is  available, some options add additional costs, between &euro;10 and &euro;30 each  month. For example, paid plans let free Yoolancer&nbsp; expand their profiles  and bid on additional contracts each month. (The free plan is limited  to a paltry three bids.) <br /> Yoolancer and other marketplace sites let businesses connect with contract workers--or even other businesses. <br />Take a look if you need to hire for temporary jobs or your service-based company is looking for other ways to add clients.</p>', 1, '2012-01-31 23:52:37', '2012-02-01 08:17:54', 486, 0, NULL, '2012-02-01 08:17:54', 1),
(150, 'Wanted: web developers for Ghent web startup Engagor', '<p>Engagor is a web-based tool for Social Media Monitoring featuring all kinds of awesomeness. Our office is in Ghent, Belgium.</p>\r\n<p><span>We are looking for Web Developers that are passionate about Social Media and the Internet in general, that want to help us to further expand our product offering.&nbsp;You will be working both on the frontend web application and on our backend cloud infrastructure.</span></p>\r\n<p>More detailed info about the position can be found on http://engagor.com/jobs. Talk to us!</p>', 1, '2012-02-02 22:59:56', '2012-02-03 08:23:17', 492, 0, NULL, '2012-02-03 08:23:17', 1),
(151, 'Wanted: web developers for Ghent web startup Engagor', '<p>Engagor is a web-based tool for Social Media Monitoringfeaturing all kinds of awesomeness. Our office is in Ghent, Belgium.</p>\r\n<p>We are looking for Web Developers that are passionate about Social Media and the Internet in general, that want to help us to further expand our product offering. You will be working both on the frontend web application and on our backend cloud infrastructure.<br />More detailed info about the position can be found on http://engagor.com/jobs. Talk to us!</p>', 4, '2012-02-03 09:29:33', '2012-02-03 09:29:33', 492, 1, '2012-02-03 09:29:33', NULL, 1),
(152, 'Checkthis is looking for a Ruby on Rails developer', '<p><a href="http://checkthis.com">Checkthis</a> is looking for a fulltime experienced and super talented&nbsp;Ruby on Rails developer. This is a unique opportunity to join an early and highly ambitious startup.</p>', 4, '2012-02-03 14:30:38', '2012-02-03 14:30:38', 71, 1, '2012-02-03 14:30:38', NULL, 1),
(153, 'Website for WMYN', '<p>Designing a website for the company "What''s My Name?".&nbsp;</p>\r\n<p><span class="hps">Created in</span><span>&nbsp;</span><span class="hps">HTML</span><span>,</span><span>&nbsp;</span><span class="hps">CSS</span><span>&nbsp;</span><span class="hps">and jQuery.&nbsp;</span></p>', 2, '2012-02-04 15:08:23', '2012-02-04 15:08:23', 99, 1, NULL, NULL, 1),
(155, 'Php developer', '<p>9000 Studios is looking for an HTML5 jquery specialist with mad php skills.</p>\r\n<p class="subtitel">We offer</p>\r\n<ul>\r\n<li>A full-time job with the coolest development team in the world!</li>\r\n<li>Challenging and varied projects.</li>\r\n<li>A professional framework.</li>\r\n<li>Interesting growth opportunities.</li>\r\n<li>An office in the heart of the most beautiful city west of the former Soviet Union.</li>\r\n<li>An office where we work hard and party hard.</li>\r\n<li>And delicious coffee, all day long.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p class="subtitel">We''re looking for</p>\r\n<p>A stereotypical computer nerd.</p>\r\n<ul>\r\n<li>You have over 800 friends on Facebook.</li>\r\n<li>You''re a real bully in World of Warcraft.</li>\r\n<li>You wear glasses and/or suspenders.</li>\r\n<li>During your rare hours of sleep you dream in code.</li>\r\n<li>You can always be reached on a laptop and smartphone (bathroom and toilet included).</li>\r\n<li>If you have a hobby, it''s programming chess computers.</li>\r\n<li>You have a good knowledge of HTML 5 and jquery.</li>\r\n<li>You know php stands for Hypertext Preprocessor.</li>\r\n<li>You have a good knowledge of Hypertext Preprocessor.</li>\r\n</ul>\r\n<p><br />Does this sound like you and are you interested in the job? Then you''re our man!</p>\r\n<p>Does this sound like you and are you interested in the job? And you have an above average feeling for fashion and personal hygiene? Then you our woman!</p>\r\n<p>&nbsp;</p>\r\n<p>Either way, do not hesitate to contact us @&nbsp;<a href="mailto:jobs@9000.be">jobs@9000.be</a>!</p>', 4, '2012-02-08 12:19:17', '2012-02-08 12:19:17', 451, 1, '2012-02-08 12:19:17', NULL, 1);
