(156, 'Web Integator wanted by the Gluc''s!', '<p><strong>Gluc&ocirc;ne recruits web integrator XHTML/CSS/Jquery</strong><br /><br />Do Xhtml, Css and Jquery have nothing left for you to discover?<br />Become the connection between graphics and development.<br />Come join Gluc&ocirc;ne as soon as possible!<br /><br /><strong>Requirements :</strong><br />-&nbsp;&nbsp;&nbsp; Meticulous with regard to graphic details<br />-&nbsp;&nbsp;&nbsp; Efficient in Dreamweaver, BBedit and your text editor<br />-&nbsp;&nbsp;&nbsp; Have a solid understanding of <strong>XHTML</strong> and <strong>CSS</strong><br />-&nbsp;&nbsp;&nbsp; Have a good knowledge of <strong>Ajax</strong>, <strong>jQuery</strong>, <strong>Javascript</strong><br />-&nbsp;&nbsp;&nbsp; Have a good sense for ergonomics, usability and SEO<br />-&nbsp;&nbsp;&nbsp; Have good knowledge of Photoshop for Integration (slicing)<br />-&nbsp;&nbsp;&nbsp; Work well in a team environment<br />-&nbsp;&nbsp;&nbsp; Be able and willing to learn new technologies<br />-&nbsp;&nbsp;&nbsp; Have a minimum of <strong>2 years experience</strong> (3 years is prefered)<br />-&nbsp;&nbsp;&nbsp; Being able to develop in <strong>PHP</strong> and <strong>Mysql</strong> is advantageous<br />-&nbsp;&nbsp;&nbsp; Having a good knowledge of Flash and AS3 is advantageous<br /><br />Glucone is a dynamic agency located in Brussels which specialized in interactive strategies. We are a united team, gaining daily pleasure by conquering new challenges.<br />Visit us on <a href="http://www.glucone.com" target="_blank">www.glucone.com</a><br /><br /><strong>Interested?</strong><br />Please send a cover letter and resume marked for the attention of Patrick Videira at <a href="mailto:info@glucone.com" target="_blank">info@glucone.com</a></p>\r\n<p>or by using our online form:<br /><a href="http://www.glucone.com/send_cv_integrateur.php" target="_blank">http://www.glucone.com/send_cv_integrateur.php</a></p>', 1, '2012-02-08 11:25:21', '2012-02-09 10:56:01', 495, 0, NULL, '2012-02-09 10:56:01', 1),
(158, 'new company and new website', '<p>IT Alpha Omega Consulting is a new company founded in 2011.</p>\r\n<p>IT Alpha Omega Consulting is specialized in Web design, web hosting, IT Consultancy and IT Services. Our two innovative concept are based on the general concept of Green IT. Our Slogan defines our philosophy: &nbsp;<strong>Think Different, Keep IT Simple !</strong></p>\r\n<p>If you want more informations, please visit our website at <a href="http://www.it-alpha-omega.be" target="_blank">http://www.it-alpha-omega.be</a></p>', 1, '2012-02-08 21:35:25', '2012-02-08 21:35:25', 505, 1, '2012-02-08 21:35:25', NULL, 1),
(159, 'PHP Developer', '<p>For our Brussels Mojitos Team, we''re looking for a PHP Developper :</p>\r\n<p><strong>Expert :&nbsp;</strong></p>\r\n<p>* Wordpress</p>\r\n<p>* PHP5, framework Zend</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Also good in :</strong></p>\r\n<p>* Drupal</p>\r\n<p>* Prestashop,&nbsp;</p>\r\n<p>* Magento</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Bonus points :</strong></p>\r\n<p>* bilingual FR/NL</p>\r\n<p>* IT (Apache, Linux, DNS, etc.)</p>\r\n<p>* HTML 5</p>', 4, '2012-02-09 11:10:50', '2012-02-09 11:12:26', 251, 1, '2012-02-09 11:10:50', NULL, 1),
(160, 'Web Integator wanted by the Gluc''s!', '<p><strong>Gluc&ocirc;ne recruits web integrator XHTML/CSS/Jquery</strong><br /><br />Do Xhtml, Css and Jquery have nothing left for you to discover?<br />Become the connection between graphics and development.<br />Come join Gluc&ocirc;ne as soon as possible!<strong></strong><br /><br />Glucone is a dynamic agency located in Brussels which specialized in interactive strategies. We are a united team, gaining daily pleasure by conquering new challenges.<br />Visit us on <a href="http://www.glucone.com" target="_blank">www.glucone.com</a><br /><strong></strong></p>', 4, '2012-02-09 11:10:52', '2012-02-09 11:10:52', 495, 1, '2012-02-09 11:10:52', NULL, 1),
(161, 'Dveloppeur dapplications web (H/F)', '<ul>\r\n<li>D&eacute;veloppement de l&rsquo;application web d&rsquo;analyse du trafic d&rsquo;un site internet</li>\r\n<li>Interfa&ccedil;age de l&rsquo;application avec des API de Google (AdWords &amp; Analytics)</li>\r\n<li>D&eacute;veloppements web pour des projets de r&eacute;f&eacute;rencement de nos client</li>\r\n</ul>', 4, '2012-02-09 13:40:23', '2012-02-09 13:44:48', 284, 0, NULL, '2012-02-09 13:44:48', 1),
(162, 'Web Application Developer', '<p>Universem, Search Engine Marketing agency and Google Adwords Certified partner is looking for a <strong>web developer</strong> for a project within the agency.</p>\r\n<p>In charge of the development of our web application, you will help the founders to set up a full platform for our customers. Are you a great developer, dynamic and determined?</p>\r\n<p><strong>Your tasks:</strong></p>\r\n<ul>\r\n<li>Development of an application to analyse the traffic of a website</li>\r\n<li>Extensive use of Google APIs (Adwords &amp; Analytics)</li>\r\n<li>Development for some SEO projects</li>\r\n</ul>\r\n<div>\r\n<p><strong>We are looking for:</strong></p>\r\n<ul>\r\n<li>Bachelor in IT or web development trainings</li>\r\n<li>Deep knowledge of PHP, MySQL, HTML, CSS &amp; Ajax</li>\r\n<li>Having used Google Adwords/Analytics is a plus</li>\r\n<li>An experience in web application development and/or HTML 5/CSS3 is an advantage</li>\r\n<li>Knowledge of a PHP framework (Symphony, Cakephp, Zend, &hellip;) is an asset</li>\r\n<li>Web marketing skills welcome</li>\r\n<li>Passive knowledge in English (should be fine if you read these lines ;-))</li>\r\n</ul>\r\n<p><strong>What we offer:</strong></p>\r\n<ul>\r\n<li>A creative and innovative working environment</li>\r\n<li>A job in a young and fast growing company in the Crealys office park between Namur and Gembloux</li>\r\n<li>An attractive salary in function of your experience</li>\r\n</ul>\r\n</div>', 4, '2012-02-09 14:06:35', '2012-04-04 15:54:54', 280, 1, '2012-02-09 14:06:35', NULL, 0),
(163, 'iPad app by 10to1 simplifies expertise on location.', '<p class="p1"><span class="s1"><a href="http://www.10to1.be" target="_blank">10to1</a> and <a href="http://www.fleetexpert.be/" target="_blank">Fleetexpert</a> have built an application for iPad to perform an expertise of a car on location. Inspectors collect all necessary data on the spot and they immediately print a report for the customer.</span></p>\r\n<p class="p1"><span class="s1">&nbsp;</span>Fleetexpert NV is an expertise, fleet management &amp; consultancy company. Fleetexpert&rsquo;s inspectors need to gather a lot of data on location, including photos, to complete a case. With the app they can send text and pictures to the server where they are processed by the back office.</p>\r\n<p class="p1">On a schematic diagram of the car the inspectors indicate which damages has been established. With the built-in camera on the iPad they take photos if necessary. Even photos that were taken before or PDF-files can be attached to a case.</p>\r\n<p class="p1">The app indicates clearly which fields remain to be completed. At the end of the inspectie the application calculates the amount due by the customer. The customer can place his signature on the screen and the Bluetooth connected portable printer will print a clearly readable receipt.</p>\r\n<p class="p1">All the necessary administrative information is put in by the administrator in a web application. The communication between iPad and server uses a webservice to exchange data. Collecting the data can be done offline: as soon as the iPad is connected to the internet the app starts syncing with the server.&nbsp;</p>\r\n<p class="p1">10to1 builds web and mobile applications for iPhone/iPad and Android.</p>', 2, '2012-02-09 15:10:56', '2012-02-10 09:15:05', 388, 0, NULL, '2012-02-10 09:15:05', 1),
(164, 'Codipro on iPhone & iPad', '<p>CODIPRO makes and distributes articulated safety lifting rings throughout the world. Particularly suitable for lifting and rotating heavy loads (from 300 kg to 55 tonnes per ring), the CODIPRO rings are in compliance with the European machinery directive (2006/42/EC). Available from stock or made to measure, they are delivered with a certificate of conformity within short respected deadlines.</p>\r\n<p><br />The application is used to keep abreast of the latest new developments and to view the entire range of lifting rings thanks to a complete and itemised catalogue. Photos and a video illustrate Codipro&rsquo;s expertise. By indicating the charge to be lifted as well as the lifting angles, visitors can determine which ring suits the best for their type of lifting tasks, thanks to the configurator.</p>\r\n<p><br />The application is available for iPad and iPhone. It can be downloaded free of charge from Apple store, so do not hesitate!</p>', 2, '2012-02-10 11:01:40', '2012-02-10 11:01:40', 1, 1, '2012-02-10 11:01:40', NULL, 1),
(165, 'Prophets presents Trends in Interactive Design 2012', '<p class="p1">Our Art Director Petra Sell (@volpelino) created an inspiring presentation collecting the main design and interaction-trends for 2012.</p>\r\n<p class="p1">She documents what our 2011 trends predictions evolved into and how to respond to emerging trends as a designer.</p>', 2, '2012-02-14 14:57:11', '2012-02-14 14:57:11', 391, 1, '2012-02-14 14:57:11', NULL, 1),
(166, 'ConsoPass', '<p><span class="hps">ConsoPass</span>&nbsp;<span class="hps">is a free directory that</span>&nbsp;<span class="hps">offers</span>&nbsp;<span class="hps">exclusive discounts</span>&nbsp;<span class="hps">from</span>&nbsp;<span class="hps">retailers</span>&nbsp;<span class="hps">near</span>&nbsp;<span class="hps">you.</span></p>\r\n<p><span class="hps">CakePHP 2, CakePlate, Twitter Bootstrap.</span></p>', 2, '2012-02-14 22:18:45', '2012-02-14 22:19:00', 36, 1, '2012-02-14 22:18:45', NULL, 1),
(167, 'iPad app by 10to1 simplifies expertise on location.', '<p class="p1"><span class="s1"><a href="http://www.10to1.be" target="_blank">10to1</a>&nbsp;and&nbsp;<a href="http://www.fleetexpert.be/" target="_blank">Fleetexpert</a>&nbsp;have built an application for iPad to perform an expertise of a car on location. Inspectors collect all necessary data on the spot and they immediately print a report for the customer.</span></p>\r\n<p class="p1"><span class="s1">&nbsp;</span>Fleetexpert NV is an expertise, fleet management &amp; consultancy company. Fleetexpert&rsquo;s inspectors need to gather a lot of data on location, including photos, to complete a case. With the app they can send text and pictures to the server where they are processed by the back office.</p>\r\n<p class="p1">On a schematic diagram of the car the inspectors indicate which damages has been established. With the built-in camera on the iPad they take photos if necessary. Even photos that were taken before or PDF-files can be attached to a case.</p>\r\n<p class="p1">The app indicates clearly which fields remain to be completed. At the end of the inspectie the application calculates the amount due by the customer. The customer can place his signature on the screen and the Bluetooth connected portable printer will print a clearly readable receipt.</p>\r\n<p class="p1">All the necessary administrative information is put in by the administrator in a web application. The communication between iPad and server uses a webservice to exchange data. Collecting the data can be done offline: as soon as the iPad is connected to the internet the app starts syncing with the server.&nbsp;</p>\r\n<p class="p1">10to1 builds web and mobile applications for iPhone/iPad and Android.</p>', 1, '2012-02-15 16:26:38', '2012-02-15 16:26:38', 388, 1, '2012-02-15 16:26:38', NULL, 1),
(168, 'Joomla freelance mission', '<div>\r\n<p>Urgent : lookin for someone for a Joomla freelance mission.</p>\r\n<p>The goal is to integrate an existang HTML/CSS structure into a full Joomla Template to be used on a new web site.</p>\r\n<p>Mission does not have to be done physically in our offices in Embourg.</p>\r\n</div>', 4, '2012-02-16 12:16:39', '2012-02-16 12:16:39', 15, 1, '2012-02-16 12:16:39', NULL, 1),
(169, 'InfoConseilAssurance', '<p><img src="http://www.kiffandco.be/uploads/images/infoconseilassurance.jpg" alt="infoconseilassurance" /></p>\r\n<p>Cr&eacute;ation de la charte graphique et d&eacute;veloppement du site Internet  InfoConseilAssurance.be Nous avons &eacute;galement d&eacute;velopp&eacute; les diff&eacute;rents  micro-sites. Ce travail a &eacute;t&eacute; r&eacute;alis&eacute; pour le compte d''un assureur  sp&eacute;cialis&eacute; dans les produits DKV.</p>\r\n<p>&gt;&gt; <a href="http://www.kiffandco.be/references/projets-site-internet/infoconseilassurance" target="_blank">En savoir plus</a></p>', 1, '2012-02-17 11:27:16', '2012-02-17 11:52:33', 123, 0, NULL, '2012-02-17 11:52:33', 1),
(170, 'In fine Digital is looking for a skilled web designer', '<p>We are currently looking for a Medior / Senior Web Designer.&nbsp;</p>\r\n<p>As Web Designer, you''ll be responsible for the following :&nbsp;</p>\r\n<ul>\r\n<li>Prototyping and Designing of Web sites, Web applications, Mobile websites / applications, promotional campaigns, ...</li>\r\n<li>Turning your design into a highly compatible website by the mean of HTML/CSS/JS</li>\r\n<li>Managing your project and planning in accordance with the general planning</li>\r\n</ul>\r\n<p>You are used to working with (very) big brands and you have at least 3 years of proven digital agency experience then drop us a line !</p>', 4, '2012-02-20 09:21:39', '2012-02-20 09:22:49', 12, 1, '2012-02-20 09:21:39', NULL, 1),
(171, 'Front-End Developer', '<h3>Fancy joining a team that designs and builds awesome stuff? Passionate about your work?</h3>\r\n<p>Spade is a contemporary agency. We develop websites and platforms using the latest technologies. Within our collaborative structure, we work on projects ranging from branding to user interfaces to mobile apps. We share a passion for our craft, we pay attention to the details that make all the difference for the user, and we stay on the cutting-edge.</p>\r\n<p>To expand our team, we&rsquo;re looking for a Front-end developer. You will be responsible for HTML/CSS/JS Front-end development and CMS Templating under direction of an Interactive Director. You will work on a wide range of projects: mobile, corporate websites, large portals and web apps.</p>', 4, '2012-02-20 09:31:55', '2012-02-20 09:31:55', 528, 1, '2012-02-20 09:31:55', NULL, 1),
(172, 'Discover Oostende with Marvin Gaye and 10to1. ', '<p class="p1"><span class="s1">Toerisme Oostende and <a href="http://www.10to1.be">10to1</a> have developed a mobile application that guides you on a tour about Marvin Gaye around the city.</span></p>\r\n<p class="p1"><span class="s1">Since February 15 2012 visitors can borrow an iPod at the tourist office with an app that shows a route along all the spots in Oostende that are associated with the period Marvin Gaye has spent in the city.&nbsp;</span></p>\r\n<p class="p1"><span class="s1">The thematic tour uses pictures and video and audio clips in the app to tell the story about how Marvin Gaye came to rest and about the song &ldquo;Sexual Healing&rdquo;, which was created in Oostende. The tour puts all the moments in the seaside town in a bigger international perspective.</span></p>\r\n<p class="p1"><span class="s1">When the hikers reach an important spot, the app tells the related story and complements it with pictures, newspaper clippings and interviews with people who were involved at the time. The tour is introduced by soul artist Jamie Lidell, and Jan Houtekiet guides the tourist through the rest of the trip.</span></p>\r\n<p class="p1"><span class="s1">10to1 developed the application for Android and iPhone and lets visitors experience the walk at their own pace. More information and reservations: <a href="http://www.marvingaye.be/"><span class="s2">http://www.marvingaye.be</span></a>.</span></p>', 1, '2012-02-20 11:02:08', '2012-02-20 12:59:02', 388, 0, NULL, '2012-02-20 12:59:02', 1),
(173, 'Drupal developer', '<p>K Company SA cherche des d&eacute;veloppeurs IT qui...</p>\r\n<ul>\r\n<li>connaissent et appr&eacute;cient Drupal, et veulent en connaitre encore davantage</li>\r\n<li>aiment apprendre de leur travail et de leur coll&egrave;gues autant que partager ce qu''ils savent</li>\r\n<li>cherchent des solutions aux probl&egrave;mes qui leur sont pos&eacute;s</li>\r\n</ul>\r\n<p>K Company vous offre un environnement de travail motivant, au sein d''une &eacute;quipe exp&eacute;riment&eacute;e bas&eacute;e &agrave; Bruxelles et Li&egrave;ge (le lieu de travail est &agrave; choisir selon votre convenance). Vous participerez &eacute;galement &agrave; la promotion des comp&eacute;tences Drupal de K Company, &agrave; travers Drupal Con, Open Gov Days et autres &eacute;v&eacute;nements de la communaut&eacute;.</p>\r\n<p>Qui sommes-nous ? K Company est une agence e-business leader en Belgique. K Company aime faire du business. Pourquoi ? Parce que les mod&egrave;les &eacute;conomiques d''aujourd''hui requi&egrave;rent des nouvelles formes d''innovation. Et pour K Company, l''innovation n''est PAS le futur : c''est la combinaison du futur avec le pr&eacute;sent. C''est ainsi que K Company d&eacute;finit son travail : g&eacute;n&eacute;rer de l''innovation organique en termes d''e-business chez ses clients gr&acirc;ce &agrave; la cr&eacute;ation interactive de valeur. Plus d''info sur&nbsp;<a class="freelinking external" href="http://www.k-cy.com/" target="_blank">www.k-cy.com</a>.</p>', 4, '2012-02-21 17:25:02', '2012-02-22 08:26:02', 13, 0, NULL, '2012-02-22 08:26:02', 1),
(174, 'Dribbble Meetup Lige', '<p>You''re on dribbble, you''re a designer and you want to have a friendly chat around a few drinks ? <br />Come next monday in Li&egrave;ge and we''ll have a friendly discussion !</p>', 3, '2012-02-22 08:11:44', '2012-02-22 08:11:44', 50, 1, '2012-02-22 08:11:44', NULL, 1),
(175, 'Offre de stage Web Developer', '<p>Cible souhaite proposer &agrave; des candidats motiv&eacute;s un stage au sein de son d&eacute;partement web.</p>\r\n<p>Un  stage encadr&eacute; par les responsables du d&eacute;partement et les  d&eacute;veloppeurs,  o&ugrave; le candidat participera activement &agrave; l&rsquo;&eacute;laboration de  projets  concrets.</p>\r\n<p>&nbsp;</p>\r\n<p><strong style="font-weight: bold !important;">Le profil recherch&eacute; est le suivant :</strong></p>\r\n<ul>\r\n<li>Bonne connaissance environnement LAMP</li>\r\n<li>Programmation PHP, JS, MySQL</li>\r\n<li>D&eacute;coupe HTML/CSS de templates PSD et int&eacute;gration dans CMS</li>\r\n<li>Attentif aux notions de r&eacute;f&eacute;rencement passif</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Si  l&rsquo;exp&eacute;rience vous tente et si vous &ecirc;tes pr&ecirc;ts &agrave; relever les d&eacute;fis  d&rsquo;une  agence de communication en pleine &eacute;volution, il vous suffit de  nous  envoyer votre candidature, accompagn&eacute;e d&rsquo;un CV, &agrave; <a href="mailto:jules.henry@cible.be">jules.henry@cible.be</a></p>', 1, '2012-02-22 14:48:59', '2012-02-22 14:56:22', 532, 0, NULL, '2012-02-22 14:56:22', 1),
(176, 'Senior Drupal Developer', '<p>For a short freelance mission (2 to 3 months) in Brussels due to start ASAP, Voice Agency is looking for a Senior Drupal Developer.</p>\r\n<p>She/he will be dealing with both point-and-click Drupal setup and down-to-code hardcore development.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 4, '2012-02-23 07:45:51', '2012-02-23 07:45:51', 211, 1, '2012-02-23 07:45:51', NULL, 1),
(177, 'Terroirs et dcouvertes', '<p>Terroirs et d&eacute;couvertes is e-commerce where you can buy some wines that you can''t find in Supermarket. All wines are European Wines.</p>', 2, '2012-02-23 08:26:19', '2012-02-23 08:26:19', 533, 1, '2012-02-23 08:26:19', NULL, 1),
(178, 'Prophets builds the new Dauphine website', '<div id="intro">\r\n<p class="intro">Prophets en Delaware Consulting launch a new website for Dauphine together.</p>\r\n</div>\r\n<div id="bodytext">\r\n<p>Dauphine is a part of La Lorraine Bakery Group and producer of popular "bake-off" products like bread, cakes and other fast-mover nourishment.</p>\r\n<p>For this project Prophets guided the entire concept and design of the website as Delaware Consulting developed the SiteCore-environment.</p>\r\n<p>Check out the website at&nbsp;<a href="http://www.dauphine.be/">www.dauphine.be</a>&nbsp;</p>\r\n<p><a title="Prophets" href="http://www.prophets.be" target="_blank">www.prophets.be</a></p>\r\n</div>', 2, '2012-02-23 10:01:16', '2012-02-23 10:04:02', 391, 1, '2012-02-23 10:01:16', NULL, 1),
(179, 'Cible is offering  motivated candidates a traineeship in our web department', '<p>This traineeship will be supervised by department managers and senior developers. The candidate will take an active part in operational projects.</p>\r\n<ul>\r\n<li>Candidate profile:</li>\r\n<li>Good knowledge of the LAMP toolset</li>\r\n<li>PHP, JS, MySQL programming</li>\r\n<li>HTML/CSS slicing from PSD templates and CMS implementation</li>\r\n<li>SEO awareness</li>\r\n</ul>\r\n<p>If you feel like try the experience and if you are looking forward to get directly involved in the challenges of a fast-evolving communication agency, please send your application and resume to <a href="mailto:jules.henry@cible.be">jules.henry@cible.be</a></p>', 1, '2012-02-23 10:32:23', '2012-02-23 10:34:14', 532, 0, NULL, '2012-02-23 10:34:14', 1),
(180, 'Web developer trainee', '<p>Cible is offering&nbsp; motivated candidates a traineeship in our web department. This traineeship will be supervised by department managers and senior developers. The candidate will take an active part in operational projects.</p>', 4, '2012-02-23 10:54:53', '2012-02-23 10:54:53', 532, 1, '2012-02-23 10:54:53', NULL, 1),
(181, 'Innergetic', '<p><strong>Innergetic</strong> launched their new website earlier this week.</p>\r\n<p>Created by Trinch Webstudio.</p>', 2, '2012-02-23 12:17:35', '2012-02-23 12:17:35', 536, 1, '2012-02-23 12:17:35', NULL, 1),
(182, ' Nous recrutons!', '<p>Un developper PHP</p>', 1, '2012-02-27 09:11:25', '2012-02-27 09:19:00', 542, 0, NULL, '2012-02-27 09:18:31', 1),
(183, 'Nous recherchons un Developper PHP', '<p><strong>Un Analyste / D&eacute;veloppeur PHP</strong><br />2 ans d&rsquo;exp&eacute;rience minimum</p>\r\n<p><strong>Votre mission :</strong></p>\r\n<ul>\r\n<li>Analyser des cahiers des charges et en tirer une ligne de d&eacute;veloppement pour des demandes internes et externes. </li>\r\n</ul>\r\n<ul>\r\n<li>Participer aux r&eacute;unions et debriefings avec l&rsquo;&eacute;quipe commerciale</li>\r\n</ul>\r\n<ul>\r\n<li>Participer activement aux d&eacute;veloppements web</li>\r\n</ul>\r\n<ul>\r\n<li>Assurer la maintenance corrective et &eacute;volutive des applications et des sites existants</li>\r\n</ul>\r\n<ul>\r\n<li>Intervenir sur plusieurs projets en parall&egrave;le</li>\r\n</ul>\r\n<ul>\r\n<li>Assurer le respect des d&eacute;lais, de la qualit&eacute; et de la strat&eacute;gie d&eacute;finie</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Nous vous offrons :</strong></p>\r\n<ul>\r\n<li>d&rsquo;int&eacute;grer une &eacute;quipe dynamique en pleine croissance dans un environnement jeune et cr&eacute;atif.</li>\r\n</ul>\r\n<ul>\r\n<li>un contrat temps plein, entr&eacute;e imm&eacute;diate</li>\r\n</ul>\r\n<ul>\r\n<li>une exp&eacute;rience enrichissante, un salaire &eacute;volutif et des ch&egrave;ques-repas</li>\r\n</ul>', 4, '2012-02-27 09:21:40', '2012-02-27 09:23:00', 542, 1, '2012-02-27 09:21:40', NULL, 1),
(184, 'New website for Diagnostic Beton', '<p>A full CMS-driven website, with many picture galleries, search engine optimization and complete text rewriting.</p>\r\n<p>Template by Mark (OS Templates). Web creation, SEO and project management by Amaranthe.</p>', 2, '2012-02-27 21:22:50', '2012-02-28 08:48:53', 160, 0, NULL, '2012-02-28 08:48:53', 1),
(185, 'Prophets launches De Nieuwe Antwerpenaar', '<p>After a public tender Prophets won the pre-analysis and the development of the webplatform for "De Nieuwe Antwerpenaar Online" and "Uit In Antwerpen" for the City Of Antwerp and Digipolis.</p>\r\n<p>De Nieuwe Antwerpenaar is an interactive and participative online magazine for the citizens of greater Antwerp and accompagnies the printed magazine.</p>\r\n<p>"Uit in Antwerpen" is a part of the online magazine and functions as a virtual section to bundle upcoming activities in the city of Antwerp.</p>\r\n<p>Prophets developed a "co-creation platform" where the citizens of greater Antwerp kan interact with personalized information they receive based on their home-location. They also have access to competitions and daily email notifications.</p>\r\n<p>Check it out at <a title="De Nieuwe Antwerpenaar" href="http://www.dna.be" target="_blank">www.dna.be</a>.</p>\r\n<p>&nbsp;</p>\r\n<p><a title="Prophets - Interactive Communication Agency" href="http://www.prophets.be">www.prophets.be</a></p>', 2, '2012-02-28 10:27:38', '2012-02-28 10:40:32', 391, 1, '2012-02-28 10:27:38', NULL, 1),
(186, 'Front-End Developer / Web Designer @ BigBentoBox', '<p>BigBentoBox is a Web Consulting &amp; Development Company specialized in E-Commerce &amp; Custom Web Applications. We offer all-inclusive services which includes development, design, marketing and maintenance.</p>\r\n<p>We are looking for a Front-End Developer/Web Designer to be part of the team.</p>\r\n<p>You will be responsible for the design, implementation &amp; maintenance of multiple features within our web applications. You will Concept, Design, Develop, in collaboration with the team, all front end code.</p>', 4, '2012-03-01 08:00:00', '2012-03-01 08:00:00', 21, 1, '2012-03-01 08:00:00', NULL, 1),
(187, 'Wanted: UX/UI designer @ 10to1.', '<p class="p1"><a href="http://10to1.be">10to1</a> evolves all the time. When we started we were 2 web application developers. Nowadays we mainly build mobile apps, with a strong emphasis on user experience.</p>\r\n<p class="p1">Until now we leaned on the strong interaction shoulders from @nilo. Nick does a fantastisc job. But: one designer and 6 developers - that''s no longer feasible. Our developers are just too fast. Nick is drowning in work.&nbsp;</p>\r\n<p class="p1">In short: we''re looking for a great UX/UI designer.</p>\r\n<p class="p1">Your profile:</p>\r\n<p class="p1">- You''ve got experience in graphic (web)design. Experience in design for mobile apps is a plus.</p>\r\n<p class="p1">- You want to and can design websites &agrave;nd mobile apps.</p>\r\n<p class="p1">- You want to learn. You want to be proud of your work, and you aim for the best user experience. When users are not happy with the result, you feel disappointed.</p>\r\n<p class="p1">- You love working with developers. You know that UX design for mobile apps is a team effort.</p>\r\n<p class="p1">We offer you:</p>\r\n<p class="p1">- a competitive salary</p>\r\n<p class="p1">- an office that''s easy to reach</p>\r\n<p class="p1">- a team of passionate developers who love working with you: our devs believe good user experience is equally important than functionality</p>\r\n<p class="p1">- the experience of other designers we work with</p>', 4, '2012-03-02 09:36:01', '2012-03-02 09:38:07', 388, 1, '2012-03-02 09:36:01', NULL, 1),
(188, '10to1 introduces Luan, sales tool for iPad.', '<p class="p1"><span class="s1">Luan is an iPad app for sales reps that lets them show photo&rsquo;s of their products to prospects. An online back end is used to manage photo&rsquo;s and their associated filters.</span></p>\r\n<p class="p1"><span class="s1">Companies that want to show their products when visiting customers can illustrate the sales pitch with Luan. The iPad app contains every picture they need, and the filters let the user find the images he wants really fast.</span></p>\r\n<p class="p1"><span class="s1">Managing the photo&rsquo;s is done in the online back end. After uploading all photo&rsquo;s and assigning the necessary categories and tags the app will indicate that new data is available on the server. Luan doesn&rsquo;t need an internet connection after being synced and therefore can be used at any location.</span></p>\r\n<p class="p1"><span class="s1">By combining filters the user will narrow or expand the results. A tap on a thumbnail opens an image in full screen. The user can swipe back and forth between the retained images.</span>&nbsp;</p>\r\n<p class="p1"><span class="s1">The Luan app can be found in the Apple App Store (<a href="http://bit.ly/getluan"><span class="s2">http://bit.ly/getluan</span></a>), the back end can be ordered at <a href="http://getluan.com"><span class="s2">http://getluan.com</span></a>.&nbsp;</span></p>', 2, '2012-03-06 13:27:36', '2012-03-06 13:27:36', 388, 1, '2012-03-06 13:27:36', NULL, 1),
(189, 'Cration du site Internet de Monarchi', '<p>Monarchi, votre architecte d&rsquo;int&eacute;rieur !</p>\r\n<p>Du simple conseil sur plan &agrave; la prise en charge globale de vos projets, monarchi vous apporte des solutions personnalis&eacute;es et cr&eacute;atives pour r&eacute;pondre au mieux &agrave; vos besoins et &agrave; vos envies d&rsquo;am&eacute;nagement d&rsquo;int&eacute;rieur, dans le respect de l&rsquo;esth&eacute;tisme, de la qualit&eacute;, des normes et de votre budget.<br /><br /></p>', 2, '2012-03-08 08:05:48', '2012-03-08 08:07:05', 430, 1, '2012-03-08 08:05:48', NULL, 1),
(190, 'Cration du site e-commerce Belle pour gurir', '<p>Avant tout destin&eacute; aux femmes atteintes d''un cancer, <strong>Belle pour gu&eacute;rir</strong> s''adresse &agrave; celles qui pensent que se sentir belle peut les aider &agrave; traverser cette &eacute;tape difficile de leur vie.</p>\r\n<p>Au-del&agrave; d''une simple boutique en ligne, nous esp&eacute;rons vous apporter un peu de r&eacute;confort et vous faire sentir&hellip; <strong>Belle pour gu&eacute;rir</strong> !</p>', 2, '2012-03-08 08:09:21', '2012-03-08 08:09:21', 430, 1, '2012-03-08 08:09:21', NULL, 1),
(191, 'FWA contest', '<p>Le projet Value Your Friends r&eacute;alis&eacute; pour les Iles de Paix est en comp&eacute;tition FWA cette semaine. Merci pour vos votes http://www.thefwa.com/submissions/value-your-friends-</p>', 1, '2012-03-08 11:00:28', '2012-03-08 11:00:28', 251, 1, '2012-03-08 11:00:28', NULL, 1),
(192, 'Birth of Oikos Films', '<p>oikosfilms.be produces commercial films or webvideo.</p>\r\n<p>References : Leonidas, Swiss watches packshot, etc.</p>\r\n<p>Enjoy !</p>', 1, '2012-03-08 17:06:47', '2012-03-09 07:53:33', 553, 0, NULL, '2012-03-09 07:53:33', 1),
(193, 'Multi-Mania 2012 Conference', '<p><strong>The goal of Multi-Mania</strong> is to bring together professionals, students and entrepreneurs to share knowledge, get inspired and build a community. <br /> The conference has become <strong>the annual event</strong> that brings  together designers, developers, entrepreneurs and creative multimedia  students. The enthusiasm surrounding this event is exciting and  inspiring. Each year the conference grows a little bigger and each year  the experience gets a little better.</p>\r\n<p><strong>Multi-Mania Conference 2012:</strong></p>\r\n<ul>\r\n<li>May 21: 1 day high-level industry workshops</li>\r\n<li>May 22: 1 day free conference with 30+ sessions on web design &amp;  development, 3D arts and entertainment, mobile development, video  production and post-production, audio&hellip;</li>\r\n</ul>', 3, '2012-03-09 13:00:17', '2012-03-09 13:00:17', 555, 1, '2012-03-09 13:00:17', NULL, 1),
(194, 'App iPhone / iPad DVD Post', '<p>Design application for iPhone and iPad for DVD Post.</p>', 2, '2012-03-13 12:17:31', '2012-03-13 12:17:31', 316, 1, '2012-03-13 12:17:31', NULL, 1),
(195, 'Cration du site e-commerce pour SPA FIA WEC', '<p>Mise en place de la version "billetterie en ligne" de notre solution e-commerce pour FIA WORLD ENDURANCE CHAMPIONSHIP</p>', 2, '2012-03-19 07:59:52', '2012-03-19 10:34:47', 430, 1, '2012-03-19 07:59:52', NULL, 1),
(196, 'Refonte graphique du site Spagrandprix.com', '<p>Pour le championnat 2012, la billetterie en ligne fait peau neuve. C''est avec  plaisir que notre &eacute;quipe s''est &agrave; nouveau plong&eacute;e dans l''univers de la F1.</p>', 2, '2012-03-20 10:01:55', '2012-03-20 10:01:55', 430, 1, '2012-03-20 10:01:55', NULL, 1),
(197, 'Web project manager', '<p><strong>Votre mission&nbsp;:</strong></p>\r\n<p>Vous coordonnerez les efforts de toute une &eacute;quipe&nbsp;:</p>\r\n<p>En collaboration &eacute;troite avec les &eacute;quipes de designers, d&rsquo;ergonomes et de d&eacute;veloppeurs, vous assurerez la gestion de projet de la signature du contrat &agrave; la mise en ligne.</p>\r\n<p><strong>Vos t&acirc;ches&nbsp;:</strong></p>\r\n<ul>\r\n<li>Vous devrez &ecirc;tre un chef de projet efficace et proactif, car croyez-nous... le retard n''est pas une option.</li>\r\n</ul>\r\n<ul>\r\n<li>Vous assurerez le suivi et la mise &agrave; jour des plannings, mais aussi l&rsquo;&eacute;laboration d&rsquo;un budget pr&eacute;visionnel et d&rsquo;un cahier des charges</li>\r\n</ul>\r\n<ul>\r\n<li>Si quelque chose va mal, vous ferez preuve d&rsquo;imagination et de r&eacute;activit&eacute; pour r&eacute;soudre le probl&egrave;me au plus vite et vous n&rsquo;abandonnerez pas tant que tout n&rsquo;est pas sous contr&ocirc;le. Ou alors vous partirez tr&egrave;s loin...</li>\r\n</ul>\r\n<ul>\r\n<li>Vous participerez &agrave; la phase de conception initiale : de l&rsquo;&eacute;valuation commerciale et technique, en passant par la faisabilit&eacute; du projet jusqu&rsquo;&agrave; son ad&eacute;quation avec la strat&eacute;gie de l&rsquo;entreprise.</li>\r\n</ul>\r\n<ul>\r\n<li>Vous g&eacute;rerez au jour le jour les relations avec nos clients.</li>\r\n</ul>\r\n<ul>\r\n<li>A la mise en ligne du projet, vous veillerez &agrave; la conformit&eacute; du travail &agrave; la demande initiale du client tout en pr&eacute;parant la demande future qu''il vous soumettra.</li>\r\n</ul>\r\n<ul>\r\n<li>Et surtout...vous serez motiv&eacute;s &agrave; l&rsquo;id&eacute;e d&rsquo;int&eacute;grer une &eacute;quipe jeune, dynamique, pleine d&rsquo;humour et parfois un peu barr&eacute;e...</li>\r\n</ul>\r\n<p><strong><br /></strong></p>', 4, '2012-03-20 15:03:35', '2012-03-20 15:03:35', 11, 1, '2012-03-20 15:03:35', NULL, 1),
(199, 'Graphic & digital designer internship', '<p>Hi webshaker !</p>\r\n<p>I''m looking for an intern for Radionomy''s&nbsp;Design (print &amp; digital) departement.</p>\r\n<p><strong>Where ?</strong></p>\r\n<p>HQ in Brussels (Anderlecht) focus on graphic and web design.&nbsp;</p>\r\n<p>Just near the R0</p>\r\n<p><strong>What ?</strong></p>\r\n<p>A great experience into a startup that gives you an awesome online radio experience ! You will work on digital and print design development.&nbsp;&nbsp;</p>\r\n<p>Visit us : www.radionomy.com</p>\r\n<p>&nbsp;</p>\r\n<p>NB :&nbsp;the main language in the team is french. No problem with other languages, but you have to be fluent in french.&nbsp;</p>', 4, '2012-03-27 06:46:47', '2012-04-02 15:29:42', 409, 1, '2012-03-27 06:46:47', NULL, 1),
(200, 'Kodibox website', '<p>Kodibox rents stackable, durable and sustainable boxes for moving. The website presents the main advantages of this start-up, offers a comparison between different packages and allows people to order a package.</p>', 2, '2012-03-28 10:58:52', '2012-03-28 10:58:52', 323, 1, '2012-03-28 10:58:52', NULL, 1),
(201, 'AIR Developper ', '<p>Hi Webshaker,</p>\r\n<p>Globule Bleu is looking for a great Air Developper for a quick mission (2 weeks).</p>\r\n<p>Interested ? &gt; jean-marc@globulebleu.com</p>\r\n<p>Glad to meet you !</p>', 4, '2012-04-02 14:44:06', '2012-04-02 14:44:06', 251, 1, '2012-04-02 14:44:06', NULL, 1),
(202, 'Caf Numrique Lige S02 #12: Le journalisme  lpreuve du web', '<p>Le&nbsp;<strong>mercredi 18 avril &agrave; partir de 19:00</strong>, nous vous donnons rendez-vous &agrave; l&rsquo;<a title="ULg" href="http://maps.google.be/maps?q=50.640868,5.575733&amp;hl=fr&amp;ll=50.640997,5.57584&amp;spn=0.003858,0.010568&amp;num=1&amp;t=m&amp;z=17&amp;iwloc=A" target="_blank">universit&eacute; du Li&egrave;ge, Place du XX Ao&ucirc;t</a>. Dans le cadre du cours de web journalisme, les &eacute;tudiants d&rsquo;<a title="Alain Gerlache" href="http://alaingerlache.be/" target="_blank">Alain Gerlache</a>&nbsp;(<a title="Alain Gerlache" href="http://twitter.com/#!/alaingerlache" target="_blank">@AlainGerlache</a>)&nbsp;sont amen&eacute;s &agrave; d&eacute;velopper leur r&eacute;flexion autour de l&rsquo;utilisation des nouveaux m&eacute;dias. Une rencontre captivante entre journalistes en devenir et communaut&eacute; web/geek du Caf&eacute; Num&eacute;rique qui s&rsquo;axera sur diff&eacute;rents points:<br />- les sp&eacute;cificit&eacute;s de certains r&eacute;seaux sociaux: quels sont leurs publics cibles? comment y communique-t-on? leurs avantages?<br />- entre r&eacute;daction de contenu et curation (et crowdsourcing?) comment bien s&rsquo;organiser? Quels sont&nbsp;<a href="http://nicolasbecquet.posterous.com/la-boite-a-outil-du-journaliste-web" target="_blank">les outils</a>?<br />- en quoi ces nouveaux canaux aideront le journaliste de demain?</p>\r\n<p>Pour alimenter un peu plus le d&eacute;bat, nous aurons le privil&egrave;ge de discuter en direct de San Francisco via vid&eacute;o-conf&eacute;rence avec&nbsp;<a title="Xavier Damman" href="http://twitter.com/#!/xdamman" target="_blank">Xavier Damman</a>, co-fondateur de&nbsp;<a title="Storify" href="http://storify.com/" target="_blank">Storify</a>. Storify est un outil qui aide les utilisateurs &agrave; s&eacute;lectionner les informations qu&rsquo;ils trouvent &agrave; travers diff&eacute;rents r&eacute;seaux pour en faire une histoire.</p>\r\n<p>Un &eacute;change entre:&nbsp;ma&icirc;trise&nbsp;du web via la communaut&eacute; Caf&eacute; Num&eacute;rique et approche acad&eacute;mique du journalisme de part les &eacute;tudiants en 1er master en pr&eacute;sence d&rsquo;Alain Gerlache.</p>\r\n<p><iframe src="http://www.youtube.com/embed/9APO9_yNbcg" width="560" height="315" frameborder="0"></iframe></p>\r\n<p>Dans la vid&eacute;o TEDx ci-dessus,&nbsp;<a title="Paul Lewis" href="http://twitter.com/#!/paullewis" target="_blank">Paul Lewis</a>&nbsp;(Special Projects Editor au&nbsp;<a title="Guardian" href="http://www.guardian.co.uk/" target="_blank">Guardian</a>)&nbsp;pr&eacute;sente une nouvelle fa&ccedil;on de faire du journalisme. Intro int&eacute;ressante du sujet.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Programme:</strong></p>\r\n<p>19:20 Introduction</p>\r\n<p>19:25&nbsp;<em>Le&nbsp;journalisme &agrave; l&rsquo;&eacute;preuve du web&nbsp;</em>par les &eacute;tudiants de 1er Master</p>\r\n<p>20:15 Pr&eacute;sentation d&rsquo;exemples de guides d&rsquo;utilisation des r&eacute;seaux (France T&eacute;l&eacute;vision, Radio T&eacute;l&eacute;vision Suisse, Radio-Canada)</p>\r\n<p>20:30 Pause</p>\r\n<p>20:45 Xavier Damman, Storify</p>\r\n<p>&nbsp;</p>\r\n<p><em>Info pratiques:</em></p>\r\n<p>- Date:&nbsp;<strong>mercredi 18 avril &agrave; partir de 19:00</strong></p>\r\n<p>- Lieu:&nbsp;<strong>Salle Gothot</strong>&nbsp;de l&rsquo;<a title="ULg" href="http://maps.google.be/maps?q=50.640868,5.575733&amp;hl=fr&amp;ll=50.640997,5.57584&amp;spn=0.003858,0.010568&amp;num=1&amp;t=m&amp;z=17&amp;iwloc=A" target="_blank">universit&eacute; de Li&egrave;ge, Place du XX Ao&ucirc;t</a></p>\r\n<p>- Entr&eacute;e gratuite et ouverte &agrave; tous. Inscription souhait&eacute;e &agrave; l&rsquo;<a title="Facebook" href="https://www.facebook.com/events/246870775409349/" target="_blank">event facebook</a>.</p>', 3, '2012-04-03 07:28:02', '2012-04-03 07:29:03', 76, 1, '2012-04-03 07:28:02', NULL, 1),
(203, 'Junior Web Marketing Consultant', '<p><span>Universem, Search Engine Marketing agency and Google Adwords Certified partner is looking for a&nbsp;</span><strong>junior web marketing consultant</strong>&nbsp;for exciting projects in a fast growing and innovative market.</p>\r\n<p>Responsible for web marketing projects, you will help SME''s marketing directors to develop their web presence and visibility.</p>\r\n<p>You have strong analytical skills, you are dynamic, autonomous and able to manage multiple projects in parallel in a constant moving environment? Do not hesitate to join the team of Universem!</p>', 4, '2012-04-04 19:40:05', '2012-04-04 19:40:05', 280, 1, '2012-04-04 19:40:05', NULL, 1),
(204, 'New Noomia website', '<p>New version of our website... Have fun !</p>', 2, '2012-04-05 13:33:13', '2012-04-05 13:33:13', 2, 1, '2012-04-05 13:33:13', NULL, 1),
(205, 'Liste exhaustive? "La carte du march belge des applis mobiles"', '<p><em>Le jeune march&eacute; du d&eacute;veloppement d&rsquo;applications mobiles pour smartphone est en &eacute;bullition. Les acteurs se sont multipli&eacute;s depuis 2010 et le temps de l&rsquo;euphorie marketing pass&eacute;, les applications elles-m&ecirc;mes sont plus matures. Zoom, au travers d&rsquo;une carte interactive, sur les diff&eacute;rents types d&rsquo;acteurs sur ce jeune march&eacute;.</em></p>\r\n<p><em><span>Selon les estimations de Tanguy De Lestr&eacute; (Agoria), quelque 400 personnes travailleraient en Belgique sur le cr&eacute;neau des applications mobiles. Diff&eacute;rents types de soci&eacute;t&eacute;s se sont lanc&eacute;es sur le cr&eacute;neau.&nbsp;</span><br /><br /><span>1) Les sp&eacute;cialistes (</span><strong>en rouge</strong><span>&nbsp;sur la carte) comme AppSolution, Appstrakt, In The Pocket, Tapptic, etc. Devenues agences mobiles, elles d&eacute;veloppent des applis sur mesures pour des clients (B2C et B2B).&nbsp;</span></em></p>\r\n<p><em><br /><span>2) Les agences digitales et Web (</span><strong>en jaune</strong><span>&nbsp;sur la carte) comme Emakina. Beaucoup, essentiellement concentr&eacute;es sur les d&eacute;veloppements Web, ont rat&eacute; le coche ou ne pr&eacute;sentent que quelques r&eacute;alisations isol&eacute;es. Pas de quoi s&rsquo;imposer face aux &laquo; sp&eacute;cialistes &raquo;. Sauf Emakina qui tire clairement son &eacute;pingle du jeu.&nbsp;</span><br /><br /><span>3) Les niches (</span><strong>en vert</strong><span>&nbsp;sur la carte). Ces start up se sp&eacute;cialisent fortement et/ou ne disposent que d&rsquo;une seule application qu&rsquo;elles soumettent au amrch&eacute; comme un produit unique. C&rsquo;est le cas de Tag tag City dans le domaine du tourisme ou d&rsquo;Agilys (myShopi) dans la grande distribution.</span></em></p>\r\n<p>&nbsp;</p>\r\n<p><em><span><a href="http://trends.levif.be/economie/actualite/dossiers/applications-mobiles-dossier-special/la-carte-du-marche-belge-des-applis-mobiles/article-4000076427611.htm">http://trends.levif.be/economie/actualite/dossiers/applications-mobiles-dossier-special/la-carte-du-marche-belge-des-applis-mobiles/article-4000076427611.htm</a><br /></span></em></p>', 1, '2012-04-10 11:54:14', '2012-04-10 11:54:14', 76, 1, '2012-04-10 11:54:14', NULL, 1),
(206, 'New portfolio website', '<p>New responsive portfolio website !</p>', 2, '2012-04-11 06:33:24', '2012-04-11 06:33:24', 567, 1, '2012-04-11 06:33:24', NULL, 1),
(207, 'Bloemenautomaat.be', '<p>Het is zondagavond, je moet nog op familiebezoek en bent een  cadeautje vergeten. Via bloemenautomaat.be kun je kijken waar de  dichtstbijzijnde bloemenautomaat is.</p>\r\n<p>Op deze site zijn alle bloemenautomaten van Belgi&euml; netjes in kaart gebracht.</p>\r\n<p>meer projecten via : http://www.webkoffie.com/portfolio</p>', 2, '2012-04-11 09:42:24', '2012-04-11 09:42:24', 568, 1, '2012-04-11 09:42:24', NULL, 1),
(208, 'Android developer', '<p>Due to several recent potential upcoming projects at Epic, we''re currently looking for a freelance Android developer.</p>', 4, '2012-04-13 07:11:21', '2012-04-13 07:11:21', 50, 1, '2012-04-13 07:11:21', NULL, 1),
(209, 'Web Developer (Front-End/PHP)', '<p>At <a href="http://www.engagor.com" target="_blank">Engagor </a>we are looking for Web Developers that are passionate about Social Media and the Internet in general, and that want to help us to further expand our product offering.&nbsp;You will be working both on the frontend web application and/or on our backend cloud infrastructure.</p>\r\n<h2>What do we offer?</h2>\r\n<ul>\r\n<li>Full-time position, long term contract in the center of Ghent</li>\r\n<li>Competitive salary, with a great package of extra benefits</li>\r\n<li>Exciting product, built on exciting technologies, with lots of opportunities</li>\r\n<li>Environment where thinking about the future of our product is encouraged</li>\r\n<li>Awesome colleagues and working environment (did we already mention our rabbit Jenny?&nbsp;<img class="wp-smiley" src="http://wordpress.engagor.netdna-cdn.com/wp-includes/images/smilies/icon_smile.gif" alt=":-)" />&nbsp;)</li>\r\n</ul>', 4, '2012-04-16 10:12:52', '2012-04-16 10:12:52', 492, 1, '2012-04-16 10:12:52', NULL, 1),
(210, 'Glow agency New website', '<p>www.glowagency.com</p>', 1, '2012-04-17 09:27:38', '2012-04-17 14:49:22', 572, 0, NULL, '2012-04-17 14:49:22', 1),
(211, 'Dandy Coding website', '<p>The website of a new web development company called Dandy Coding.</p>', 2, '2012-04-18 08:56:46', '2012-04-18 08:56:46', 574, 1, '2012-04-18 08:56:46', NULL, 1),
(212, 'Analyste-programmeur ASP.net c#', '<p>Synchrone vous propose d&rsquo;int&eacute;grer son &eacute;quipe pour participer &agrave; son d&eacute;veloppement, en qualit&eacute; d&rsquo;Analyste-programmeur autour des technologies .NET.<br /><br />Structure &agrave; taille humaine sp&eacute;cialis&eacute;e dans la mise en &oelig;uvre de projets web innovants, nous offrons de v&eacute;ritables perspectives d''&eacute;volution &agrave; tous les profils motiv&eacute;s, impliqu&eacute;s et conscients des objectifs fix&eacute;s.<br /><br />Vous intervenez dans le cadre de projets pour nos clients. Vous collaborez &agrave; la mise en &oelig;uvre de solutions techniques, et r&eacute;digez la documentation correspondante.</p>', 4, '2012-04-18 13:56:09', '2012-04-18 13:56:09', 429, 1, '2012-04-18 13:56:09', NULL, 1),
(213, 'Designer for WEB/GUI/APP/INTERACTION ', '<p><span id="fulldesc">Bagaar is an interactive design bureau. We  invent and create advanced digital production for web, mobile, physical  installations and other media. We strive to deliver high quality  concepts and designs. We solve unique problems through clever and  innovative technical development. We are strategy development partners  for customers worldwide. www.bagaar.be</span></p>', 4, '2012-04-19 09:31:22', '2012-04-19 09:31:22', 483, 1, '2012-04-19 09:31:22', NULL, 1),
(214, 'DHL Secretary Day', '<p>&nbsp;DHL Secretary Day By Pimento Studio and&nbsp;MostWanted - Digital Agency</p>', 2, '2012-04-21 11:35:22', '2012-05-03 04:57:55', 481, 1, '2012-04-21 11:35:22', NULL, 1),
(215, 'Charg de projet', '<p><strong>A propos de l''employeur : KIKK Festival ASBL&nbsp;</strong></p>\r\n<p>Le KIKK est une structure en &eacute;volution qui a pour mission d''organiser et de g&eacute;rer un &eacute;v&egrave;nement international r&eacute;current autour de la question du digital et de la cr&eacute;ativit&eacute; dans notre soci&eacute;t&eacute; contemporaine et une s&eacute;rie de projets parall&egrave;les li&eacute;s &agrave; la cr&eacute;ativit&eacute; et au digital.</p>\r\n<p><strong>Description g&eacute;n&eacute;rale de la fonction</strong></p>\r\n<p>Assister la Direction dans la gestion et la coordination</p>\r\n<p>Organisation administrative&nbsp;</p>\r\n<p>Gestion et suivi des dossiers et contacts &nbsp;</p>\r\n<p>Gestion et organisation du calendrier&nbsp;</p>\r\n<p>Collaboration r&eacute;dactionnelle</p>\r\n<p>&nbsp;Aide &agrave; la gestion des projets&nbsp;</p>\r\n<p>Organisation et suivi des contacts avec les intervenants</p>\r\n<p>Responsable de la coordination entre les &eacute;quipes, intervenants, direction et partenaires.</p>\r\n<p>Suivi des dossiers partenaires (voyages possibles)</p>\r\n<p>Prise en charge de la coordination des &eacute;quipes de b&eacute;n&eacute;voles</p>', 4, '2012-04-26 08:53:57', '2012-04-26 08:53:57', 11, 1, '2012-04-26 08:53:57', NULL, 1),
