INSERT INTO posts (id, title, content, post_type_id, created_at, updated_at, user_id, validated, accepted_at, refused_at, online) VALUES
(218, 'Web and Mobile developer', '<p><strong>About you</strong><br />We need you to be proactive and willing to keep on learning about emerging technologies;<br />You&rsquo;re passionate about new trends and developments;<br />Capacity to laugh to Belgian humour (you&rsquo;ve been warned);<br />You&rsquo;re a musician, a writer, a friendly companion or you like to design as well ? You&rsquo;ve got all our attention;<br />You&rsquo;re living the internet, you&rsquo;re eating the internet and you&rsquo;re sleeping with the internet but you&rsquo;re still in a human form;<br />You must be able to understand the fun, challenges and long-term benefits of working with a young but very promising agency;<br />Your mama doesn&rsquo;t understand a single word of what you say when you&rsquo;re talking about your work;</p>\r\n<p><strong>Your job</strong><br />You&rsquo;ll get to work with the next place-to-be in Belgian agencies.<br />As part of your job you will have to slice pixel perfect designs, to develop front-end websites, integrate e-commerce solutions, give a help to the development of our own CMS solution, play to the XBOX with us during lunch, get to challenge your skills every single day and perhaps we will even need you to tell jokes.</p>', 4, '2012-05-03 07:51:38', '2012-05-03 07:51:38', 50, 1, '2012-05-03 07:51:38', NULL, 1),
(219, 'PHP web developer', '<p><strong>We are Dogstudio and we don''t make shit !</strong></p>\r\n<p>Et nous sommes fiers de travailler pour le Standard de Li&egrave;ge, Pfizer, Lilly, Creative Wallonia, The United Nations Environment Programme, Champion Mestdagh, ...&nbsp;</p>\r\n<p>Dogstudio est une agence cr&eacute;ative namuroise qui d&eacute;veloppe des solutions sur mesure pour aider ses clients &agrave; stimuler leur business gr&acirc;ce aux nouveaux m&eacute;dias et &agrave; une communication innovante et percutante&nbsp;!</p>\r\n<p>Nous apportons notre expertise dans la conception de projets digitaux, sur base de conseils strat&eacute;giques, de cr&eacute;ation graphique et de d&eacute;veloppement technologique.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Aujourd&rsquo;hui, Dogstudio recherche un programmeur ayant de solides connaissances des frameworks PHP afin de participer au d&eacute;veloppement d''une plateforme internationale pour l''un de nos partenaires.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Votre mission :</strong></p>\r\n<ul>\r\n<li>D&eacute;velopper, int&eacute;grer et d&eacute;ployer des applications web</li>\r\n<li>Assurer la qualit&eacute; des applications mises en ligne</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Vos responsabilit&eacute;s :</strong></p>\r\n<ul>\r\n<li>Concevoir des solutions adapt&eacute;es aux besoins de notre partenaire en relation avec l''ensemble de l''&eacute;quipe.</li>\r\n<li>Ma&icirc;triser les technologies web sur le bout des doigts</li>\r\n<li>Veiller au respect des sp&eacute;cifications techniques et surtout au respect des d&eacute;lais.</li>\r\n<li>Contr&ocirc;ler, tester et documenter des applications.</li>\r\n<li>Assurer la maintenance des applications d&eacute;j&agrave; d&eacute;velopp&eacute;es.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Votre quotidien&nbsp;:</strong></p>\r\n<ul>\r\n<li>Analyser et d&eacute;velopper les nouvelles fonctionnalit&eacute;s tout en maintenant les existantes.</li>\r\n<li>Pouvoir commenter autrement la fonction "display" que par "Affichage".</li>\r\n<li>Communiquer avec les clients en leurs serrant la patte.</li>\r\n<li>Participer &agrave; la r&eacute;daction de la documentation technique.</li>\r\n<li>Ne pas confondre test-unitaire et test-scalaire.</li>\r\n<li>Communiquer avec l&rsquo;&eacute;quipe&hellip;et pas uniquement par email.<strong>&nbsp;</strong></li>\r\n</ul>\r\n<p><strong>Votre profil :</strong></p>\r\n<ul>\r\n<li>Vous avez d&eacute;velopp&eacute; votre premier site &agrave; l&rsquo;&acirc;ge de 12 ans, en utilisant des tables and du plain HTML bien &eacute;videmment.Ensuite, vous avez fait la d&eacute;couverte du CSS, Javascript, PHP et vous ne pouvez plus vous en passer depuis lors. Maintenant que chaque boulangerie, ou coiffeur de votre quartier a son propre web site, vous &ecirc;tes pr&ecirc;t &agrave; bosser sur des gros projets, des vrais&nbsp;! On parle d&rsquo;applications web d&rsquo;enfer, de syst&egrave;mes back-end complexes. Bref&hellip;Vous &ecirc;tes hyper motiv&eacute; &agrave; l&rsquo;id&eacute;e de d&eacute;velopper une plateforme PHP gigantesque et &agrave; dimension internationale.</li>\r\n<li>Vous ma&icirc;trisez parfaitement la programmation orient&eacute;e objet</li>\r\n<li>Vous savez ce que sont PHP, MySql,&nbsp;JS,&nbsp;HTML, CSS, leurs sp&eacute;cificit&eacute;s et surtout vous les ma&icirc;trisez sur le bout des doigts</li>\r\n<li>Vous connaissez et ma&icirc;trisez au moins un framework PHP (mais si vous en connaissez cinq, c&rsquo;est encore mieux&nbsp;!)</li>\r\n<li>Vous maitrisez parfaitement le fran&ccedil;ais et avez de bonnes capacit&eacute;s r&eacute;dactionnelles but you can switch to english whenever it&rsquo;s needed (spoken and written)</li>\r\n<li>On dit de vous que vous &ecirc;tes &agrave; l''&eacute;coute des autres et tout particuli&egrave;rement de vos clients.</li>\r\n<li>Vous &ecirc;tes autonome et rigoureux (mais pour de vrai, pas parce que c''est la chose facile &agrave; dire lors d&rsquo;un entretien d&rsquo;embauche)</li>\r\n<li>Vous avez un bon esprit d&rsquo;&eacute;quipe, de synth&egrave;se et d&rsquo;analyse.</li>\r\n<li>Vous n&rsquo;avez pas peur de vous remettre en question et faites preuve d&rsquo;une bonne auto-critique. N''est-ce pas ?</li>\r\n<li>Vous &ecirc;tes une web machine&nbsp;!</li>\r\n<li>Et surtout...vous serez motiv&eacute; &agrave; l&rsquo;id&eacute;e d&rsquo;int&eacute;grer une &eacute;quipe jeune, dynamique, pleine d&rsquo;humour et parfois un peu barr&eacute;e...</li>\r\n</ul>', 4, '2012-05-03 09:34:39', '2012-05-03 09:42:18', 147, 1, '2012-05-03 09:34:39', NULL, 1),
