(226, 'Designskills Job/Vacature', '<p>Designskills is op zoek naar een gepassioneerde en straffe graphic designer.&nbsp;<br /><br />Meer info hierover vind je op&nbsp;<a rel="nofollow nofollow" href="http://jobs.designskills.be/" target="_blank">http://jobs.designskills.be/</a>&nbsp;<br /><br /><span class="text_exposed_show"><br />Ge&iuml;nteresseerd?&nbsp;<br /><br />Stuur je portfolio, cv en ander overtuigend bewijsmateriaal naar: vacature@designskills.be</span></p>', 1, '2012-05-15 08:58:24', '2012-05-15 10:38:32', 544, 0, NULL, '2012-05-15 10:38:32', 1),
(227, 'Portfolio', '<p>Portfolio r&eacute;alis&eacute; pour mon TFA&nbsp;</p>', 2, '2012-05-15 08:58:49', '2012-05-15 08:58:49', 589, 1, NULL, NULL, 1),
(228, 'Graphic Designer', '<p>Designskills is een uitdagend en ambitieus bureau op zoek naar een gepassioneerde en straffe graphic designer.</p>\r\n<p>Je bent een creatieve duizendpoot die uitblinkt in crossmediale vormgeving en je bent op de hoogte van de laatste trends op het vlak van graphic en interactive design. Je hebt een passie voor pionierswerk, digitale media, sterke concepten, fonts en grids en een crossmediaal denkproces triggert je geest.</p>\r\n<p>Bij het designen is starten van een blanco canvas een droom voor jou, maar je bent ook in staat om je als een kameleon aan te passen aan de verschillende huisstijlen van onze klanten en binnen de uitgezette lijnen creatief te verbazen.</p>\r\n<p>Een uiterst gevarieerd klantenportfolio gaande van MTV Networks, Nickelodeon, TMF, Lessius, VRT, Enfocus, ... tot Provincie Limburg, de Stad Leuven en de stad Genk zie je als een uitdaging!</p>\r\n<p>Je bent een dynamische teamspeler met gevoel voor humor. Je bent stressbestendig en deadlines zijn heilig voor jou. Je wil veel leren en je zoekt zelf actief naar verrijking van je kennis en uitbreiding van je passie.</p>\r\n<p><br /><span class="text_exposed_show"><br /><br /></span></p>', 4, '2012-05-15 16:06:50', '2012-05-15 16:06:50', 544, 1, '2012-05-15 16:06:50', NULL, 1),
(229, 'Web developer', '<p>Prophets is a marketing &amp; communication agency, based in Antwerp. Digital by nature, we match people &amp; brands. We work for several A-brands. Prophets was founded in 2004 and employs 20 people.</p>\r\n<p>As a Web Developer your main task is to bring our designers'' work to life: whether it''s a website or a web, mobile or Facebook app. Being a developer, you''re challenged to come up with the latest technological solutions and gimmicks that will make our projects stand out, lifting them to a new level.&nbsp;</p>\r\n<p>&nbsp;</p>', 4, '2012-05-21 08:39:44', '2012-05-21 08:39:44', 391, 1, '2012-05-21 08:39:44', NULL, 1),
(230, 'Webmaster H/F bas  Paris (Juin-Aot 2012) puis  Bruxelles', '<p>LWM est une agence de cr&eacute;ation et d''animation de sites web qui existe depuis 2003. Son &eacute;quipe est compos&eacute;e de plus d''une quarantaine de personnes pluridisciplinaires qui travaillent soit directement dans les locaux de ses clients soit &agrave; l''Agence (Paris ou Rennes)</p>\r\n<p><strong>Poste et missions:</strong><br />Fort de l''expansion de l''agence, et dans le cadre du renforcement de son &eacute;quipe, LWM recherche un(e) Webmaster avec un minimum de 2 ans d''exp&eacute;rience pour un CDI bas&eacute; &agrave; Paris de juin &agrave; fin ao&ucirc;t 2012 puis &agrave; Bruxelles d&egrave;s d&eacute;but septembre 2012.</p>\r\n<p>La mission chez l''un de nos grands clients consiste &agrave; :</p>\r\n<ul>\r\n<li>de la saisie de contenu sur CMS</li>\r\n<li>de l''am&eacute;nagement de site et maintenance (mises &agrave; jour)</li>\r\n</ul>\r\n<p>La mission se d&eacute;roule dans les locaux de notre client (d''abord &agrave; Paris puis &agrave; Bruxelles) pour un d&eacute;marrage d&egrave;s que possible.</p>\r\n<p><strong>Profil:</strong></p>\r\n<ul>\r\n<li>Bac+2 minimum, vous &ecirc;tes dipl&ocirc;m&eacute;(e) en informatique ou d&eacute;veloppement multim&eacute;dia</li>\r\n<li>Vous poss&eacute;dez OBLIGATOIREMENT une exp&eacute;rience d''au moins 2 ans sur un poste similaire</li>\r\n<li>Passionn&eacute; avant tout, vous faites aussi preuve d''un bon esprit d''&eacute;quipe pour partagger ainsi vos connaissances tout en d&eacute;couvrant celles de vos collabrateurs.</li>\r\n</ul>\r\n<p>Comp&eacute;tences:<br />Vous maitrisez au minimum les points suivants:</p>\r\n<ul>\r\n<li>Utilisation de CMS</li>\r\n<li>Graphisme (au send large)</li>\r\n<li>Anglais (indispensable)</li>\r\n</ul>\r\n<p>Merci de bien vouloir envoyer votre candidature (CV + lettre de motivation = pr&eacute;tentions salariales) &agrave; marc @lwm-agence.com</p>', 1, '2012-05-21 13:57:42', '2012-05-22 09:49:29', 595, 0, NULL, '2012-05-22 09:49:29', 1),
(231, 'Webmaster H/F chez LWM', '<p>LWM est une agence de cr&eacute;ation et d''animation de sites web qui existe depuis 2003. Son &eacute;quipe est compos&eacute;e de plus d&rsquo;une quarantaine de personnes pluridisciplinaires qui travaillent soit directement dans les locaux de ses clients soit &agrave; l''agence (Paris ou Rennes).</p>\r\n<p><strong>Poste et missions :</strong><br /> Fort de l''expansion de l''agence, et dans le cadre du renforcement de son &eacute;quipe, LWM recherche un(e) Webmaster avec un minimum de 2 ans d''exp&eacute;rience pour un CDI bas&eacute; &agrave; Paris de juin &agrave; fin ao&ucirc;t 2012 puis &agrave; Bruxelles d&egrave;s d&eacute;but septembre 2012.</p>\r\n<p>La mission chez l&rsquo;un de nos grands clients consiste &agrave;&nbsp;:</p>\r\n<ul>\r\n<li>de la saisie de contenu sur CMS </li>\r\n<li>de l&rsquo;am&eacute;nagement de site et maintenance (mises &agrave; jour)</li>\r\n</ul>\r\n<p>La mission se d&eacute;roule dans les locaux de notre client (d&rsquo;abord &agrave; Paris puis &agrave; Bruxelles) pour un d&eacute;marrage d&egrave;s que possible.</p>', 4, '2012-05-22 09:52:17', '2012-05-22 09:52:17', 3, 1, '2012-05-22 09:52:17', NULL, 1),
(232, 'Stickeee', '<p>La plateforme e-commerce <a href="http://www.stickeee.be/">Stickeee</a> d&eacute;velopp&eacute;e sous Prestashop par l''agence <a href="http://www.webadev.com/">Webadev</a> pour le compte de la soci&eacute;t&eacute; <a href="http://www.dkd.be/">DKD</a>, permet &agrave; l''internaute de s&eacute;lectionner et personnaliser des stickers muraux pour d&eacute;corer de mani&egrave;re original son int&eacute;rieur.</p>', 2, '2012-05-22 12:18:27', '2012-05-22 12:37:14', 181, 1, '2012-05-22 12:18:27', NULL, 1),
(233, 'Moonstache ', '<p>Site e-commerce pour la marque belge de lunettes, fun et d&eacute;cal&eacute;es, <strong>moonstache&reg;</strong>.<br /><br />D&eacute;velopp&eacute; sous Prestashop par <a href="http://www.dbcreation.be">DBCREATION</a> et&nbsp;<a href="http://www.davidgeorges.be/fr/index.php">David Georges</a>.</p>', 2, '2012-05-30 06:53:25', '2012-05-30 06:53:25', 72, 1, '2012-05-30 06:53:25', NULL, 1),
(234, 'Cuisines R.Beckers', '<p>R&eacute;alisation d''un nouveau site internet</p>', 2, '2012-06-04 08:57:40', '2012-06-04 08:57:40', 583, 1, '2012-06-04 08:57:40', NULL, 1),
(235, 'Transit de Venus 2012', '<p>Exercice int&eacute;gr&eacute; &agrave; ma formation webdesign au CEPEGRA.</p>\r\n<p>Th&egrave;me impos&eacute;: le transit de V&eacute;nus, contenu libre.</p>\r\n<p>&nbsp;</p>\r\n<p>Mon cheval de bataille:</p>\r\n<p>Animations en HTML/CSS et en SVG</p>\r\n<p>HTML5/CSS3, responsive, W3C valide, IE 8 friendly.</p>\r\n<p>Tous les visuels ont &eacute;t&eacute; cr&eacute;es pour l''occasion.</p>', 2, '2012-06-04 09:12:25', '2012-06-04 09:12:26', 585, 1, NULL, NULL, 1),
(236, 'Prophets creates a crowdsourced composition for TRACK', '<p><em>Tourism Flanders asked Prophets to promote Ghent internationally as a popular tourist destination on the basis of the art-parcours TRACK. Prophets designed &lsquo;Crowd Track Gent&rsquo; an interactive musical piece of art, played with samples of the Ghent carillon in the Belfry.</em></p>\r\n<p>As a visitor of the website&nbsp;<a href="http://crowd.track.be/">http://crowd.track.be</a>&nbsp;you can enter your name and experience how it would sound on the Ghent Belfry. The website visualizes the soundtrack in bells. You can share your soundtrack on social media such as facebook and twitter with a personalized link.</p>\r\n<p>Afterwards you can add your name to the &lsquo;crowd-track&rsquo;. This is a crowd sourced music-composition consisting of the names of visitors. With these names the city-composer and pop music artist An Pierl&eacute; will create a song. She will bring this piece live on the carillon during the final week of the TRACK event. This &lsquo;crowd track&rsquo; will be available as an MP3 on the website.</p>\r\n<p>The campaign was even added as a 42nd piece of art to the official selection of artworks for the TRACK art-festival.<br />Prophets conceptualized the campaign and developed the website in 4 languages. The campaign is aimed at an international audience. Toerisme Vlaanderen activated the campaign through the foreign offices, PR and social media efforts.</p>\r\n<p>&nbsp;</p>\r\n<p>http://crowd.track.be</p>\r\n<p>http://prophets.be</p>', 2, '2012-06-05 09:23:52', '2012-06-05 09:23:52', 391, 1, '2012-06-05 09:23:52', NULL, 1),
(237, 'Drupal Hero', '<p>Bagaar is looking for a skilled Senior Drupal Developer. <br />The ideal candidate will work with the strategy, account and creative teams to design and build innovative digital solutions. <br />He or she will be responsible for working on the development of all digital needs as well as the deployment, testing, debugging and troubleshooting of our various projects. <br />He/she will design, develop, maintain and optimize secure and scalable multi-tier digital programs.<br /><br /><br /></p>', 4, '2012-06-06 13:16:59', '2012-06-06 13:16:59', 483, 1, '2012-06-06 13:16:59', NULL, 1),
(238, 'J&Joy mobile apps', '<p>The J&amp;Joy mobile applications (iOS &amp; Android) allows you to :</p>\r\n<ul>\r\n<li>Read the last news about the brand;</li>\r\n<li>Browse the catalog;</li>\r\n<li>Find the nearest store;</li>\r\n<li>Watch the videos from the Youtube channel.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>The J&amp;Joy concept</p>\r\n<p>J&amp;JOY Clothes are made in the best factories in the world, and are made of the finest fabric to reach the best quality. Our attention to details and the unique style of our garments make each piece of the J&amp;JOY collection a totally unique product.</p>\r\n<p>J&amp;JOY is a &laquo; Casual &amp; Luxury &raquo; clothing line, with our range suitable for those as young as 2 years old and those that seek a size as grand as XXXL. To create this unique product-line , J&amp;JOY gives applies its unique perspective to the selection of fabric and colour, because individuals, at any age, appreciate the combination of beauty, style and comfort.</p>\r\n<p>The principal concept of the brand is to revisit the &laquo; POLO &raquo; in all aspects of the term. We add to it a LOT of colour, in flashy and creative combinations, nice and original prints and embroidery, and give a final &laquo; vintage &raquo; touch thanks to our &nbsp;special washing technique. &nbsp; All those d&eacute;tails are what make for the J&amp;Joy difference and our unique look.</p>\r\n<p>The J&amp;Joy product-line is expanding day by day. &nbsp;You can now find body-warmers, jackets, accessories, hoodies and all.</p>\r\n<p>Let&rsquo;s keep in touch with J&amp;JOY !</p>', 2, '2012-06-11 14:08:49', '2012-06-11 14:08:49', 1, 1, '2012-06-11 14:08:49', NULL, 1),
(239, 'Babel, the cat who would be king', '<p>An interactive children book for iPad and Android tablets available on june 13th, 2012</p>\r\n<p>"Babel is a grumpy old cat and not very bright at all"&hellip; So begins the  fantastic story of a megalomaniac cat who dreams of becoming king and  who dares to create his kingdom at any cost&hellip; but will he succeed?</p>\r\n<p>Official site: <a rel="nofollow" href="http://www.babeltheking.com" target="_blank">babeltheking.com</a><br /> Facebook: <a rel="nofollow" href="http://www.facebook.com/BabeltheKing" target="_blank">facebook.com/BabeltheKing</a><br /> Twitter: @BabeltheKing</p>', 2, '2012-06-12 07:02:30', '2012-06-12 07:02:30', 249, 1, '2012-06-12 07:02:30', NULL, 1),
(240, 'Domaine du Vieux Moulin |Eprave', '<p>R&eacute;alisation d''un template Wordpress customisable par le client.<br />Le template est adaptative et responsible ( &eacute;cran - tablette ) &nbsp;</p>\r\n<p>Demandes du client :&nbsp;</p>\r\n<p>Site accessible pour Internet Explorer 8&nbsp;<br />Mise en avant de l''espace du lieu <br />Mettre en avant les 4 zones du Domaine &nbsp;</p>', 2, '2012-06-15 07:05:35', '2012-06-15 07:05:35', 126, 1, '2012-06-15 07:05:35', NULL, 1),
(241, 'New Getyoo''s website', '<p><strong>Getyoo</strong> provides interactive solutions for congresses, tradeshows and music events.</p>\r\n<p>We thought out and designed a smart and elegant website to showcase Getyoo''s solutions and customers. We kept a balanced design with crafty animations (visit the solutions and scroll ;-)&nbsp;to <strong>emphasize the content</strong> and <strong>create a memorable experience</strong>.</p>\r\n<p>Visit: <a href="http://getyoo.com">http://getyoo.com</a></p>\r\n<p>The story: <a href="http://getyoo.tumblr.com/post/25502336905/new-website">http://getyoo.tumblr.com/post/25502336905/new-website</a></p>', 2, '2012-06-19 14:16:30', '2012-06-20 13:32:54', 411, 1, '2012-06-19 14:16:30', NULL, 1),
(242, 'Butane, a native Campfire client for iPhone', '<p class="p1">As developers of mobile and web applications we are passionate about 2 things:</p>\r\n<ul>\r\n<li>When it''s possible we use native iOS elements in our iPhone apps</li>\r\n<li>We just love <a href="http://www.campfirenow.com" target="_blank">Campfire</a></li>\r\n</ul>\r\n<p>Campfire is a vast part of our working days: we use it to keep the team close and, thanks to Hubot, we can even order our lunch with it. &nbsp;</p>\r\n<p>So we decided to combine those 2 things and the result is Butane, our native Campfire client for iPhone. &nbsp;</p>', 2, '2012-06-26 13:37:00', '2012-06-26 13:39:18', 388, 0, NULL, '2012-06-26 13:39:18', 1),
(243, 'Butane, a Campfire client for iPhone', '<p><a href="http://10to1.be" target="_blank">10to1</a> and <a href="http://www.interfaceimplementation.be/" target="_blank">Interface:Implementation</a> introduce Butane, a Campfire client for iPhone. Butane supports all features of the group chat tool from 37signals.</p>\r\n<p>Campfire is an online chat tool aimed to groups of professional users. Once you''re logged in you can chat in real time with your team mates. The conversations are saved as transcripts and you can search them later on to pick up the thread. Any file you upload stays available for your team.</p>\r\n<p>Butane is a very powerful Campfire client for iPhone. Every detail is ment to stay in touch with your team, everywhere you go.</p>\r\n<p>You can download the app in the <a href="http://bit.ly/getbutane" target="_blank">App Store</a> or you can read more about its features on <a href="http://getbutane.com" target="_blank">getbutane.com</a>.</p>', 2, '2012-06-27 08:54:46', '2012-06-27 10:35:56', 388, 1, '2012-06-27 08:54:46', NULL, 1),
(244, 'SMartEu website, a pioneer of the new SMart online experience', '<p>The new&nbsp;<a rel="nofollow" href="http://www.smart-eu.org/">SMartEu corporate website</a>,&nbsp;which&nbsp;presents SMart pan-European projects and activities, is the first released project to feature the new online experience <a href="http://centraldesign.be" target="_blank">Central Design</a> is working on globally for SMArt Foundation.</p>\r\n<p><strong><a href="http://smart-eu.org" target="_blank">View SMartEu website</a></strong></p>\r\n<p><strong><a href="http://checkthis.com/central-smarteu-org" target="_blank">Read the case</a></strong></p>', 2, '2012-06-28 12:08:14', '2012-06-28 13:35:06', 411, 1, '2012-06-28 12:08:14', NULL, 1),
(245, 'BeMyApp World Cup', '<p><span class="text_faq"> </span></p>\r\n<p><strong>&nbsp;</strong><span class="text_faq">Le principe d&rsquo;un WeekEnd BeMyApp est de  d&eacute;velopper en &eacute;quipe des applications mobiles en 48h non stop. Si vous  &ecirc;tes d&eacute;veloppeur ou designer, ce concours est fait pour vous. Le  vendredi soir &agrave; partir de 19H, les porteurs d&rsquo;id&eacute;es pr&eacute;sentent leurs  projets d''applications et les &eacute;quipes se forment autour des id&eacute;es  retenues.<br /><br />Le prochain WeekEnd sera un peu sp&eacute;cial car  il se d&eacute;roulera dans 4 pays en m&ecirc;me temps ! La BeMyApp World Cup &eacute;lira  l''&eacute;quipe <strong>championne du monde en application mobile !</strong><br /></span></p>', 3, '2012-06-29 08:36:11', '2012-06-29 08:36:11', 481, 1, '2012-06-29 08:36:11', NULL, 1),
(246, 'Webmaster FR/NL for ', '<p><strong>One of our client, Etilux s.a., is looking for a webmaster full-time.</strong></p>\r\n<p>You work in the Marketing and Webmarketing of Etilux. You report to the website manager. You are dynamic and your enthusiasm is contagious.</p>\r\n<p>You are responsible of the following tasks:</p>\r\n<ul>\r\n<li>Content management of etilux.com</li>\r\n<li>French - Dutch / Dutch - French translations (marketing related)</li>\r\n<li>Newsletter management (design / slicing / integration)</li>\r\n<li>Ads and social media monitoring : 	adwords, truvo, facebook, twitter,...</li>\r\n<li>Internet orders monitoring</li>\r\n</ul>', 4, '2012-07-02 08:25:54', '2012-07-02 08:25:54', 63, 1, '2012-07-02 08:25:54', NULL, 1),
(247, 'Firstsight mobile App  BeMyApp Contest', '<p><span class="text_faq">Le principe d&rsquo;un WeekEnd </span><a title="BeMyApp" href="http://be.bemyapp.com/" target="_blank">BeMyApp</a><span class="text_faq"> est de  d&eacute;velopper en &eacute;quipe des applications mobiles en <strong>48h non stop</strong>. </span></p>\r\n<p><span class="text_faq">Si vous  &ecirc;tes d&eacute;veloppeur ou designer, ce concours est fait pour vous. Le  vendredi soir &agrave; partir de 19H, les porteurs d&rsquo;id&eacute;es pr&eacute;sentent leurs  projets d''applications et les &eacute;quipes se forment autour des id&eacute;es  retenues.</span></p>\r\n<p><br />Application d&eacute;velopp&eacute;e par <a title="Pinch Project" href="http://www.pinchproject.com/" target="_blank">PinchProject</a></p>', 2, '2012-07-05 08:12:37', '2012-07-05 08:22:00', 481, 1, '2012-07-05 08:12:37', NULL, 1),
(248, 'Analyst Developer', '<p>Universem, Search Engine Marketing agency, Google Adwords Certified partner and working for clients such as RTL, Carrefour Mobile or Unicef is looking for an analyst developer for internal purpose.In charge of the development of our web application, you will support actively the evolution of the platform. You will be at the heart of the measure and follow-up of the web strategy of our customers. You have strong analytical and development skills, you are dynamic and autonomous?</p>', 4, '2012-07-05 11:00:36', '2012-07-05 11:00:36', 280, 1, '2012-07-05 11:00:36', NULL, 1),
(249, '56k New Website ', '<p><span>Agence web situ&eacute;e &agrave; bruxelles, sp&eacute;cialis&eacute;e dans la cr&eacute;ation de site internet sur mesure via des solutions innovantes utilisant les derni&egrave;res technologies.</span></p>', 2, '2012-07-17 13:43:12', '2012-07-17 13:43:12', 126, 1, '2012-07-17 13:43:12', NULL, 1),
(251, 'Webshop De Stoffenkamer', '<p>A webshop for a Gent, Belgium based fabric and sewing accessories shop&nbsp;(currently only in Dutch). With a faceted browser to browse easily through the catalog.</p>', 2, '2012-08-07 07:27:15', '2012-08-07 07:27:15', 323, 1, '2012-08-07 07:27:15', NULL, 1),
(252, 'Timesheets Pro, Professional time and administration management by 9000 studios', '<h2><img class="bottommargin" src="http://www.9000.be/content/images/1898.png" alt="" /></h2>\r\n<p>Timesheets Pro is een applicatie die door 9000 studios werd ontwikkeld om op een effici&euml;nte manier de administratie te beheren. Ze is ook beschikbaar voor bedrijven, en ondersteunt op de dag van vandaag tientallen ondernemingen in hun tijds- en administratiemanagement.</p>\r\n<p>Met Timesheets hou je op een vlotte, gebruiksvriendelijke manier bij hoeveel werkuren je in een bepaald project ge&iuml;nvesteerd hebt.&nbsp;</p>\r\n<p>Dit kan je dan later opvragen, gesorteerd per project, medewerker of werktype. Op die manier krijg je niet alleen een handig overzicht van de gepresteerde uren, maar kan je ook je tijdsindeling en facturatie beheren en optimaliseren.</p>\r\n<p>Een admin-panel staat je ook toe om een planning op te maken, gebruikers aan projecten toe te voegen en je facturatie te integreren.</p>\r\n<p><strong>Met deze applicatie verlies je geen minuut meer uit het oog!</strong></p>\r\n<p><img class="bottommargin" src="http://www.9000.be/content/images/1895.png" alt="" /></p>\r\n<h5>Waarom kiezen voor Timesheets Pro?</h5>\r\n<p>Wel, omdat deze tool over een aantal unieke troeven beschikt. &nbsp;</p>\r\n<p>Allereerst heb je het grote voordeel dat hij door de ontwikkelaar zelf (9000 studios) wordt aangeboden. Daardoor kan je altijd rekenen op snelle ondersteuning bij eventuele problemen of vragen.&nbsp;Daarenboven wil dat ook zeggen dat de applicatie voor een groot stuk gepersonaliseerd kan worden conform jouw specifieke noden en wensen.&nbsp;</p>\r\n<p>En omdat Timesheets pro in de eerste plaats bedoeld is voor professionele doeleinden, werd er doelbewust gekozen voor een eenvoudige interface. De nadruk ligt op gebruiksvriendelijkheid en effici&euml;ntie. Enkel de basics werden opengesteld zodat je geen tijd hoeft te verliezen aan allerhande ingewikkelde menu''s of tierlantijntjes.&nbsp;</p>\r\n<div>\r\n<ul>\r\n<li>Eenvoudige, gebruiksvriendelijke interface</li>\r\n<li>Maak gemakkelijk zelf nieuwe projecten, werktypes of gebruikers aan</li>\r\n<li>Krijg een volledig overzicht van de gepresteerde uren</li>\r\n<li>Vereenvoudig en optimaliseer je facturatie en dagelijkse werking</li>\r\n<li>Support by 9000 studios</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Ben je ge&iuml;nteresseerd in Timesheets? Neem dan vrijblijvend eens contact op voor meer info!</p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p><img class="bottommargin" src="http://www.9000.be/content/images/1882.jpg" alt="" /><img class="bottommargin" src="http://www.9000.be/content/images/1896.png" alt="" /></p>', 2, '2012-08-08 15:01:34', '2012-08-08 17:44:52', 451, 0, NULL, '2012-08-08 17:44:52', 1),
(253, 'Front End Developer', '<p>We are looking for a skilled frontend developer to help us craft beautiful, engaging, user-friendly websites and web applications, from small to large scale projects.</p>\r\n<p>You will work closely with designers and developers from concept to implementation, using the latest technologies and knowledge in the industry, to support our user experience initiatives.&nbsp;</p>\r\n<p><a rel="nofollow" href="http://centraldesign.be/">Central Design</a>&nbsp;is a human sized webdesign&nbsp;studio located in Brussels. You will join a small team of people who are driven by quality and design and where the bar is set high. We have amazing advantages, including going to paid conferences and events, flexible hours, and your voice matter in the businesses we build.</p>\r\n<p>Some of our most recent projects include:&nbsp;<a rel="nofollow" href="http://getyoo.com/">Getyoo</a>,&nbsp;<a rel="nofollow" href="http://thewordmagazine.com/">The Word Magazine</a>,&nbsp;<a rel="nofollow" href="http://smart-eu.org/">SMart Europe</a>,&nbsp;<a rel="nofollow" href="http://jamendo.pro/">Jamendo Pro</a>.&nbsp;</p>', 4, '2012-08-23 15:25:18', '2012-08-23 15:25:18', 411, 1, '2012-08-23 15:25:18', NULL, 1),
(254, 'Prophets & Mobistar: De Snelste Antwerpenaar', '<p>Mobistar started in August 2012 a pilot-project with her 4G-network. With 4g you can surf up to 10 times the speed of 3G connections. Antwerp was chosen to be the first city to experience a speed-boost. Prophets and Mobistar therefor are on a quest to find the fastest Antwerp inhabitant: "De Slenste Antwerpenaar"</p>\r\n<p>On the website&nbsp;<a href="http://www.desnelsteantwerpenaar.be">www.desnelsteantwerpenaar.be</a>&nbsp;you can submit yourself as a candidate to test the 4G-network during 4 months. You can enter and motivate your application until the end of august. From all the entries, 250 Antwerp inhabitants will be selected. They will receive a free testkit to surf via laptop or tablet over a 4G-connection.</p>\r\n<p>From Septmeber to december 2012 you can follow the experiences of "De Snelste Antwerpenaar". This was you can discover the possibilities of superfast 4G surf-experience. Later this year there will be a public contest to win a unique speed-experience.</p>\r\n<p>Prophets concepted the original idea, is building the online presence and is taking care of program-management and content as well as multimedia production for this campaign.</p>', 2, '2012-08-27 09:28:04', '2012-08-27 09:28:04', 391, 1, '2012-08-27 09:28:04', NULL, 1),
(255, ' Caf Numrique Lige S03 #1: La Monte du Social Consumer & The Bocal Public Launch', '<p>L''individu &eacute;volue dans un environnement <strong>connect&eacute;</strong> en permanence aux <strong> r&eacute;seaux sociaux</strong>. De plus en plus, il interagit, s''informe et se forme  des opinions via ces canaux de communication.<br /> Les outils du web sont vari&eacute;s et le <strong>community management</strong> peut s''av&eacute;rer  difficile pour certaines entreprises. On parle d''<strong>Inbound Marketing</strong>, de  Blogging, de Curation, de Leadership, tant de termes li&eacute;s au web  marketing. Cette nouvelle &egrave;re dite "Sociale" conduit &agrave; de nouvelles  pratiques qui selon leur application, peuvent s''av&eacute;rer n&eacute;fastes ou  b&eacute;n&eacute;fiques pour les entreprises, les m&eacute;dias et la presse.<br /> La conf&eacute;rence a pour objectif de montrer l''importance d''en conna&icirc;tre leur utilisation.</p>\r\n<div class="bg-home-post-top left"><span style="text-decoration: underline;"><strong>Program Schedule</strong></span></div>\r\n<p><span> </span></p>\r\n<p>&nbsp;</p>\r\n<p>19:00 Accueil</p>\r\n<p><span> </span></p>\r\n<p>19:30 Fred Colantonio</p>\r\n<p><span> </span></p>\r\n<p>19:50 Bart Van Den Kieboom</p>\r\n<p><span> </span></p>\r\n<p>20:10 Jeremy Corman</p>\r\n<p><span> </span></p>\r\n<p>20:30 The Bocal Public Launch</p>\r\n<p><span> </span></p>\r\n<p>21:00 The Bocal Party</p>', 3, '2012-08-29 06:48:37', '2012-08-29 08:32:04', 626, 1, '2012-08-29 06:48:37', NULL, 1),
(256, 'Nouveau site internet pour l''agence web Synchrone', '<p>Ce n''est pas sans une certaine fiert&eacute; que Synchrone a le plaisir de vous pr&eacute;senter son nouveau site Internet. Bonne visite !</p>', 2, '2012-09-06 07:29:42', '2012-09-06 07:29:42', 429, 1, '2012-09-06 07:29:42', NULL, 1),
(257, 'V Hack Android Belgium', '<p>\r\n<div class="l-xr me lc">\r\n<div class="Ca a-f-e"><strong>Android''s 5th Birthday</strong> Celebration: Best-of-Best <strong>Hackathon</strong>. In Belgium too.</div>\r\n</div>\r\n<div class="l-Rg IC me lc">\r\n<div class="Nd a-f-e"></div>\r\n<div class="Ca a-f-e note">\r\n<div>Android became public on&nbsp;November 5th, 2007. That means it&rsquo;ll be 5 years of Android this November (2012)! Can&rsquo;t let this go by unnoticed! So BruGTUG decided to organize, together with other GTUGs around Europe, an Android app hackathon tournament.</div>\r\n<div></div>\r\n<div>On <strong>October 5-7th, 2012</strong>, you will be able to participate in a local hackathon organized in Genk. The <strong>winning</strong> team receives a chance to defend our user group in a <strong>final pan-European hackathon in London</strong>, flight and hotel paid for. This TopGun hackathon takes place on the weekend of October 26th-28th, right after <strong>Droidcon London</strong>.</div>\r\n<div></div>\r\n<div>Android developers from all over Europe will come together from tens of locations and hack for 48 hours - nonstop!</div>\r\n<div><br /><em>Hashtag: #AndroidV #BE #Genk</em></div>\r\n<div><em><br /></em></div>\r\n<strong>&nbsp;</strong></div>\r\n</div>\r\n</p>', 3, '2012-09-17 06:57:22', '2012-09-17 06:57:22', 635, 1, '2012-09-17 06:57:22', NULL, 1),
(258, 'Technico-commercial Web / TIC', '<p>Synchrone vous propose d&rsquo;int&eacute;grer son &eacute;quipe pour participer &agrave; son d&eacute;veloppement, en qualit&eacute; de technico-commercial Web / TIC.</p>\r\n<p>Apr&egrave;s une formation sur nos solutions et notre culture d''entreprise vous  serez responsable du d&eacute;veloppement de votre portefeuille client.</p>', 4, '2012-09-22 07:09:59', '2012-09-22 07:09:59', 429, 1, '2012-09-22 07:09:59', NULL, 1),
(259, 'Lasku Redesign', '<p>Dandy Coding redesigned the website of Lasku, an online invoicing application.</p>', 2, '2012-09-24 09:05:15', '2012-09-24 09:05:15', 574, 1, '2012-09-24 09:05:15', NULL, 1),
(260, 'Smart Living Objects webshop', '<p>Design &amp; development of a webshop for XL Boom brand Smart Living Objects. We tried to make a purely functional design, that matches the object''s&nbsp;aesthetics.</p>', 2, '2012-09-28 07:00:28', '2012-09-28 07:00:28', 323, 1, '2012-09-28 07:00:28', NULL, 1),
(261, 'Prophets most nominated agency at the IMC European Awards', '<p class="p1">Prophets was nominated 5 times for the IMC European Awards. No other European finalist was awarded this amount of nominations. Prophets was selected for it''s remarkable campaign ''a Phygital Tour of the MAS'' for the occasion of the opening of the Antwerp ''Museum aan de Stroom''.</p>\r\n<p class="p1">The IMC European Awards reward campaigns that differentiate in the field of Integrated Marketing Communications.&nbsp;</p>\r\n<p class="p1">During seven weeks 53 members of the jury with a background in marketing reviewed the entries. Only campaigns that have won a local IMC award where eligible to enter the European competition.&nbsp;</p>\r\n<p class="p1">The campaign ''''A Phygital tour of the MAS" was granted nominations in five different categories.</p>\r\n<p class="p1">Prophets is in the running for an award in the categories ''Integrated Communication, ''Innovative Idea or concept, ''Brand-building'', ''Product Launch/Relaunch/Trial Campaigns'' and ''Direct 1:1 Communication and Digital Communication''.</p>\r\n<p class="p1">With ''A Phygital tour of the MAS'' Prophets brought the Antwerp ''Museum aand de Stroom'' under global attention. Using the arrows on the keyboard virtual visitors could direct the human guides in the museum. Every guide wore a remote camera.&nbsp;</p>\r\n<p class="p1">This way the virtual visitors could see what the guide saw and take a real time tour through all the expositions.</p>\r\n<p class="p1">Previously Prophets has won a national IMC award and 2 IAB MIXX Awards with this campaign.</p>', 1, '2012-10-01 17:47:34', '2012-10-01 17:47:34', 391, 1, '2012-10-01 17:47:34', NULL, 1),
(262, 'KIKK Festival', '<p>Registrations are now OPEN! You know what you''ve got to do!</p>\r\n<p>&nbsp;</p>\r\n<p><span>KIKK is a festival of creativity in digital cultures that explores the economical and artistic implications of new technologies through Konferences, disKussions, eKsperiences, worKshops, a Kontest and Kocktail party. KIKK takes place as part of the "Semaine de la Cr&eacute;ativit&eacute;" (week of creativity) in Wallonia.</span></p>', 2, '2012-10-09 08:31:22', '2012-10-09 08:31:22', 633, 1, '2012-10-09 08:31:22', NULL, 1),
(263, 'Stop Child Porn - Child Focus', '<p>Creation of a website to promote the action, were the surfer can show his support to the cause.</p>', 2, '2012-10-09 14:28:26', '2012-10-09 14:28:26', 642, 1, '2012-10-09 14:28:26', NULL, 1),
(264, 'Copywriter', '<p>A copywriter is urgently needed for a project of campaign. If available right now, please contact me.</p>\r\n<p>The project is in French.</p>\r\n<p>&nbsp;</p>\r\n<p>J''ai besoin d''un copywriter disponible imm&eacute;diattement pour un projet de campagne de communication. Si vous &ecirc;tes disponible imm&eacute;diatemment, svp contactez-moi.</p>\r\n<p>Projet en fran&ccedil;ais.</p>', 4, '2012-10-10 07:24:40', '2012-10-10 07:24:40', 509, 1, '2012-10-10 07:24:40', NULL, 1),
(265, 'Dveloppeur Web - Responsable Qualit Web', '<p class="p1">Encadrer l''&eacute;quipe qui assure la conception, le d&eacute;veloppement et la maintenance des sites et des applications web.</p>\r\n<p class="p1">Assurer le suivi de la qualit&eacute; en fonction d''objectifs d''innovation et d''am&eacute;lioration continue ainsi que de crit&egrave;res sp&eacute;cifiques au support web : interop&eacute;rabilit&eacute;, accessibilit&eacute;, performance.</p>\r\n<p class="p1">Apporter un support technique et un conseil &agrave; la conception et la production des services web et interagit avec tous les acteurs concern&eacute;s.</p>', 4, '2012-10-11 14:16:02', '2012-10-11 14:18:25', 643, 0, NULL, '2012-10-11 14:18:25', 1),
(266, 'Mister Jekyll, nouvelle agence web dans le paysage belge', '<p class="intro"><img class="thumbnails-article" style="float: left;" src="http://www.digimedia.be/img_look/atualite/100-100/jekyll.jpg" border="0" alt="Mister Jekyll, nouvelle agence web dans le paysage belge" /><strong>Victor Miguel, Cl&eacute;ment Noterdaem et Philippe Emmanuel Vreuls, trois entrepreneurs bruxellois, viennent de lancer leur agence web&nbsp;: Mister Jekyll.</strong></p>\r\n<p>Cette nouvelle agence se charge du d&eacute;veloppement de sites web, d&rsquo;applications &agrave; destination des PME et des grandes entreprises. Mister Jekyll se sp&eacute;cialise &eacute;galement dans le Responsive Web Design (RWD), cette m&eacute;thode qui adapte l''apparence et l''ergonomie d''un site unique &agrave; un large &eacute;ventail de terminaux.</p>\r\n<p>&laquo; L''utilisateur est nomade; il visite un m&ecirc;me site en utilisant de nombreux terminaux, et il exige une exp&eacute;rience consistante et transparente sans que les fonctionnalit&eacute;s ou les contenus ne diff&egrave;rent ou ne soient tronqu&eacute;s. C&rsquo;est la raison pour laquelle nous r&eacute;fl&eacute;chissons, d&egrave;s la conception, &agrave; ce qu''un site fonctionne sur un large &eacute;ventail de produits, du PC au smartphone en passant par les tablettes.&nbsp;&raquo;, ajoute Victor Miguel, Creative Director chez Mister Jekyll.</p>', 1, '2012-10-17 08:42:10', '2012-10-17 08:42:10', 638, 1, '2012-10-17 08:42:10', NULL, 1),
(267, 'Encore Combien de dodos?', '<h2 class="content">de l''impatience sociale<br />avec un poil de complexe de peter pan</h2>\r\n<div class="inner">\r\n<div class="view clearfix">\r\n<h2 class="content">1. rentrer la date et l''&eacute;v&egrave;nement</h2>\r\n</div>\r\n</div>\r\n<div id="block-50843ac950be630200000499" class="block title">\r\n<div class="inner">\r\n<div class="view clearfix">\r\n<h2 class="content">2. Combien de dodos reste il ?</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<div id="block-50843af3635b5202000004de" class="block title">\r\n<div class="inner">\r\n<div class="view clearfix">\r\n<h2 class="content">3. Partager votre impatience avec vos amis&nbsp;</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>', 2, '2012-10-22 12:44:36', '2012-10-22 12:44:36', 585, 1, NULL, NULL, 1),
(269, '.NET Developer ', '<p>You will join our team to take charge of analysis and development of ambitious projects.</p>\r\n<p>You will be working as part of a skilled team, in a very "human" environment.</p>\r\n<p>We place great emphasis on motivation and skills.<br />Knowledge of the second language and/or English is a plus.</p>\r\n<p>We will offer you an indefinite contract and maintain a policy of continuous training to guarantee your professional development.</p>\r\n<p>We place great emphasis on relationship-building qualities.</p>\r\n<p>Knowledge of the second language and/or English is a plus.<br />We will offer you an indefinite contract and maintain a policy of continuous training to guarantee your professional development.</p>\r\n<p>Interessed ?<br /><br /></p>', 4, '2012-10-24 14:13:07', '2012-10-24 14:13:07', 202, 1, '2012-10-24 14:13:07', NULL, 1),
(270, 'Immoweb hire a Webdesigner', '<p><span>As Web Designer for Immoweb your role will be:</span><br /><br /><span>To provide during product ideation, market research and concept development fresh ideas, wireframes, screen mockups, interactive demos;</span><br /><br /><span>To interact with Immoweb&rsquo;s product managers in developing storyboards/wireframes that meet functional requirements in new feature / product development and maintenance;</span><br /><br /><span>To create deliverables at varying levels of completeness: from quickly communicating a concept''s value proposition to final artwork and specifications delivered to the IT Development Team;</span><br /><br /><span>To provide graphical guidelines for the design of our online &amp; mobile products;</span><br /><br /><span>To create visual UI elements that embody product/service function and brand, including screen layouts, buttons, icons, etc.</span></p>', 4, '2012-10-25 08:28:19', '2012-10-25 08:28:19', 87, 1, '2012-10-25 08:28:19', NULL, 1),
(271, 'CSS/HTML/JS Ninja', '<p><strong>If you&rsquo;re a talented, motivated and experienced front end developer and if you&rsquo;re familiar</strong></p>\r\n<p><strong>with the classic (javascript, CSS, &hellip;) and the latest web standards, this job is made for you.</strong></p>\r\n<p>As a front end developer you will support the design and the development teams, being a key element providing an essential bridge between both. Standard and validated code will be essential in your projects.&nbsp;</p>\r\n<p>You&rsquo;ll work on long-term projects facing many challenges. You&rsquo;ll have to be able to function in a team-based environment as well as independently, while being obviously up-to-date with the latest technologies and looking for innovative solutions.</p>\r\n<p><span>Created in 2001 and based in Li&egrave;ge, IN FINE is a studio specialized in graphic creation, brand activation.</span><br /><span>An agency with a human side, which values the direct relationship between the client and the creation.</span><br /><span>In July 2011, due to a growing need for Digital creative services we created IN FINE DIGITAL.</span><br /><span>Our digital department is dedicated to the creation of digital assets with high added value.&nbsp;</span><br /><span>IN FINE works for national &amp; international companies and brands such as Walt Disney, Google, Belgacom, Kraft foods, Campbells, Danone, Sita Suez, RTL Group,... Discover our latest works on www.infine.net</span></p>', 4, '2012-10-25 09:11:39', '2012-10-25 09:11:39', 12, 1, '2012-10-25 09:11:39', NULL, 1),
(272, 'Mister Jekyll - Foundation''s case study', '<p><span>I am featured on Foundation''s website, the responsive front-end framework used on my site.</span></p>', 2, '2012-11-02 11:41:21', '2012-11-02 14:19:35', 638, 0, NULL, '2012-11-02 14:19:35', 1),
(273, 'Mobile strategy for Social networks', '<p>As social networks usage on mobile is increasing, different online  networks are striving to capture this audience and in the meantime  transform their own business model.  What do these social networks have  to offer for mobile app developers and marketeers? <br /> 18H Welcome <br /> 18H30 Already confirmed:<br /> Dorien Aerts, evanglist Mobile Vikings , "How a mobile operator uses social networks"<br /> <br /> XX, Corelio<br /> Georges-Alexandre Hanin,  CEO Mobilosoft <br /> And working hard to to have confirmation from Netlog/Twoo and Viadeo</p>\r\n<p>REGISTER on: http://www.mobilemonday.be/</p>\r\n<p>tx to TCS Digital World</p>', 1, '2012-11-14 12:26:23', '2012-11-15 11:49:57', 660, 0, NULL, '2012-11-15 11:49:57', 1),
(274, 'Mobile developper', '<p>We are currently looking for a mobile IOS/Android developper for a long term project.</p>\r\n<p>A unique opportunity !</p>', 4, '2012-11-26 12:47:18', '2012-11-26 12:47:18', 12, 1, '2012-11-26 12:47:18', NULL, 1),
(275, 'New Marlon website', '<p>Like any good carpenter, we never took the time do redo our own website. After two years in the making, it''s finally here.</p>\r\n<p>*wipes sweat from eyebrow*</p>\r\n<p>(only in Dutch for the moment, working on those translations).</p>', 2, '2012-11-30 08:45:53', '2012-11-30 08:45:53', 323, 1, '2012-11-30 08:45:53', NULL, 1);
