(21, 21, 'I''m a passionate webdesigner/frontend developer. \r\nBesides my work i love playing music, asian food and photography.\r\n\r\nI''m always trying to combine client ideas with best pratices and my personal touch to create beauty-use-ful websites. I usually use Ruby on Rails, haml, compass & 960gs\r\n\r\nSpecialties:\r\nGetting things done\r\nFigure out what are the real problems you should focus on and find a solution for them', '2011-11-17 13:23:31', '2011-11-17 13:25:58'),
