(485, 485, 'Journaliste professionnel durant 18 ans, je mets cette experience au profit des entreprises innovantes, en particulier les PME, installes en Rgion wallonne.\r\n \r\nJe traduis le langage de l''entrepreneur et du scientifique en un langage appropri pour les medias. Je traduis des innovations technologiques en "belles histoires".\r\n \r\nJe veux augmenter la visibilite de ces entreprises et leur apprendre  le faire de maniere recurrente.\r\n \r\nDepuis octobre 2003 jusqu''en novembre 2011, j''ai pu assister 91 entreprises dans la mise en place dactions de communication qui ont gnr 616 articles de presse, reportage TV, dossiers techniques,.\r\n ', '2012-01-27 08:53:42', '2012-01-27 08:57:15'),
