(491, 491, 'Webdesigner enthousiaste et rigoureux, je suis  la recherche d''une nouvelle opportunit d''emploi.\r\n\r\nUne exprience professionnelle de plus d''un an ma permis de me familiariser avec les diffrents aspects du mtier, et d''acqurir de solides comptences dans la cration de layouts et l''intgration en language web.\r\n\r\nMon objectif est d''intgrer une quipe active et crative afin de m''panouir sur des projets intressants.', '2012-02-02 10:30:21', '2012-02-02 10:32:50'),
(492, 492, NULL, '2012-02-02 22:52:53', '2012-02-02 22:52:53'),
(493, 493, 'Forme au e-commerce et  l''intelligence stratgique, je souhaite voluer au service des PME: y faire valoir mon esprit d''analyse, mon leadership, ma crativit, mon ouverture d''esprit et ma capacit  jeter des ponts entre des gens, des domaines diffrents. Je suis passionne par l''innovation, les ides avant-gardistes, ainsi que par le web, ses outils et sa dimension stratgique pour l''entreprise.\r\n\r\nProactive, crative et persvrante, je m''intresse notamment au e-marketing, au Web Analytics,  l''criture optimise pour le Web,  ses dveloppements collaboratifs,  l''dition et la diffusion d''ebooks, au monde pharmaceutique et aux arts.\r\n\r\nJ''ai  mon actif diverses expriences en communication off- et online: gestion de projets de sites web, organisation d''une campagne TV-radio sur l''pilepsie (2004), refonte de logo, rdaction d''un livre blanc, rdaction pour une revue experte dans le domaine des assutudes ("Prospective Jeunesse - Drogues-Sant-Prvention"), relecture d''un roman (Editions Labor), criture (notamment pour le web), communication avec les mdias...\r\n\r\nJe ralise une veille partage sur les thmes suivants (voir: http://www.scoop.it/u/anne-discart):\r\n- E-marketing et innovation: comment l''e-marketing peut servir l''innovation?\r\n- Veille, curation, tendances: comment trouver, produire et diffuser de l''information stratgique de qualit sur le web, au service des PME. Actualits, pratiques, tendances.\r\n\r\nVisualisez mon parcours professionnel en 10 secondes: http://vizualize.me/annediscart', '2012-02-03 11:29:57', '2012-02-03 11:55:02'),
(494, 494, '', '2012-02-03 14:28:59', '2012-02-03 14:41:19'),
(495, 495, '', '2012-02-03 15:56:18', '2012-02-03 15:58:40'),
