(500, 500, 'Dj vaguement connu (par sa mre et son chat) sous le nom de flatLand!, Pierre-Antoine Delnatte se paie le luxe de parler de lui  la troisime personne et de bosser  mi-temps au sein de la socit ID&Co,  Tournai.\r\n\r\nImport des hauteurs de Lige pour (re)lancer le ple web de l''agence, je suis probablement le premier "Directeur technique  mi-temps" de l''histoire.\r\nMais ce n''est qu''un &lt;h1&gt; : au sein d''ID&Co, je suis celui qui ralisera votre site, le bichonnera, lui tapotera dans le dos lorsqu''il devra faire son petit rototo, et le surveillerai avec attendrissement tout au long de sa vie...\r\nUn taf loin d''tre de tout repos.\r\n\r\nAvant tout a ? J''ai bourlingu de droite  gauche, en Belgique, au Luxembourg, faire du web, en France, faire du web et du jeux vido... une petite carrire bien remplie qui ne va pas s''arrter l !\r\n\r\nAh oui, je m''auto-aime, aussi. C''est plus mieux.', '2012-02-06 13:11:01', '2012-07-19 16:49:01'),
