(595, 595, 'LWM (originally Les WebMasters) was born in 2003. \r\nIts core business used to be the creation and animation of websites on a B to B basis.\r\n\r\nIt soon realized that once websites had been completed, its customers'' aspiration or even requirements were aiming at getting resources on their own premices for the completion of different web tasks ranging from general webmastering to project management.\r\n\r\nWith a staff of more than 40 people located in between Paris and Rennes, France and a turnover of more than 2 M  in 2011, LWM is today enjoying a steady development not only within its Fixed-Priced Projects Dept, but also within its Time and Materials Dept.\r\n\r\nMy role at the "Time and Materials" Dept consists in finding new business at existing or non existing customers. \r\nI thus enjoy partaking in the business development of the Agency, thus also being the trigger to the recruiting of new staff.', '2012-05-21 13:16:06', '2012-05-21 13:39:37'),
