(660, 660, 'Armenian from BG living in BE, cosmopolitan in understandings, communication manner & perceptions.\r\n\r\nI work in the field of ICT & media with a main focus of Europe. I''m a dedicated business development strategist & manager in the field of digital. My expertise is in corporate strategy and corporate development, concept development of digital products and services, innovation, ICT policy making, and marcom with 5 years of relevant experience in the field. I strongly believe in the correlations between the ICT as a tool of innovation, the society and the entrepreneurship as a feature of our generation.\r\n\r\nFluently speaking German, English, Armenian, Bulgarian, I also communicate in all Slavonic languages and more. I''m a Computer Engineer from the German faculty program of TU-Sofia and TU-Karlsruhe, holding also a M.Sc. degree in Communication Sciences from VUB-Brussels. My strongest sides are my leadership, communication and strategic conceptualization skills, combined with my industry and EU public sector expertise on international level.\r\n\r\nIm a member of IABC, AGBU and HAI-TAD Bulgaria. Ive written a travel e-book about Armenia and I''ve been awarded with several prizes in the fields of social affairs, sustainable development, journalism.\r\n\r\nMy personal blog reflects over the innovation topics, media and the big global trends.\r\nSpecialties\r\n\r\nBusiness Strategy, Business Development (Presales, Bid Management and Proposal Writing), ICT Consultancy, Digital Marcom Strategy, EU Procurement, International relations, Editorial, Informatics', '2012-10-31 11:04:03', '2012-10-31 11:18:15'),
